INSERT INTO `review` VALUES (1,246,149,'2019-05-17 12:03:11','None','“你敢保证你一辈子不得病？”纯粹、直接、有力！常常感叹：电影只能是电影。但每看到这样的佳作，又感慨：电影不只是电影！由衷的希望这部电影大卖！成为话题！成为榜样！成为国产电影最该有的可能。',4),(2,253,41,'2019-05-21 07:21:11','我读解忧杂货店','王传君所有不被外人理解的坚持，都在这一刻得到了完美释放。他不是关谷神奇，他是王传君。',3),(3,211,97,'2019-05-02 13:06:11','我读小王子','你看，即使依旧烂片如云，只要还有哪怕极少的人坚持，中国影视也终于还是从中生出了茁壮的根。',3),(4,30,7,'2019-05-12 18:32:11','我读白夜行','我不是药神，治不好这世界。但能改变一点，总归是会好的。',5),(5,250,59,'2019-05-12 07:34:11','我读围城','当然算不上杰作，但放豆瓣语境下，是部时至今日终于拍出来的国产“高分韩国电影”。拿现实题材拍商业类型片，社会意义摆在那，群戏也处理得相当不错。对我们国家而言，这样的电影多一部是一部，走一步是一步。',5),(6,41,4,'2019-04-22 18:27:11','我读三体:“地球往事”三部曲之一','这不是“中国版《达拉斯买家俱乐部》”，这是中国的真实事件改编的中国电影，是属于我们自己的电影，不知道就去百度一下“陆勇”。',5),(7,132,228,'2019-05-17 14:14:11','我读嫌疑人X的献身','文牧野眼睛太毒了，观众的笑点、泪点、痛点被他牢牢抓住，徐峥现在不拼演技开始掏心炸肺放脱自我了，药物在中国绝对是个“不可说”，但这个电影说了它能说的，也不显山不漏水的说了它所不能说的，讲的是现实，但看过电影之后才会明白其实是超现实，2018最佳!',3),(8,174,134,'2019-04-28 07:43:11','我读活着','小时候路过一家药店，门口的对联写着“只愿世间无疾病，何愁架上药染尘”',5),(9,246,90,'2019-04-26 11:03:11','我读挪威的森林','最大的病，其实是穷病。真的被感动了，整体都很成熟，也有些许韩片的影子。几个演员表演都非常出色。可看性和内在的表达都不错。这个世界最荒诞在于，越贴近真实，真实越荒诞。人这一生，太不易了。最后，王传君，加油哦！',4),(10,44,74,'2019-05-23 00:44:11','我读百年孤独','我就是想实名表扬一下王传君，内地青年演员里竟然也有这种会演戏并且很卖力的实力派演员，这要是搁在好莱坞，他能拿下一座奥斯卡最佳男配。像这样的现实主义题材电影，如果编剧不是韩家女，它可能连拍摄许可证都拿不到，过审更没戏，它在国内的审查制度下没有可复制性，像这样的电影，且看且珍惜吧！',3),(11,14,41,'2019-05-04 09:26:11','我读红楼梦','“今后都会越来越好吧，希望这一天早点来”口罩成为符号，不是雾霾，而是人性的仪式，结尾竟然看到《辛德勒名单》一样的救赎。通俗感人，上海电影节首映哭倒一片，基于真实事件改编的社会意义加分，或许《我不是药神》之于中国，就像《摔跤吧爸爸》之于印度吧…能看到就不错。“其实只有一种病：穷病”',4),(12,219,137,'2019-05-21 05:02:11','我读看见','人生建议：别买零食，吃不下的。',5),(13,226,94,'2019-05-03 18:25:11','我读平凡的世界（全三部）','你的一个举动可能会改变别人的一生，酒吧领班从此爱上了钢管舞。',5),(14,251,119,'2019-05-06 14:39:11','我读三体Ⅱ:黑暗森林','三星电影，优缺点都很明显。多加一星是很佩服创作者戴着脚镣跳舞时挟带的私货，表面上其实很媚俗地迎合了审查，但同时又把所有的“不能说”都藏在了全片的各个角落，只露出来一点点让有心有共鸣的观众能够心领神会，就跟海斯法典时期的美国电影一样，给观影添了一层乐趣。',4),(15,8,119,'2019-05-10 19:19:11','我读三体Ⅲ:死神永生','炸裂，哭成狗，从观影体验上看，比达拉斯买家俱乐部好，之间隔了差不多五个《动物世界》，导演处女作就这完成度，只能说剧本实在太好。我爸爸也是药神的受益者之一，否则我应该房子也没了。感谢他们。',3),(16,108,97,'2019-05-17 03:03:11','我读不能承受的生命之轻','不涂彩不抹粉不抛光，近年来少见的现实主义力作。更可贵的是，清清楚楚地写中国的事，写印度的事，清清楚楚地表明这是上海，车牌上大大方方印着沪，而现在很多电影已经愈发架空现实了。战争题材写到恐怖分子得虚构一个不存在的国家，犯罪题材得虚构一个不存在的城市。《药神》为中国现实主义挽回尊严。',5),(17,263,51,'2019-05-21 07:12:11','我读达·芬奇密码','电影能做到的好，这部电影都做到了。剩下的是这个时代不让它更好。在我们刚刚经历过的时代巨变洪流之中，有无数这样的小人物在时代洪流中艰难生存着，同时在竭力不丢失他们的灵魂。终于有这样一部电影，让我们能够看到时代，看到善意，看到希望。希望这部电影也能被这个时代善待。',4),(18,240,120,'2019-05-19 07:42:11','我读我们仨','为一句“谁家还没个病人”泪流满面 感叹生命在“穷病”面前无药可救 感慨中国终于有了属于我们自己的有力量的电影 所有演员都非常出色 近年最好的群像表演 请记住这些电影人 宁浩 文牧野 徐峥 周一围 王传君 谭卓 章宇 杨新铭 王砚辉 咱们电影还是有希望的 愿中国的电影越来越好 谢谢',5),(19,154,19,'2019-05-17 08:00:11','我读天才在左疯子在右:国内第一本精神病人访谈手记','特效是真实人性，特技是上映成功。',4),(20,273,230,'2019-05-05 20:12:11','我读简爱（英文全本）','最喜欢王传君的表演啊，几乎所有泪点都给他了！！而他曾经的同伴们，下月继续拿《爱情公寓》电影版面对观众。这个圈子里还是有不爱赚快钱的年轻演员，真好。',4),(21,7,94,'2019-05-20 07:54:11','我读哈利·波特与魔法石','他想活下去，他有什么罪！！5555，我妆都哭花了。几个主演的演绎太走心了，特别是徐峥和王传君，感觉要成精了。仅有几个镜头的老奶奶也贡献了催人泪下的精彩演绎。提醒大家，一定要带纸巾！一定要带纸巾！一定要带纸巾！回头我会写一个走心的长评。',4),(22,17,25,'2019-05-22 09:48:11','我读明朝那些事儿（壹）:洪武大帝','“他才20岁，想活命有什么罪”',5),(23,113,238,'2019-04-27 07:27:11','我读傲慢与偏见','一会逗你笑，一会又让你哭。王传君吃火锅最后面对徐峥那段：由嬉皮笑脸到嘴角抽搐再到心碎无奈推门而出，微表情拿捏到位，太好了。',3),(24,202,193,'2019-05-03 09:25:11','我读目送','宁浩就别洗白了，是不是题材好就可以瞎几把拍？',4),(25,223,46,'2019-05-26 06:07:11','我读恶意','比较反感这类戴着批判现实主义帽子的电影却使用了大量讨好大众的商业片常用媚俗技巧（重点表现在笑点与哭点的有意设计），剧作方面最大的问题是徐峥的转变缺乏说服力缺乏震撼力度，人性恶看不到，人性善很牵强。2.5',5),(26,82,98,'2019-05-19 13:11:11','我读撒哈拉的故事','只要提到价值，中国电影的标准便会坍塌。明眼人都看得出，幕后黑哪是一脸奸相的大药厂，又或者，结尾辩方律师可以再底气不足一些。前后大发感言的两名老太，表演模式有何本质不同。徐峥的转变与倒贴，全是目睹惨相的愧疚觉悟——而在这样一部电影里，最不缺的就是惨。被消灭的，何止是戴口罩的病人',4),(27,233,238,'2019-05-04 08:21:11','我读霍乱时期的爱情','        祝贺学院硕士毕业生文牧野出手不凡，导演了这样一部扎实、感人、有见地的处女作！看片中常在想：在疾病、死亡面前，一些常规的道义、是非怎么都成了反意？先人说过“合情合理才是好法。”那么实践证明已经不合情理的法律规章就应该改掉它！直面现实，促人思索，这样的作品值得夸赞！',5),(28,116,157,'2019-05-26 03:52:11','我读飘','看了一下差评，基本是自诩为独立专业的几个影评人给的吧，果然又要说电影语言，商业媚俗之类，固然把这个题材拍成侯孝贤、蔡明亮那样，影评人会有高潮，但你们其实喜欢的是影院里就坐着你们两三个人那种感觉不是吗？没有这种电影，电影人在时代急速抛弃弱势群体的巨变中，就是完全失语的。',3),(29,95,67,'2019-05-17 21:38:11','我读许三观卖血记','连群演老太太都猛戳我泪点，以后再也不能吹自己泪点高了',5),(30,286,54,'2019-05-12 04:00:11','我读边城','它远远不够好，但是对于现在的中国电影市场来说，它又好得要命。',3),(31,162,208,'2019-05-16 09:01:11','我读倾城之恋','好电影',3),(32,117,83,'2019-05-04 21:50:11','我读送你一颗子弹','微妙地在谄媚审查机制和迎合市场需求间取得平衡。看似蜻蜓点水地在法理与人情之间徘徊着作了一番试探性反思，却无比精明地把通过对政府（结尾法制宣传）和主角（“神性”的被赋予）这两极所本该承受的无论社会的、道义上的道德指责一股脑儿的推给大资本，本质上是取巧的推卸责任行为。',5),(33,7,138,'2019-05-24 02:25:11','我读狼图腾','50/100 又一个高压审查下变了味儿的作品，整部片子里都是好人，就外国奸商是坏蛋。观众感动得一塌糊涂，再看完结局字幕，药进医保了，吃下了这颗廉价但有效的安慰剂。就一个问题，中国进口药的高价是外商定价的锅？牵扯到版权就更让人难免浮想联翩。',4),(34,248,211,'2019-05-18 06:46:11','我读哈利·波特与阿兹卡班的囚徒','可别吹了，有陆勇案这么好的原型故事做底子却拍成了超长春晚小品，先来段子笑料堆砌后催泪煽情。沾了题材的光，其实没什么货真价实的东西，人物的转折和情节设计的功能性和指向性也非常套路，故事讲得都差强人意，更遑论社会批判了。借赵本山的小品说，真没要啥自行车，看看报道可不好笑且远比这有启发',5),(35,143,192,'2019-05-04 07:26:11','我读哈利·波特与火焰杯','完全没有讽刺的意思，我觉得做为一段儿带上海腔的催泪快板儿书，挺煽的。但是电影意识，没找见。不过如今去影院看电影，大家都不在乎后者有还是没有了。',4),(36,246,132,'2019-04-27 05:16:11','我读盗墓笔记:七星鲁王宫','直面现实问题，勇气可嘉。但把矛头指向药物研发厂家是不公正的，药物研发需要巨额资金投入和漫长的时间成本投入。试想如果无人去研发药物，仿制药又何从仿起？对于病人来说，那才真的是只能等死。不过要是把矛头指向了应该指向的所在，这部电影也就无法上映了，所以想通过电影来改变现实的人，醒醒吧。',5),(37,94,118,'2019-04-30 02:10:11','我读情人','一部一切为了10W+核心叙事目的服务的伪现实主义之作。弱肉强食的中国人太需要自我感动和自我构建了。流下眼泪便以为自己拥有了善良。',4),(38,135,114,'2019-05-05 12:04:11','我读哈利·波特与密室','虽然有刻意有煽情，但是这个时代触碰这样的题材实在难得，电影拍出了集体群像下的人物特质，还拥有了史诗感。现实题材不做无畏的对抗，只是展现。魔幻到让人怀疑真实，但是根据真事改编的真相知道后更是眼泪掉下来。主角原型无锡药侠陆勇先生，企业家，有白血病，电影作了一定模糊处理，新闻了解一下。',5),(39,125,78,'2019-05-17 11:33:11','我读穆斯林的葬礼','中国电影是道填空题。讨厌辛德勒的名单',5),(40,134,29,'2019-05-10 07:45:11','我读万历十五年','极不舒服的现实消费，比还恶劣。',4),(41,263,236,'2019-04-30 01:20:11','我读人间失格','这九分并不是针对这部电影的基本创作，而在于它的题材，表现的社会现实意义大过了电影里的其他东西..',4),(42,20,165,'2019-04-28 05:52:11','我读窗边的小豆豆','拍成这样，7.0 over',5),(43,184,236,'2019-04-22 20:31:11','我读老人与海','8.5，给五星以资鼓励。每个人都演技在线，演思慧的女演员在暴裂无声里演哑巴的老婆，演得真的很好，心目中的今年国产片前二竟然都有她。',5),(44,201,101,'2019-05-04 21:12:11','我读1Q84BOOK1:4月～6月','当看见草坪上奔跑的孩子，你流下了两行“前后紧密相连”的热泪：第一行是说，看见了孩子在草地上奔跑，多好啊；第二行是说，和所有的人类在一起，被草地上奔跑的孩子们所感动，多好啊。（我复制的，没错，这部电影太媚俗了，因为看完你只会觉得自己一定要多挣钱。）',4),(45,33,69,'2019-05-10 14:07:11','我读1984','虽不算完美，有些国产片的小毛病，但牛逼在于华语片环境下这个故事和题材，以及所有的演员。敏感的社会话题，法外义侠的设定，对现实的反衬，对制度的思考，群戏太棒。徐峥和宁浩，在《无人区》之后又一次探明了审查的底线，还有这个类型片的价值，对于华语片意义重大',3),(46,227,174,'2019-05-13 17:44:11','我读黄金时代:时代三部曲','我一直以为牧师是金士杰演的哈哈哈哈哈哈竟然不是',5),(47,39,201,'2019-05-01 02:18:11','我读哈利·波特与混血王子','无法想象下一部这样的电影会是什么题材、能是什么题材，感觉就像是领受了上头扔下来的一根肉骨头一样。王传君真的太好了，周一围最后靠在车上等人的那一幕帅得我愿意为他入狱三年……',3),(48,177,41,'2019-05-21 12:17:11','我读人类简史:从动物到上帝','抄袭抄袭抄袭啊麻烦清醒一点！',3),(49,111,172,'2019-05-15 14:24:11','我读三国演义（全二册）','完全靠身边人安利，说是上半年欣赏过的最好电影不为过。或许不是每个人都得过“穷病”，但总看过这样的人，剧情不道德绑架，也让很多人去了解原型和幕后，里面那位卖假药的审问室时表现让我惊讶',3),(50,91,55,'2019-04-24 20:38:11','我读向左走·向右走','程勇的脸像七月的天说变就变，人物行为逻辑全没毛病就是最大的逻辑毛病，和张院士干架那场戏完全就是胡来，正反派说唱脸谱，药价贵药价贵药价为嘛贵？洞悉人性拉倒吧，“谁家没个病人啊”昭然若揭，利用同理心搞场社会宣泄罢了。影像更别提。',4),(51,132,10,'2019-04-27 21:40:11','我读哈利·波特与凤凰社','影片风格上有着文牧野一贯的克制和冷静，以及他明确的诉求，我不觉得像韩影，本质上是一种属于中国的本土的电影(可能徐峥偏爱韩影和港片)。剧作上，把研发药的原创公司做成反派，把政府形象做正的处理使得反派模糊化了，这种商业化的处理应该和宁浩有关，也应该是目前审查上最大的尺度了。文牧野成了。',5),(52,32,126,'2019-05-09 23:05:11','我读悟空传:修订版','对《药神》所有褒奖都建立在中国电影市场的贫乏和落后之上，纯从视听剧作的技艺层面，《药神》只是一个中规中矩没犯错的工业标准产品，甚至在导演层面是平庸的，连一个令人印象深刻的调度或者美学设计都找不到，如何可能有欲望再看一遍呢？但它又给中国工业指向了一个正确方向...',3),(53,81,243,'2019-05-04 00:23:11','我读牧羊少年奇幻之旅','从剧作摄影到导演技巧都堪称典型的电影学院风格，不过组了个酷似初代复联的队伍也是蛮有趣的。徐峥和王传君大概要横扫各种表演奖了。这个片子能过审已是不易，有些剧作合理性，具体导演手法和意识形态面向上的问题也就不太好去苛求了。想一想觉得还是值得为这部片吹一波的。',5),(54,190,130,'2019-05-15 08:58:11','我读苏菲的世界','《我不是药神》看到后半段，纽太普疯狂地啜泣起来，声音超大，以至于前后左右都开始看我们。',5),(55,162,195,'2019-05-06 03:13:11','我读房思琪的初恋乐园','情急之下，我从裤子口袋里拉出一个口罩帮他戴上。顿时大家露出了了然又理解的表情。',5),(56,217,129,'2019-05-04 00:29:11','我读鲁滨逊漂流记','贴身移动镜头跟拍，强化了写实风格。镜头调度尽量隐藏在人物运动和情节的背后，看上去似乎没什么风格，无非是中近景的对话正反打，加偶尔摇一下，事实上，镜头的跟进、位置、角度和细微运动都很严谨，与影片的现实感非常契合。一个藏着拍的导演。',3),(57,289,92,'2019-05-06 00:18:11','我读天龙八部','被导演直接拿剧情糊在了脸上，观感就像是张院长在台上滔滔不绝地介绍德国格列宁。',5),(58,70,33,'2019-04-23 03:50:11','我读莲花','懦弱、贪财、甚至家暴的小人物，最后却咬着牙把善事做到底——其实大部分人都是这样，即非至纯至善，也非穷凶极恶，但是看见了，没办法假装没看见。',5),(59,268,161,'2019-05-14 01:02:11','我读无声告白','韓國商業片的路子，中國特色的結局，怎麽煽情怎麽來，2018之“中囧”。',3),(60,78,64,'2019-05-02 04:19:11','我读呼啸山庄','意外发现王传君的演技真的很棒',5),(61,145,85,'2019-05-15 14:33:11','我读亲爱的安德烈','病是一种罪，上帝也不能赦免；穷是一种病，药神也无法医治。思慧把脱掉的衣服一件件穿上，黄毛把留长的头发一寸寸剪下，程勇把缺口补上，受益把口罩摘下。法和情谁上谁下，命和钱谁上谁下，灾厄的红药水抹到谁的头顶，侥幸的救世主降到何方人间。许多人终其一生都在寻一种药，没药的世界我们能不能活？',5),(62,174,139,'2019-05-04 19:45:11','我读基督山伯爵','带着浓浓的宁浩味，胜在题材，和徐峥。“世界上只有一种病，穷病，穷病救不了的”，直白的说到了痛处。一边卖药赚钱，一边拿钱买命，一切法和理，都在“活着”面前脱得赤条条。最后那段话为过审的目的明显，实际上格列卫尽管被列入部分地区的医保，却是有条件的，实际情况哪是这么一句能总结的。',5),(63,111,99,'2019-04-30 00:10:11','我读白鹿原','年度最佳预定，旁边座的姑娘哭的都抽抽了，忍不住递过去一张纸巾。怪不得王传君不愿意去掺和爱情公寓电影，有这样的电影演谁要去演抄袭剧？配角个个出彩，真实可感的平凡人已经在这个大银幕上消失太久了。',5),(64,1,79,'2019-05-13 06:18:11','我读骆驼祥子','哭哭 无法想象我活在一个陈赫比王传君火的世界',4),(65,262,13,'2019-05-13 18:43:11','我读灿烂千阳','怎么过的审？甚至我公安机关的大Boss在片中都是一个略负面的角色。如果此片叫好又叫座，各路资本一拥而上带火了社会现实电影，广电总局会不会再举屠刀啊',4),(66,114,187,'2019-05-05 05:21:11','我读局外人','看的时候记得带好纸巾[捂脸]我觉得不论这部片拍摄手法如何艺术价值多高，这种题材的电影能够过审就是很大的进步了。韩国能够凭借《熔炉》改变国家的法律，一部好的现实题材的电影的意义可能会远远高于作品本身。希望大家都去支持一下优秀国产片的票房',4),(67,246,28,'2019-05-07 18:04:11','我读茶花女','《我不是药神》值得完整五星，叙事，表演，节奏，镜头都是年度最佳，唯一的短板可能就是树了正版药厂这个假敌人，但是国产电影嘛，也要理解，不算主动做恶，只能算被动装傻。徐峥真的厉害，小奸大勇，脸上都能看到一点宋康昊的影子了（不是说肥），王传君周一围都很好，这样的电影票房好，让人充满希望',4),(68,43,120,'2019-05-19 15:58:11','我读海边的卡夫卡','“送出去挺好的，将来比咱们有出息”，结合全片看这句台词会非常有意思。前半段刻意营造的笑料过多，同时使得整部片的意旨变得暧昧不清，而原型人物的重量和意义也被那一个个太过戏剧性（和喜剧性）的情节所无形消解。以及，在这个首尾都需要字幕进行“立场矫正”的环境下，还是别类比《达拉斯》了吧。',5),(69,166,171,'2019-05-03 23:32:11','我读一个陌生女人的来信','怎么不能拿《达拉斯买家俱乐部》说事了？同样的题材，人家对人性挖掘地多好，我们只会煽情。',3),(70,7,165,'2019-05-10 13:41:11','我读笑傲江湖（全四册）','看《我不是药神》时的我（给结尾的周一围） 如果这个暑期档爆且只爆一个片子 我希望并相信会是这部 更希望未来能有更多此类型的电影上映 代表我自己宣布此片提前锁定年度最佳了 ',3),(71,162,97,'2019-05-03 22:31:11','我读福尔摩斯探案全集（上中下）','这才是我们需要的现实主义！悬浮剧横行的当下，药神简直是一针救命的强心剂，为如何处理现实改编题材，兼顾深度与观赏性，提供了模范样板',5),(72,76,48,'2019-04-24 16:13:11','我读兄弟（上）','希望这片子更快冲向高票房，驱动资本转向优质现实主义题材。',4),(73,131,199,'2019-05-11 20:20:11','我读沉默的大多数:王小波杂文随笔全编','这部“社会现实主义商业类型片”既成功撩动了广大民众情绪，又释放了各阶层的生存焦虑，浓得像一团炸药，各处开花，飞火流星，把弱者包围，将强者笼罩。药神和战狼一样，都属于这个时代的超级英雄，不知不觉为沉默的大多数代言。',5),(74,107,38,'2019-05-13 10:26:11','我读少有人走的路:心智成熟的旅程','嗯不知道是该高兴还是失望，中国（全亚洲都)在向韩国看齐拍所谓改变国家的狂煽情样板戏，故事写的不错，但总觉得它们不是电影。',3),(75,23,1,'2019-05-10 03:54:11','我读了不起的盖茨比','所有的批评、思考、讨论，都应该建立在这已经是一部勇敢、积极、努力过了的电影，而且成色很不错。看看结出什么样的果，至少得想想这是什么样的土壤。导演的成熟之处，不在于在一部电影里呈现了自己的全部能量，而是呈现了自己的选择，并把选择做到了最好，那就对得起自己了。',3),(76,274,46,'2019-04-29 02:22:11','我读东方快车谋杀案','真是动人！完全没想到这么好看，哭成狗了。也是罕见地在影院里没看到有人刷手机。希望徐峥能拿影帝。',5),(77,179,99,'2019-05-11 14:12:11','我读情书','个人推动改革的一个好故事。归根结底，制药公司不应该做救世主，执法人员不应该做救世主，普通人就更不应该做救世主。救世主是谁？国家啊。得靠健全的医保制度。',5),(78,156,166,'2019-04-23 19:11:11','我读无人生还','虽然最后一幕让我想起还珠格格二劫法场，还是哭了。',4),(79,247,123,'2019-05-12 19:01:11','我读神雕侠侣','我认识一位姑娘，曾只身赴印度买仿药；也听闻不少病人，因药价太高而放弃治疗，并很快去世。本片短板很明显，甚至粗糙，但感谢让更多人关注到这个群体。虽有个光明的结尾，但不应一味强化药厂和患者之间的矛盾，尤其现实是零关税下药价未降，药进医保却因缺药而买不到药，但愿一切都不只是粉饰太平。',3),(80,185,142,'2019-05-13 18:31:11','我读巴黎圣母院','显而易见的，并不是一部多么出众的电影，却也是一部值得些许尊重的电影。',4),(81,226,179,'2019-05-03 07:58:11','我读民主的细节:美国当代政治观察随笔','年代感还算不错，挑点错吧：2002年4月26日（锦旗上日期）之前是不存在QQ群的；2003年百度还没有熊掌logo。',5),(82,218,123,'2019-05-24 02:38:11','我读肖申克的救赎','现实题材具有的社会意义为片子加分不少，但戏剧化改编上存在不少瑕疵，剧情走向重升华，人物塑造都太正面化，煽情尤其太过，如果能再克制点更好，类型上其实仍是大陆那一套。看过GQ对原型人物陆勇的特稿后，了解到本案曾被官方当做正面典型来宣传，为影迷所诟病的广电式结尾实其来有自。膜一膜徐峥',5),(83,44,103,'2019-04-27 05:16:11','我读月亮与六便士','从“中年油腻渣男困顿潦倒之际找到契机实现人生灵魂的升华”这个角度，只想给一星；从“中国病患困苦于医疗制度吃药难要么倾家荡产高昂天价购买进口药要么被禁止买仿制药只得等死”这个反映和揭露现实角度，真想给五星。',5),(84,158,153,'2019-05-21 11:54:11','我读羊脂球','昨晚看完，现在想想还是很激动，我在想，如果我是一名白血病患者，会怎样？我想也会期待那样的一个药神出现。影片结束后，所有观众自发的鼓掌，这是我观影这么多年寥寥几次。所有演员在线，连群演都大妈都让人泪奔。一个开头笑最后哭的片子，预测年度前三！',4),(85,102,168,'2019-05-14 06:13:11','我读呐喊','这个电影让我躲入人群中合理流泪。',3),(86,227,234,'2019-05-06 07:17:11','我读遇见未知的自己','国内大银幕少有的现实题材，但是可能是被剧透了，期待值爆炸，所以有一点点点点遗憾，但是每个老师的表演都超级无敌棒！值得学习！',3),(87,216,121,'2019-05-12 12:50:11','我读乌合之众:大众心理研究','表面说的是药，深层说的是命。药能治病，命却不由自主，这是影片锲入中国现实的关键，也是引发大众共鸣的核心。盛世危言，却让人能看到希望，仅此一点，就足以让人忽略因商业和审查做出的种种妥协。它不完美，但是中国电影应该努力的方向。',4),(88,87,106,'2019-04-27 20:08:11','我读动物农场','走的是辛德勒名单的路子，可惜不敢打老虎，只是在老虎的默许下把狐狸揍了一顿，这极大的削弱了电影的力量，别跟韩影比了，比不了。',5),(89,68,137,'2019-05-24 19:36:11','我读爱你就像爱生命','真是一部让人痛苦的电影，看得人不想说话，只想流泪。',4),(90,46,7,'2019-05-04 12:58:11','我读当我谈跑步时我谈些什么','这样难得有态度、立场、尊严的电影，是需要有观众情绪足够的累积呼应，才能产生完整能量核的。这甚至与票房无关，票房只是结果。韩国的社运片可以屡破纪录，中国观众没有理由比他们差。',5),(91,283,247,'2019-05-19 17:11:11','我读安徒生童话故事集','很好的题材和故事原型，可惜处理的太飘了。主线故事不够扎实流畅，人物转变突兀没有说服力，支线乱加戏，过于热衷添设煽情催泪戏码。',4),(92,141,228,'2019-05-21 12:11:11','我读红玫瑰与白玫瑰','改编自著名的陆勇案，医改前国人对医药问题的漠视，合理求生欲在法律面前的抗争。在还原了事件原型之余，加入了群戏和戏剧张力，落脚于伦理与法律的博弈。尽管弱化了诉讼的过程，但已经构成了对生命的敬畏。黄毛彭浩是宁浩致敬自己《疯狂的赛车》的黄毛耿浩吗？',3),(93,107,74,'2019-04-27 00:51:11','我读巨人的陨落:世纪三部曲','好看是料到了，没想到拍得如此朴素、扎实、流畅。文牧野是个实干派导演，他没打算要一部神作，就本本分分讲个好故事。正因如此，它对现实的关怀才显得周到、细心、准确。徐峥奉献了宋康昊级别的演出。',3),(94,292,114,'2019-04-30 13:30:11','我读鬼吹灯之精绝古城','非常赞同的一句话—“不能因为题材好，就可以无视其他的都给高分吧”',5),(95,142,239,'2019-05-05 07:38:11','我读城南旧事:纪念普及版','这个片子如果给自己的定位是一部传记片，一些问题是可以接受的，但它明显不是传记片，作为剧情片来说，那些问题就真是问题了，比方说打女人这个初始人设。还有很多地方给人感觉用力过猛。前半段剧情拼命赶，你仿佛能看到一个计划表，要在几分几秒完成什么任务，后半段又有些黏糊。然后片方当初宣传公关的所谓关注现实题材的点，其实也都用力过猛甚至夸张到让我反感的地步了，所以我坚决没去影院直到现在才看。在我的标准它是个7分的片子，对国产片宽容，四舍五入鼓励性打四星。',3),(96,74,7,'2019-05-12 23:41:11','我读这些都是你给我的爱','C/本质是回避体制分析的个人英雄主义抒情，但又可通过全球化对位来映射分化的国内阶层。与其说是对商业道德的歌颂不如说是一次对市场和调控都完全无法拯救的社会绝境乐观且粗糙的描绘。大资本与律法的刻画都还是太程式化，光靠正面力量的情感支撑显然不够。越到后半程剧作推着走的痕迹就越重。',5),(97,68,95,'2019-05-01 20:13:11','我读我不喜欢这世界，我只喜欢你','3.5。1.笑中带泪，敢拍这题材的确是填补空缺了；文牧野导演不负众望，而徐峥的演技同样经得起考验。2.确实没必要以《达拉斯买家俱乐部》来衡量本片，各有各的活法。',4),(98,211,151,'2019-05-15 05:06:11','我读华胥引（全二册）','有人说冲着敢拍这个社会题材就要好评。我觉得是很纯熟的商业片模式，该哭的地方哭，并没有意外。最后剧情失控了，往假大空的路上越走越远……',4),(99,235,214,'2019-04-25 09:41:11','我读半生缘','国产片的闪光之作，当然现实生活依然很残酷。里面最不舒服的地方就是药贩徐峥洗手不干的时候，白血病人对他的道德绑架。如果不是为了赚钱，帮忙搞到药是情份，不帮是本分，干嘛一个两个都好像欠了他们一样。你要死了，就无所谓也搭进去别人的人生？所以全程无泪点，结尾有小感动。徐峥戏真是好。',3),(100,280,173,'2019-05-18 20:57:11','我读阿Q正传','我们终于成功学会了韩国某种现实题材类型片讲故事的方式。这个反映现实的片子好看，却又并没有触及什么现实。它给徐峥、周一围包括牧师所设定的若干道德两难命题，流于表面，并不复杂和纠结，至少没揪起我作为一个观众的心。中国观众需要《药神》这样好看的电影，但这样的电影绝不能止于好看而已。【华纳永润】',5),(101,92,22,'2019-04-26 12:43:11','我读这些人，那些事','需要多少滑稽和猥琐才能讲一个高尚的故事，需要多少眼泪和亲情的糖衣才能吐一口反对的唾沫，需要多少条命多少升血才能论证救赎的必要意义？别问我对这个电影的看法，这特么哪是电影能聊的出来的？',5),(102,113,113,'2019-05-04 22:00:11','我读陪安东尼度过漫长岁月','全方位通俗且教科书，符合主流国内观众观影水准式的改编，这样的题材和最后的呈现能做到这样，非常值得尊敬，但整体艺术水准不如《嘉年华》！',5),(103,175,186,'2019-04-28 06:27:11','我读喜宝','看的点映，是好电影，感觉是中国版的达拉斯买家俱乐部。开篇宁浩徐峥的名字配上印度神曲让我以为是喜剧，后来发现是社会现实题材，在完全没有心理建设的情况下好几次被触动得眼眶发红。演员表现都很不错。后期一直在思考，法律和道德哪里才是平衡点呢？',3),(104,237,130,'2019-05-09 04:36:11','我读射雕英雄传（全四册）','改编改变了主人公身份，加了戏剧冲突，以此升华主角使其变得崇高，体现情理和法理的二律背反主题。可毛病不少：脱口罩礼赞加夹道欢送，这是什么待遇？有造神嫌疑；特写多，摇镜粗暴，艺术性差，由此剧情显得非常扎眼，易被认为在绑架观众。但演员出色，感情细腻，加上题材缘故，还是给个中评吧。',3),(105,220,112,'2019-04-29 12:42:11','我读梦里花落知多少','能在大屏幕上看到这种题材的中国电影，本身就是一种进步。',4),(106,13,172,'2019-04-24 03:37:11','我读一个人的朝圣','3.5；题材制胜，不无煽情仍是动人，“长的是磨难短的是人生”贫穷是无法医治的病，资本社会里情义无法开出希望的空头支票，底层蝼蚁的微茫呐喊虽无异于蚍蜉撼树，但透过这微光或许还有挣扎的可能；从浑噩到清醒，并无神祇降临，唯有自救自渡，尺度拿捏准确，戏剧层面的现实视野，太需要这样的国产片。',4),(107,63,159,'2019-05-08 08:52:11','我读一只特立独行的猪','戏里戏外，每一层文本都很中国。中国式现实主义其实是个童话，中国人世世代代都需要假想的侠，中国人有了钱就有了尊严可以砸人跳脱衣舞，中国电影的逻辑置换绕太多弯外国人大概看不懂，所以这个片子在中国取得巨大成功并没有什么好奇怪的，它迎合的是每个中国人的X点。',5),(108,63,223,'2019-05-12 13:24:11','我读如何阅读一本书','好看的电影无非三种：极爽，极美，极有共鸣。人人都怕老病死，人人都怕上下为难的中年，人人都有为谋生计不得不做的事情，人人亦都向往真与善……是这些时刻集中起来让煽情的中年油腻英雄不那么脱离现实。瑕不掩瑜，从长远来看，也许它是一部可以和《熔炉》相提并论的电影。',5),(109,46,74,'2019-05-12 02:16:11','我读朝花夕拾','徐峥从小人物到救世主被拔得有点太急太高了，最后煽情让我憋眼泪憋得头疼，有几个场面过于戏剧化，不过都可以理解，依然值得鼓励。',3),(110,206,79,'2019-05-04 08:04:11','我读格林童话全集','对结局稍有失望和遗憾，如果导演在男主被关押上车后街上病人行注目礼黑屏戛然而止显然会更加真实，更加引人深思。只可惜后面又多了几秒呵呵，有时候，我们需要等待社会进步，福利越来越好，但是有些生命已经等不起了，这个残酷的问题丢给了观众，我渴望着一个答案。优秀的反思现实的国产片但是分数虚高',3),(111,75,235,'2019-05-06 10:45:11','我读地下铁','当然不能跟影史上那些堪称伟大的纪实电影相比，也不能用过高的艺术标准去衡量它。硬去推敲细节的话，是有粗糙和漏洞的，煽情也过度了些。但作为商业片，在中国这样的审查制度下，拍到这个程度已经很好了。学不了美国，学学韩国印度，用电影揭露和改变社会，最好；暂时改变不了，能引起重视也是好的呀。',4),(112,149,173,'2019-05-21 17:21:11','我读孩子你慢慢来','完全没想到这么好看，哭了。',3),(113,228,182,'2019-04-24 23:58:11','我读杀死一只知更鸟','非寻常视野里的上海',3),(114,155,136,'2019-05-18 02:07:11','我读麦琪的礼物:欧·亨利短篇小说经典','非常催泪的电影，很久没有看过这样好好讲故事的国产现实题材电影了。“他们只想活着，有什么错呢”，被徐峥、章宇、王传君、杨新鸣、谭卓和老奶奶感动得一塌糊涂。',3),(115,110,70,'2019-04-30 07:04:11','我读刀锋','一部能让中国电影人挺起腰杆的电影。推荐每位学法律的同仁都去看看，对我们的职业一定会有更丰富深刻的理解。',4),(116,122,44,'2019-05-24 10:15:11','我读海底两万里','可以说达到了韩国社会问题片的水准，与其跟《达拉斯买家俱乐部》对比，倒不如跟《辩护人》、《熔炉》对比，相似点更多。当然也有韩国电影一样用力过猛、煽情太过的毛病，比如最后病人自发来到马路边送行。但整体还是让人惊喜，希望这样的电影越来越多。',5),(117,155,99,'2019-05-23 17:03:11','我读孤独六讲','几乎零差错的优秀商业电影，完全符合一部出色商业片的所有布局。徐峥奉献了一次能拿奖到手软的表演，几个配角的塑造的也相当成功，有血有肉，煽情也恰到好处。开头便直接用字幕告诉你取材于真实事件，加之病魔缠身后那种无力又痛楚的压迫感，真的很容易让观众产生同理心，所以电影口碑爆棚也不奇怪。',5),(118,110,108,'2019-05-23 20:20:11','我读步步惊心','我更喜欢原型故事。',3),(119,57,218,'2019-05-11 12:19:11','我读月亮忘記了','光是挑战这种题材的勇气，就值得打五星',4),(120,183,84,'2019-05-04 04:31:11','我读此间的少年','没想到啊你个春光灿烂猪八戒，有两把刷子啊',5),(121,91,231,'2019-04-27 05:36:11','我读菊与刀:日本文化的类型','把一点恻隐之心，都留给这部电影。',5),(122,73,146,'2019-05-22 05:54:11','我读你今天真好看','先让你轻易感动得稀里哗啦，再让你觉得连救命药0关税都是恩赐是及时雨#宣宣水准与时俱进# #朝中有人好拍电影#',4),(123,173,171,'2019-05-23 21:10:11','我读尘埃落定','上周末看的电影，开头一段印度咖喱曲想起，就很嗨想抖腿，笑点自然也算密集，情节铺开对我来说比较自然，后半段哭了但不是很夸张的哭，就很自然的想落泪～我很喜欢这种现实题材，但感觉好像大陆较少，徐峥稳～周一围帅～王传君颠覆～黄毛血性～教父搞笑～酒吧经理骚！！！',3),(124,87,196,'2019-04-24 23:58:11','我读查令十字街84号','好。但是从2002到2018，又是多少生命和家庭。',4),(125,261,230,'2019-04-27 13:04:11','我读流浪地球:刘慈欣获奖作品','徐峥要横扫影帝大奖。',5),(126,100,236,'2019-05-06 18:53:11','我读球状闪电','3.5，上海买家俱乐部。整体还不错，前半段展开分寸拿捏的可以，后面过度煽情了，几乎五六分钟就要来一段情感宣泄，用台词对主题的不断强调也显得重复。最后十里长街送药神的配乐也太主旋律了。感觉作者后面没沉住气，急切地想把所有话都说出来。',4),(127,143,238,'2019-05-10 00:08:11','我读那些回不去的年少时光','实属国产佳作，但不至于被捧上神坛。富有争议的题材，出色的表演，真实事件改编，可惜不能还原幕后真实利益关系，迫于需要过审，只能脸谱化谄媚处理，后半段煽情技法非常奏效，但缺乏电影的高级感。这样的题材可以过审，而且排片可以像商业大片一样如此密集，实属不易。',5),(128,236,31,'2019-04-25 04:42:11','我读荆棘鸟','根据现实事件改编，一部非常具有现实意义的电影。如果有机会，谁会不想活下去。演员的演技都挺在线的，哭戏和情绪爆发的戏份很有感染力。这部电影让我知道了一个不曾了解过的群体，也让我看到了一些进步，不仅仅是电影。',3),(129,75,113,'2019-05-16 01:52:11','我读金锁记','我就问药企的研发费用谁买单？市场经济这么多年了，商人还是地主周扒皮嘴脸，都晓得吃饭不能搞人民公社大锅饭，吃药就一定要全民AA？谁不同情病人，谁不担心自己没有药，谁不渴望延续生命？但不代表这病人所得到的救赎就真的那么理所应当。',3),(130,273,209,'2019-05-15 20:36:11','我读哭泣的骆驼','在此之前，我们只有改变电影的国家；在此之后，也许我们也可以有改变国家的电影。希望这一天早点到来。',5),(131,74,182,'2019-05-13 13:04:11','我读一個人住第5年','佩服，中国现实主义题材拍摄方式的一种样板，影像，故事，节奏，表演皆纯熟到位，悲而不哀，怨而不愤，尺度掌握好，结尾有些那个，但好像也没有更好办法了，自私懦弱的平民百姓，几乎成为救民于水火的“超级英雄”，这是最发人深省的地方，宁浩、徐峥提携新导演，提携很到位，预感徐峥要拿表演奖啦。',4),(132,123,75,'2019-05-01 02:14:11','我读悲惨世界（上中下）','三星半。娴熟，融洽，也触碰到最后那道坎，很满足了。另外我必须复制粘贴一下我在《辩护人》短评里写的内容：在济州岛的第二天，包了个车，和韩国司机导游表达了2013年整个韩国电影对中国影迷的影响，他很不可思议：“真的这样吗？哦，很有意思。”',3),(133,5,246,'2019-05-03 08:34:11','我读寻路中国:从乡村到工厂的自驾之旅','说实话，九分真的过高了，但无可否认这部电影有他的感染力和闪光点，题材的意义和演员的魅力简直太大了，好几处让人无法不为之动容。尽管在节奏和部分剧情处理上还是有些不自然和过分煽情，但终究是值得令人尊重的国产片。对于那些说其媚俗的人，我替演员和背后的工作人员感到难过。',3),(134,79,197,'2019-04-22 05:05:11','我读常识','永远治不好的穷病',5),(135,193,166,'2019-05-21 01:28:11','我读富爸爸，穷爸爸','国产电影阉掉的结尾多少分都扣没了。在各方力量挤压下批判现实主义在当代已经完了，能指与所指脱节后迎来的是幻象批判主义。在影片里到处都是无意识：赚一笔就离开这里，一定把孩子送到国外，有了钱生命仍然欠缺意义……实际上把所有可能走过一遍之后，会发现唯一有效的路一开始已经摆在那了：去上访。',4),(136,10,237,'2019-04-30 23:50:11','我读史蒂夫·乔布斯传','不管到底出于什么原因，对题材边界的突破都值得肯定。另外，怎么都那么把打分当回事啊，还最终评分7.3、7.4的，想当高考阅卷老师还是体操裁判啊……',5),(137,168,82,'2019-04-24 00:22:11','我读飞鸟集','有些地方的那群众呼声，不还是早年间献礼片那一套？但带着镣铐起舞的技法成熟度体现在文本和影像上，尤其剪辑，虽不大胆，但看的舒心，节奏感特顺溜。',5),(138,261,154,'2019-05-09 22:12:11','我读雷雨','几处过度的感情渲染和最后字幕、车里对话所显示的“求生欲”，并不妨碍这部电影的优秀。要放在一水国产电影里评价的话，光取材就可以打满星。',3),(139,136,192,'2019-05-12 02:57:11','我读水浒传（全二册）','“他有什么罪啊，他只是想活而已！”很难的，能在国内影院看见这类片的上映。感恩，祝福。',5),(140,24,168,'2019-05-24 20:18:11','我读海贼王:ONEPIECE','这种电影，给个五星容易，给三星很难。',3),(141,183,127,'2019-05-02 09:30:11','我读鹿鼎记（全五册）','我承认，我犯法了，无论怎么判决，我没有异议。我只希望，未来这个社会可以变的更好一点。',4),(142,142,48,'2019-05-11 20:50:11','我读你好，旧时光（上下）','谁标记的达拉斯啊？这是真实事件改编的，分的清哪个在前哪个是在后吗？还有个别品味高贵冷艳还要diss他人观影口味的，黑也要有点水准吧，我们那场实打实的抽泣声一片，要讨厌请代表你个人，别弄得好像爱看的人才是另类。',4),(143,255,21,'2019-05-16 21:27:11','我读时间旅行者的妻子','可能人们离现实太远了，看到一个和现实稍微沾点边的电影就全民狂欢了。。这就是一个普通的商业电影，病态的电影市场',5),(144,44,28,'2019-05-03 14:25:11','我读倚天屠龙记(共四册)','《达拉斯》混《辛德勒》，国内少有的现实主义题材佳作，难能可贵为弱势群体发声。剧作标准朴素，具有一定批判性的同时也找到了尺度上的分寸，在伦理道德与社会制度的冲突之间传递人性之善，不仅对电影产业有益，也具备社会关怀的价值，当下环境太缺这种作品了。四星水准，再送上创作者的一星鼓励。',3),(145,224,78,'2019-04-29 17:16:11','我读西游记（全二册）','看到两股势力的交锋，却没看到锋芒下的冒险精神，题材本身所具有的深度在迫击炮般的泪点轰击下被冲淡不少，更何况此中个人神化的倾向性太过乖张，虽能一语中的指出诟病所在，但这样的蜻蜓点水无论从哪个角度看都像极一场模式化的兜售，权衡和融合后本质也仍是求稳心理，但这不能怪创作者，大环境如此。',4),(146,159,108,'2019-04-29 08:01:11','我读长恨歌','从摄影机调度上可以看出导演是具备电影语言自觉性的（这在国产商业片中实属罕见），可惜那些低俗、谄媚的类型化桥段使影片割裂开来，破坏了本应建立的现实深度，而趋于造作的虚假。同时，这种类型化的改编策略导致一种二元对立的思维导向，并不利于反思事件本身，因此所谓的社会意义本身也沦为虚假。',5),(147,118,27,'2019-04-28 21:00:11','我读狂人日记','不喜欢后半截。啥时才可以别为理所应当的事情歌功颂德、痛哭流涕？啥时候才可以别要求别人具备社会身份（本片中是商人）以上的道德？啥时候才可以别牺牲了无数人，才给自己一句“时代进步总有代价、知错能改就是好的”？',4),(148,139,43,'2019-05-16 05:44:11','我读东霓','有故事，有技术，有意义，这特马才叫电影，一部能把人看哭的喜剧电影。前半段绝壁是宁浩指导！……还有，做坏事会下地狱的！',4),(149,61,103,'2019-05-22 23:18:11','我读失恋33天:小说，或是指南','看完电影出了影院，马上给在保险公司的朋友去了电话，第一次主动想为自己多备点安全感。',3),(150,233,140,'2019-04-30 03:18:11','我读你一定爱读的极简欧洲史:为什么欧洲对现代文明的影响这么深','电影将“陆勇案”进行了戏剧化改编，把主角的身份由病人改编成商人（这一改编对整个故事架构、人物设定造成很大影响），并以男女老青各种阶级身份的病人、家属作为配角，展现了病人弱势群体众生相。将大医药厂商代表立为反派（迎合国情？）。在中国电影创作环境下，本片确实为难得的关注现实题材的力作。编、导、演整体不错，但也不够突出，仍有不少套路与瑕疵。不时出现的喜剧元素减少了苦难煽情成分，但也削弱了稳重的现实风格。警察角色不够立体，其表达出的善意缺乏动机。结尾为过审而“正能量”的风格也让人遗憾。演员表演和剧本的深度、完成度与《达拉斯买家俱乐部》以及诸多韩片现实题材电影相比尚有差距。值得鼓励，但不值得过誉',5),(151,212,185,'2019-05-08 13:11:11','我读最好的我们','哭且服了。都在纠结批判得对不对，“现实”掺了多少假，偏偏忘了首先作为电影，它拍得好。伪现实和小批判有主客观因素引致，但是毛病就是毛病，不管从哪来，都在扣掉的一星里了。可没关系，它根本的价值既不在于现实意义，也不需要籍此加冕，而是关于如何去定义一个好人，和善良的意义——这是最大的意义。→12.1二刷。',4),(152,13,100,'2019-05-16 17:20:11','我读伊豆的舞女','“有一种病你救不了，就是穷病。” —— 底层立场的非典型国产片，而且还有几秒钟触碰到问题的实质。',5),(153,202,131,'2019-05-01 11:19:11','我读时间简史:插图本','上影节第14场。没有那么好，但作为新锐导演处女作足够扎实锋利，对于现实的刻画以及医药制度的批判，能够过审本身就已很了不起，在有限的话语环境内也做到了最好的表达，尤其是徐峥谭卓王传君三位的表演，为这个故事大大增色。部分场景有借鉴韩影的色彩，希望以后拍类型片散伙饭部分不要再吃火锅了。',3),(154,242,124,'2019-05-21 16:44:11','我读瓦尔登湖','徐峥渐渐宋康昊化了，照这个趋势，影帝是跑不了的。恭喜徐峥。不过，制药公司定这么高的价格，真没毛病，药物的研发成本极高，如果不保护产权帮助制药公司收回成本。那请问，新的药谁去研发？医药行业还要不要进步？  ',4),(155,263,100,'2019-05-10 18:43:11','我读我与地坛:史铁生代表作','谭卓有点郝蕾的意思。',5),(156,165,185,'2019-04-22 00:42:11','我读呼兰河传:1947年版本・原版珍藏','第一次看点映，非常震撼的好片子！国产电影终于也可以不逃避现实问题了，情节、转折、人物处理得都非常到位！徐峥演技炸裂，几个配角闪闪发光。等上映之后可以二刷！',3),(157,177,82,'2019-05-16 10:10:11','我读历史深处的忧虑:近距离看美国之一','达拉斯粉激情打分~',4),(158,287,137,'2019-04-25 21:16:11','我读红与黑','看的点映。面对法理与情理之间的冲突。药贩程勇给出了自己的答案，警察曹斌给出了自己的答案，众多白血病患者也给出了自己的答案。虽然这部电影不像《素媛》和《熔炉》那样推动了法律的改革。但是用电影记录下我国在医疗改革的过程中发生的故事也是有意义的。',4),(159,190,224,'2019-05-19 21:57:11','我读中国历代政治得失','里面好几个片段让人动容落泪，大概感同身受都是因为活在中国，体会过看病难看病贵看病苦这些状况，都是想努力活下去的人，有什么罪吗？',3),(160,209,217,'2019-05-24 15:46:11','我读夏洛的网','四星半。讲的是过去的故事，但当然也会是一种投射，一种聚焦。在过去的影像时空里，角色讲着相信会更好，会让人下意识地立即着眼于另一个时空，相同的地域，不同的时间，类似的困苦、愤恨与折磨。但终究，还是要相信会更好吧。最终当然是要回归的，但前面完成的表达已经足够。',4),(161,112,108,'2019-05-21 05:18:11','我读陆犯焉识','热评导致没哭的我感觉自己是不是反社会…',4),(162,268,117,'2019-05-09 14:54:11','我读一九八四·动物农场','好看的部分，太久没看到这种真实了！生活环境是真实的，情绪是真实的，困境也是真实的，甚至女主角是一个真实的上了年纪的美女，有真实的皱纹！真实才能带来沉浸体验。不好看的部分，就是唯一看出人工痕迹的地方，道德审判太明显，限制了更多的角度。',5),(163,264,80,'2019-05-12 08:05:11','我读大地之灯','前半部分固然好的很，但两种味儿的冰激凌既然不能分着卖，也只能看成整体了。后半集简直是卫生部版的战狼2，听说过杰克苏玛丽苏，没想到又冒出一个圣人苏，节奏、剪辑、镜头、表演甚至是配乐，都比前面差了不知多远，一下子打回主旋律原型。合着这事儿还是发生在qq年代，敢把时间背景放到现在吗',3),(164,178,95,'2019-04-29 00:58:11','我读我的天才女友:那不勒斯四部曲-01','看了点映，也看了好多评论，真的是很激动也很幸运能和很多人一起有同感想要点赞，能看到这么好的电影，真的是各位老师们的共同努力！徐峥、王传君还有周一围，演技真的杠杠的，一下将人拉进去剧情中！！！期待上映后的再度光临~',3),(165,229,42,'2019-05-12 19:07:11','我读匆匆那年（上下）','已经很不错了。现实肯定比电影复杂，之前看过的一些根据真人真事改编的电影，其现实往往比电影表现的要黑暗得多（比如《无人知晓》）。但我想我们不能因为现实的复杂而去否定电影的“单纯”。从某种程度上讲，这也是电影存在的意义。这部电影能够激发大家关于进口药的讨论，也是好事。',5),(166,280,98,'2019-05-11 14:11:11','我读影响力','在印度，烟雾中遇到神像那段非常地神来之笔了。然后就是一边感觉结尾的升华煽情有点太过，一边看到路边人群中吕受益和黄毛摘下口罩的脸就想哭。',5),(167,214,232,'2019-05-22 08:22:11','我读橙:陪安东尼度过漫长岁月Ⅱ','一个印度宝莱坞式的精彩故事，折射中国社会的残酷现实。',4),(168,134,118,'2019-05-16 20:14:11','我读香水:一个谋杀犯的故事','韩式思路印式煽情的本土化达拉斯买家俱乐部',5),(169,81,118,'2019-05-10 00:57:11','我读世界尽头与冷酷仙境','题材3分，前半部分3分，后半部分1分，结尾0分。高分说明讲好一个故事在现在的院线已经是多么难得的事，以及，不能把讲不圆一个好故事的锅都甩给广电总局。结尾可以好很多的。',3),(170,2,58,'2019-05-13 08:43:11','我读自控力:斯坦福大学最受欢迎心理学课程','可能煽情部分对大多数老百姓来说，是做的很到位，我这种身经百战的豆瓣er可不吃这套，片子不坏，题材好，值得看看，三星半吧。媒体吹的上天，也有点滑鸡',4),(171,268,93,'2019-05-11 18:35:11','我读人生','从印度药神，中国药神，最后上映成了我不是药神，悲剧改喜剧。导演镜头设计有很多瑕疵，但精准戳中了社会情绪点，预计票房50亿。医疗、警察、海关系统，全都黑了一遍。没有版权意识的观众很容易接受这种思想：你花十几亿美元研发灵药仍然是奸商，我不努力挣钱不买保险不锻炼身体得病就应该吃到药。',4),(172,79,186,'2019-05-07 23:59:11','我读看不见的城市','印度仿制药是拿印度患者做实验的，根本不考虑人权，全世界盗版侵权都被诟病，不知道为啥印度仿制药这样就被赞扬。短时间内这种便宜药可能对部分患者有益，长时间来说这种情况泛滥以后就没有公司愿意研发新药了，现在很多便宜的好药已经没有厂家生产了，没有利润，厂家也要发工资吃饭。',5),(173,278,90,'2019-05-22 15:45:11','我读冰与火之歌（卷一）:权力的游戏','从主题上讲，勇气可嘉，比绝症更令人绝望的，是利益操持下的强权制度。从手法上讲，这大概就是那种很多人希望国内能拍出来的“改变现实的电影”。',5),(174,111,119,'2019-05-08 23:00:11','我读那些年，我们一起追的女孩','太值得哭了，我从刚开始看到病人用一麻袋的零钱买药那个镜头就开始想哭，差不多哭到结束。尽管我知道有些镜头是故意煽情，但我还是整个哭到头疼。',5),(175,106,30,'2019-05-14 05:07:11','我读江城','过程中最大的感受不是觉得主角伟大，也不是因为最后这个药有了好的进展，而是觉得人要好好活着真的太不容易了。希望每个人都健康快乐，好好活着。',3),(176,225,223,'2019-04-30 01:17:11','我读变形记:卡夫卡小说','演的扎实，拍的用心，很不错的国产类型片。前半部分比较爽快，后面有点墨迹，有煽情嫌疑，但不让人反感，本来就是个感人的故事，人间少有的真情在。',4),(177,134,110,'2019-05-05 02:43:11','我读把时间当作朋友:运用心智获得解放','个人今年最佳国产，要刷很多遍。',5),(178,225,180,'2019-05-24 22:03:11','我读阿狸·梦之城堡','片中的角色都面临法律与良知相悖的困境，而编剧也一直在故事深度与能否过审的两难中纠结。前半段黑色幽默，的确有《达拉斯买家俱乐部》的气质，后半段升华得有点过，滥煽情，但被演员的好演技平衡掉了。几乎所有角色的演技都值得吹上一波，徐峥和周一围少许的对手戏相当精彩。',4),(179,244,236,'2019-04-23 01:55:11','我读天使与魔鬼','真的不错哦，直到结尾都不错，个人愿意再看一遍。但实话讲，并不觉得这是中国电影的进步，也不是什么制度的进步，至多是化用其他电影创意的方式的进步。其中比较露骨没藏好的地方，比如结尾对辩护人毫无节制的“索取”，让人瞬间失去共情的动力。中国缺故事吗？显然不缺，但始终还是缺一点“大聪明”。',5),(180,62,69,'2019-05-26 01:08:11','我读七夜雪','看完原型人物陆勇当年的报道，其中一句话又让我想哭。曾受益于代购药的病患帮陆勇求情，在电话里用颤音说：「我的生活低下一点不要紧，我不是要生活得很好很好，我是要求生。」',4),(181,53,59,'2019-04-28 23:27:11','我读ZOO','我没有直面过疾病，但我通过电影所感受到的绝望已经让我无法承受了，虽然这种隔着屏幕的同感可能只是真实世界的十分之一',3),(182,251,5,'2019-05-25 19:03:11','我读人性的弱点全集','这几年有那么多正面导向的新闻报道，希望大家去关注医改药改、关注伤残病弱群体，其实都不如这样一部脍炙人口的电影来得更有效果。',3),(183,210,242,'2019-04-29 14:17:11','我读往事并不如烟','《我不是药神》的成功，算是偶然中的必然。',5),(184,99,248,'2019-05-22 10:18:11','我读国境以南太阳以西','前一个多小时好看，闹假药会场的段落很精彩，虽然很多段落都很典型、缺少新意，但拍得很好看。后面三十分钟有点崩，情绪收不住，破碎成一片鸡汤。看到qq群放大“希望”二字时感觉和前面不是同一部电影。',3),(185,11,179,'2019-05-17 12:08:11','我读未来简史','想对勇哥说，你就是药神。',5),(186,167,148,'2019-04-23 21:16:11','我读蔷薇岛屿','【没钱】比【有病】更可怕',3),(187,39,101,'2019-05-01 09:39:11','我读一句顶一万句','过誉了。本以为可能是中国版的《达拉斯买家俱乐部》，最后发现倒不如说是在向《辛德勒的名单》致敬。',4),(188,92,234,'2019-05-07 00:04:11','我读京华烟云','一部各方面都非常成熟的商业片，尺度拿捏适中，煽情却不过度贩卖。作为一部处女作作品，出人意料，当然这离开不宁浩、徐峥两位老司机监制的把关。再者，触碰如此大胆的现实主义题材，过审已属不易，从之前的更改片名便能看出，它之于国产电影创作的意义不可忽视，应当支持。',3),(189,98,98,'2019-04-30 21:22:11','我读没有色彩的多崎作和他的巡礼之年','“他只是想活着，他有什么罪？”',4),(190,28,136,'2019-05-08 05:53:11','我读文学回忆录（全2册）:1989—1994','应该是2018年最爆炸的话题电影。直面中国底层生命的苦难和尊严，也没有逃避对社会制度和商业法则的拷问，在当下的中国电影中十分难得。创作上很成熟，剧作和表演尤其出色，每个人物都很立体，性格逻辑都很扎实，徐峥表演的突破性很大。事实证明，只要有生存空间，中国也能拍出《辩护人》那样的电影',5),(191,235,215,'2019-05-24 23:10:11','我读最初的爱情最后的仪式','和谐版的《辛德勒的名单》。',3),(192,232,30,'2019-04-24 20:06:11','我读尼罗河上的惨案','比《达拉斯买家俱乐部》更让人感动一些，真实代入感太强了。黄毛像随处可见的村镇青年，却有着难得的江湖气。程勇则由猥琐奸商，逐渐成长为大侠。众生皆苦，不是药神是凡人。',3),(193,48,245,'2019-05-07 20:59:11','我读生活在别处','剧情紧凑、信息量大。能过审也是挺神奇的。好多年没看过这么酣畅淋漓的国产片儿了。',3),(194,17,44,'2019-05-18 03:16:11','我读激荡三十年（上）:中国企业1978-2008','最初打动我的是「弟妹」，那一口闷，很绝。中间打动我的也是「弟妹」，破衣烂衫不算刻意。除了周一围很帅，后面没人打动我。弟妹这个角色，让我想起《星际穿越》里那个死守的弟弟，整件事似乎和他无关，可又是这无关人员，最撩动心弦。BTW，什么时候心理咨询纳入医保？至少Co-pay？',5),(195,194,81,'2019-05-16 10:26:11','我读设计中的设计','确实很不错，四星水准，鼓励一星。',5),(196,41,120,'2019-04-27 16:21:11','我读心是孤独的猎手','力荐!绝对值得一看的好片子。探讨人性与社会。观影的过程会因为幽默而大笑，但是心中始终感觉到那些底层人的悲伤。很喜欢的几个人物意料之中的死去了，法与情冲突起来有时让人绝望，好在结局让我看到了希望。',4),(197,232,165,'2019-05-15 11:18:11','我读佛祖在一号线','建议各党政机关，企事业单位，社会团体组织观看。',5),(198,100,230,'2019-04-29 18:22:11','我读我执','善良是一种选择。题材难得，成功造神，真实事件作嫁衣，换个名目也成立。人物特点突出但落不下去，患病停药有什么后果，何以至此？一概不知。狂欢似的拔地而起，现实一敲打就退缩。前一半飘，后一半煽。仅以法大于情、求生无罪拷问现实，很弱。意不在关怀，而在巨婴社会做好人难。演技合格。好项目。',3),(199,133,203,'2019-05-08 10:07:11','我读我的精神家园:王小波杂文自选集','简单地把锅甩给医药公司有点太表面化了，当然也是没办法，总不能甩给那谁吧，电影本身拍得不是特别精彩但也都在线，但总得来说是良心诚意之作，之前老看韩国，美国片说这些，国内终于也有了，这个高分也是正常的，观众实在是憋坏了。尽管如此，这事还是得说【我去年的画《药不能停》和《我不是药神》海报这事怎么弄，我没有一个迟斌啊！》】：https://www.douban.com/note/682266397/ 《关于艺术：元素，借鉴，创作，再创作，涉嫌抄袭》：https://mp.weixin.qq.com/s?__biz=MzA5MjM0MjcyMQ==&tempkey=OTY1X0t0RXVhQkZRdUpzaTJSOEhWT1F5ZGZRYUViVjI3SHFtc0x3bm1wTm80NjllY0FNNG5COUcxLU0wUTB0TDd4c',3),(200,121,93,'2019-05-12 16:06:11','我读九州·缥缈录','棒。在这样的环境下也已经做到了足够赤裸裸，起码戳到了一些真正的痛点。就按照这个路子多来几部吧，现实和真相的面纱早就需要揭开了。',3),(201,92,94,'2019-05-02 07:30:11','我读偷书贼','好',5),(202,198,193,'2019-05-15 14:12:11','我读野火集:二十年纪念版','摄影有几场戏挺喜欢，大排档火和烟作为前景的戏，葬礼后徐峥主视角穿过人群的戏。',3),(203,150,81,'2019-05-09 01:30:11','我读占星术杀人魔法','徐峥宁浩又一次高水准发挥：幽默、现实、残酷、感动，比纯喜剧更具现实意义。最喜欢假药贩子的那句台词：这世上只有一种病——穷病。',3),(204,150,241,'2019-05-09 05:41:11','我读舞！舞！舞！','朋友圈里一片好评，也确实是近年国产佳作，这样的现实题材拍成电影、故事性还如此强、如此动人就很难得。但又总觉得缺了点什么，从艺术角度来说是少了回味感。所有打动我的电影，都是回味无穷的，但它缺少。原因？当然因为审查，真正的现实顽疾、根子，根本无法表现。所以只能避重就轻。',3),(205,269,150,'2019-05-20 22:06:11','我读浪潮之巅','社会上只有一种病就是穷',3),(206,117,53,'2019-04-30 14:08:11','我读解忧杂货店','中国网民得有多天真多傻逼才认为药企不容易，我不是药神对药企的刻画太妖魔化太偏颇了。什么样的人会说出这种话，是谁出钱买通了大V说这种话，这种话对谁有好处。不言而喻',4),(207,125,88,'2019-05-09 05:51:11','我读小王子','专访过导演，可能也就大我两三岁，比片中“小黄毛”章宇还小3岁。才能突出到可以弥补学历经验，哪怕一辈子就这一部片子也不算白来。演员也都太对了，怎么能全都演得那么好呢。看片时左右哭得快背过去了，人是会恻隐的啊。那我觉得它存在的意义就是给毫无尊严的吾等屁民一根火柴。希望它得一些奖。',3),(208,295,69,'2019-05-26 12:51:11','我读白夜行','皮卡丘还是该用童声配音，用成年男性声线总感觉是在看泰迪熊',5),(209,237,199,'2019-04-23 00:59:11','我读围城','恐怖片太可怕了，世界上最可爱的宠物突然像你爸爸一样说话了。',5),(210,267,81,'2019-05-10 08:14:11','我读三体:“地球往事”三部曲之一','有宠物小精灵的世界太可爱了啊啊啊啊！～ 结局也很可爱～皮卡皮卡～',4),(211,179,81,'2019-05-04 07:21:11','我读嫌疑人X的献身','就……除了可爱也没剩下啥，但确实是可爱的。',3),(212,90,168,'2019-04-26 13:34:11','我读活着','毛茸茸的皮卡丘比想象中还要萌，萌到可以忍受剧情的乏善可陈',4),(213,38,234,'2019-05-22 10:31:11','我读挪威的森林','果然只是借个皮神的皮…硬拗真人版真是很拼了',5),(214,261,126,'2019-04-26 18:23:11','我读百年孤独','特效出色，立体化后的神奇宝贝违和感不大、新鲜感十足。世界观有强烈乌托邦色彩，从背景架构到情节安排其实都和《疯狂动物城》异曲同工。但剧本颇有问题，人类角色戏份过多造成倾斜、悬疑段落的关键情节点多次用全息投影“PPT过场”。最后一个反转做得妙，圆坑+落位，同时也算基本宣告没有续集了。',3),(215,115,146,'2019-05-07 03:10:11','我读红楼梦','你们能感受到那种从小就幻想进入宠物小精灵的世界到痴迷如今终于见到这个奇幻宇宙梦想成真的激动吗？电影不止卖萌和卖IP这么简单，这是一场纯粹的圆梦之旅。',5),(216,115,185,'2019-04-27 14:43:11','我读看见','对于我们这代玩“口袋妖怪”游戏和“神奇宝贝”卡牌长大的人来说，那些背景里随意一闪而过的精灵都太眼熟了，主角卧房墙上的裂空座、霍华德办公室里的阿尔宙斯、帕路奇犽和帝牙卢卡都能时刻挑起你的记忆神经，连平面形象转制成实物形象都让人满意；相比之下，整个烂大街探案情节和美式少年成长流水、乏味到需要可达鸭和皮卡丘不时卖个萌来化解睡意，剧作层面偷懒到全靠全息影像填充情节和解谜，拜托，编剧甚至不能让人关心主角的父亲到底去哪了！而且美国人是不是以为日本只剩下渡边谦和真田广之两个？ps：地动山摇那段我甚至以为要冒出来一个古拉顿...好吧，想多了。',5),(217,145,53,'2019-05-06 15:09:11','我读平凡的世界（全三部）','男主角从头到尾没有撸过皮卡丘！一次都没有！他是怎么忍住的？！是个狠人',4),(218,226,47,'2019-05-16 21:17:11','我读三体Ⅱ:黑暗森林','跟其他漫改系列感觉差不多：就是捧着一个好IP，却没有多认真地打磨剧本。不过这只皮卡丘还是可以吸的，第一次说话稍稍违和，习惯了就变反差萌。加一星给可爱的蒜头蛤蟆。',4),(219,128,198,'2019-05-07 20:55:11','我读三体Ⅲ:死神永生','我觉得前几天“泄露”的那个1小时44分钟的皮卡丘跳舞视频更好看，太萌了',3),(220,149,106,'2019-05-02 20:28:11','我读不能承受的生命之轻','【C+】①侦探故事基本就是走个过场。但！宝可梦世界构建的太成功！让人忍不住想扎进这个异想世界游历一番。②皮卡丘话唠还吐槽功力满分，根本就是换了个萌皮的死侍。③有一些类似怪兽电影比较cult的段落④一切很好预料，除了结局！大惊喜！',4),(221,293,105,'2019-05-21 10:06:11','我读达·芬奇密码','问，发现皮卡丘是你爸，和发现你爸是死侍，哪个更令人崩溃？又又又又一个游戏IP改编电影折戟，传奇在影片类型上的飘摆不定，很大程度影响了故事的完成度，硬生生地将一个合家欢内核包装成悬疑动作片，相识的故事却还没有《疯狂动物城》来的可信。宝可梦当年的粉丝都长大了，真的没必要把故事低幼化。三星全给各种可爱的宝可梦',4),(222,282,81,'2019-05-11 23:42:11','我读我们仨','作为游戏改电影，整个故事是比较完整的，但是相对来说剧情比较简单，看了开头能猜到结尾。然而！这一切在皮卡丘、可达鸭、妙蛙种子三萌神面前都不是问题！最后小贱贱出场超惊喜，突然发现他好帅！',3),(223,235,86,'2019-04-27 23:55:11','我读天才在左疯子在右:国内第一本精神病人访谈手记','Bill Nighy又一次“全果”',3),(224,1,184,'2019-05-20 20:14:11','我读简爱（英文全本）','讲述亲情、爱与羁绊，还有宝可梦激斗！遗憾皮卡丘没有使出更多招式啊！遗憾没有让更多喜欢的宝可梦出镜！“贱贱”RR继续抖机灵碎碎念引得哄堂大笑，结局又引人偷偷抹泪',5),(225,195,85,'2019-05-15 09:21:11','我读哈利·波特与魔法石','一直是漆皮党的我彻底被这个毛茸茸的皮卡丘萌化一边看电影一边揉摸着怀里的这只⚡️Diplo老爹第一个一闪而过的镜头就立马认出来了！',4),(226,87,160,'2019-04-26 04:53:11','我读明朝那些事儿（壹）:洪武大帝','看完电影，感觉连每个毛孔都想发出“皮卡皮卡”的声音。整部影片，从ip改编角度而言，也算是做到了将游戏与动画角色成功的3D视觉化呈现，不仅构建了人与各种各样宝可梦共存的世界，包括可达鸭、大火龙、百变怪等等，尤其是我们最爱的皮卡丘简直做到了丧心病狂的纤毛必现、眼神灵动的地步。瑞恩·雷诺兹（中国版是雷佳音）的配音，也是够苏。',5),(227,94,112,'2019-05-15 11:28:11','我读傲慢与偏见','表面生气内心柔和的警督宝可梦，空气表演的魔墙人偶，可达鸭从头至尾只能说自己名字的憋屈表情都在传达着“好气鸭”，表面卖凶实际卖萌、爱喝咖啡停不下来的皮卡丘…角色设定如此Q，即便没看过原版也能瞬间被征服。“我就要放电电你了哦”、“人家这么可爱，你下不了手的，皮卡皮卡” 谁不想养一只随身的宝可梦？土台龟花园的森林合并大有《盗梦空间》和《奇异博士》的架势，“死侍”都开始演爸爸角色了啊…',3),(228,115,209,'2019-05-24 22:45:11','我读目送','蒂姆从小缺少父亲的陪伴，其实不是父亲不爱他，是他从来没有给父亲机会。',5),(229,206,37,'2019-05-14 23:13:11','我读恶意','上次后悔没有上车，这一次做出了正确的选择，弥补了当年的遗憾。扔掉车票，也扔掉了幼稚和固执。',5),(230,273,54,'2019-05-17 23:52:11','我读撒哈拉的故事','露西身为新闻业实习生，她鄙视记者隐瞒真相、虚假报道的行为，然而她却处处碰壁。',5),(231,32,173,'2019-05-15 13:19:11','我读霍乱时期的爱情','她身体力行，知行合一，终于凭本事获得人们的认可，发挥了自己的价值。',3),(232,265,66,'2019-05-07 10:24:11','我读飘','蒂姆发现父亲一直陪伴在自己身边，和父亲和解；',5),(233,211,142,'2019-04-21 21:32:11','我读许三观卖血记','露西不忘初心，方得始终。',4),(234,240,141,'2019-05-09 15:41:11','我读边城','一个收获亲情，一个收获成长。',4),(235,271,36,'2019-05-21 17:52:11','我读倾城之恋','其实父母就是我们的皮卡丘、可达鸭、宝可梦，一路同行，伴我成长。',5),(236,122,36,'2019-05-10 05:29:11','我读送你一颗子弹','如果我捡到了一只张嘴就是小贱贱声音的皮卡丘，我大概会想把他扔了……',4),(237,19,21,'2019-05-14 07:20:11','我读狼图腾','一个童年回忆中的经典icon+一个青春期故事+一个死去（或失踪）的老爹+一个极其二逼的阴谋+一堆彩蛋+一段不能拉手不能亲嘴的爱情戏=好莱坞惯常IP玩法。最后的结局，总是在拯救地球的同时解决了家庭问题。《大侦探皮卡丘》，就是这种玩法最没创意、最敷衍了事的一次表现。我真的看够了！',4),(238,227,205,'2019-04-25 01:58:11','我读哈利·波特与阿兹卡班的囚徒','无感，囧！不过皮卡丘还是很可爱的！可达鸭也很可爱！蒜头青蛙也可爱！剧情看不懂！比理解中美关系还困难。看完回来撸自己的猫会迸发比平时三倍的爱心，会尝试二十几次试图和猫对话的冲动，多喂了双倍的猫粮，最后登录淘宝下单了它们三个月都吃不完的妙鲜包。完成了消费主义刺激下的冲动爱心购买闭环。',5),(239,149,109,'2019-04-30 08:28:11','我读哈利·波特与火焰杯','天啊这是什么沙雕剧情？？？怀疑创作团队里根本没人玩过游戏或看过tv版，神奇宝贝的技能呢？和训练师之间的情感呢？最后沦为一堆为了卖萌而走过场的产物。',4),(240,95,249,'2019-05-14 17:53:11','我读盗墓笔记:七星鲁王宫','典型的一萌遮百丑。每次皮卡丘开腔，总觉得是死侍在打嘴炮。宝可梦的质感太像毛绒和橡胶玩具了。渡边谦已经沦落到演这么没有存在感的尬角色了。',3),(241,160,16,'2019-05-07 02:32:11','我读情人','这个剧本，不如看皮卡丘跳100分钟健美操。',5),(242,211,126,'2019-05-05 09:12:11','我读哈利·波特与密室','我居然看了这样一部粉丝电影，还是首映？我可能是全场唯一一个不知道皮卡丘是神奇宝贝的人。',3),(243,159,240,'2019-04-25 21:50:11','我读穆斯林的葬礼','几乎完全看不懂，试图理解粉丝们的心理，但是失败了。剧情幼稚并且不讲逻辑。',4),(244,42,178,'2019-04-24 18:39:11','我读万历十五年','童年各种可爱的宝可梦现在进入三次元世界 还是能萌到大批姐姐粉 要使劲夸夸美工了 不过看来编剧这么多年毫无进化还在写儿童片 ',5),(245,225,99,'2019-05-15 23:02:11','我读人间失格','一切剧情尽在预料之中，除了pikapikapikapikapika太可爱了————————————！！！！！',4),(246,108,147,'2019-05-20 16:46:11','我读窗边的小豆豆','啊，我实在无法抵抗住皮卡丘卖萌，表情真的太丰富而且可爱了，全程被萌哭，剧情是不出彩，但没有硬伤，所以我选择原谅。ps：看完电影立刻把朋友圈背景图换成了皮神，哈哈。',3),(247,197,215,'2019-05-23 20:48:11','我读老人与海','烂片，瑞恩雷诺兹的儿子居然这么丑 反派弱的要死  全场也没什么笑点 妙蛙种子可达鸭比较可爱',4),(248,199,195,'2019-05-06 14:15:11','我读1Q84BOOK1:4月～7月','皮卡丘：i am your father。非常中规中矩的合家欢电影。皮卡丘恶意卖萌可耻。我也想要一只可达鸭啊！蒜头王八好可爱！特意看的日配版，皮卡丘配音是西岛俊秀…（长毛的皮卡丘根本不算什么，播片前放了长毛的索尼克预告片简直就是精神污染…',3),(249,250,246,'2019-05-02 04:05:11','我读1985','完全靠皮卡丘卖萌撑完了这部电影……',4),(250,151,135,'2019-04-27 19:42:11','我读黄金时代:时代三部曲','踢一脚鲤鱼王就能进化，跳一下可达鸭就会爆炸，不要测魔墙人偶自愚的空间，不要提可拉可拉忧伤的往事。甲贺忍娃腾空化身武士，土台巨龟遁地自成山峦，不用说话妙蛙种子便知你全部心意，不怕失眠胖丁总能助你今夜好梦。车祸现场的真相用全息影像可以还原，人类与宝可梦的牵系却不是一管喷雾就可以抵消。',4),(251,125,245,'2019-05-18 16:12:11','我读哈利·波特与混血王子','【C】怎么说呢，口袋妖怪的世界观搬到大荧幕上真的很令人惊喜，各种口袋妖怪的真人cg也很值得称赞，小贱贱的配音也相当给力，但抛去这些噱头，本片仍然只是一部好莱坞三流剧本的“鸡肋流水线”大片罢了，不比《环太平洋2》《游侠索罗》《大黄蜂》等片好到哪儿去，也就这样吧...',3),(252,144,250,'2019-05-22 14:35:11','我读人类简史:从动物到上帝','岛国当红假面骑士演员出场时我喷了。',5),(253,68,164,'2019-05-12 18:54:11','我读三国演义（全二册）','宁愿看皮卡丘跳俩小时健美操，毁童年豪华套餐又添一员',5),(254,30,208,'2019-04-26 22:57:11','我读向左走·向右走','难道没有人发现主线剧情和疯狂动物城是一模一样的吗？探案二人组，看上去是良民的幕后boss，宝可梦（动物）反过来袭击人类。然后皮卡丘被塑造成一个典型的好莱坞贱萌宠物（泰迪熊既视感），虽然最后用死侍的梗来圆，但是真的毫无逻辑了。',4),(255,28,117,'2019-05-17 15:58:11','我读哈利·波特与凤凰社','和谐共处的乌托邦城市，侦探故事为主线，会让宝可梦发疯的药，闯入关着宝可梦的实验室，本来以为是好人的结果是最大反派……欢迎大家收看《疯狂动物城》的真人版之——《精灵宝可梦》。',4),(256,237,12,'2019-05-22 07:03:11','我读悟空传:修订版','#相比于会说话的爸爸，我还是更想要会说话的皮卡丘#',4),(257,250,185,'2019-05-17 05:56:11','我读牧羊少年奇幻之旅','#开场的日本宝可梦训练师是男朋友竹内凉真！！！#',4),(258,105,186,'2019-05-04 23:26:11','我读苏菲的世界','带脑子看这部片，观感实在太痛苦。在现实风格与侦探主题背景下，剧情实在太低幼了。真心觉得让皮卡丘被附体成嘴炮的主意蛮糟糕的。更难忍的是无逻辑无脑的剧情。设计幼稚的“拍脑袋破案”侮辱观众智商。男主可毫无阻拦地闯入各种地方，各种开挂的不死不伤光环也很过分了。重磅决战戏里，反派所犯的各种低级错误简直浪费比尔奈伊老爷子的演技。也就剩下时不时卖点萌了。改编不是乱编，戏说不是胡说。失败的真人化改编',4),(259,2,163,'2019-05-21 21:55:11','我读房思琪的初恋乐园','非常工整的teenager movie，所以没深度没内容没演技，女主的无实物表演太僵硬，影片类型也是喜剧片悬疑片动作片灾难片杂糅的四不像。小贱贱配音的皮卡丘几乎为唯一可看度，最后的彩蛋也让人笑出腹肌，“确认过眼神”，翻译老师又顽皮了。',3),(260,113,79,'2019-05-14 07:46:11','我读鲁滨逊漂流记','啊啊啊啊啊啊啊',3),(261,22,92,'2019-05-20 11:20:11','我读天龙八部','有生之年居然能看到竹内凉真和Chris Geere 出现在同一部电影里！！啊要是全世界的大叔都能变成毛茸茸的皮卡丘就好了',5),(262,11,154,'2019-05-07 19:23:11','我读莲花','和动物城的框架真的有不少相似之处，但是细节处理上上真的脱不开游改电影向来的敷衍和粗暴，即便展现了让人眼前一亮的世界观但也难以令人全身心融入其中。我觉得自己算少女心比较爆棚并对低龄段片比较包容的了，但小精灵们好像也没特别多...表现自己和卖萌的时候',3),(263,100,204,'2019-05-07 04:15:11','我读无声告白','主要走萌系与可爱风，瑞恩雷诺兹的配音还是挺不错的。以及看完专门查了下男主的父母。',5),(264,160,170,'2019-05-04 16:34:11','我读呼啸山庄','皮卡丘是无敌的！！！！！！！！！揪心口！！！！！无敌的！！！！！！！',4),(265,13,166,'2019-04-29 18:43:11','我读亲爱的安德烈','话说超梦的原型是弗利萨吗？',3),(266,221,198,'2019-05-03 05:54:11','我读基督山伯爵','中规中矩。无聊的剧情连可爱的皮卡丘和蠢萌的可达鸭也拯救不了。看预告就够了。',3),(267,4,31,'2019-05-07 02:47:11','我读白鹿原','本片秉承拿来主义，套用了《疯狂动物城》的侦破外壳以及《爱宠大机密》里的宠物外壳，情节没什么好说的了，就靠小打小闹卖萌了嘻嘻。',5),(268,129,203,'2019-05-22 09:29:11','我读骆驼祥子','宝可梦精灵们还原得很成功，皮卡丘和可达鸭萌翻了！！本忠粉打五星～但最后的对决没看过瘾，希望这个真人系列可以继续拍，我都想好了，下一集拍battle大片！',3),(269,90,142,'2019-05-15 21:04:11','我读灿烂千阳','骨子里面和pokemon一点关系也没有，可以看作是对于《疯狂动物城》的一次拙劣的、机械的、无聊的模仿，全片唯一的看点是一个个CG版的pokemon亮相大银幕，其余的时间都是好莱坞式的陈词滥调，而且感觉特效层面也不是特别尽如人意，这种盘子你要不做成R级，要么干脆做成低龄卖萌喜剧，做成这种四不像的玩意儿是想恶心谁？',3),(270,287,144,'2019-05-02 06:23:11','我读局外人','剧本简直侮辱观众智商。如果不是毛绒绒卖萌（价值2星）传奇可以原地倒闭了。',3),(271,117,74,'2019-05-16 05:02:11','我读茶花女','哈哈哈，皮卡丘真的太萌了，我能说看完电影，我把豆瓣头像，背景，朋友圈背景，微博背景，QQ空间背景都换成皮神了吗？毫无抵抗力。',4),(272,48,168,'2019-05-05 00:11:11','我读海边的卡夫卡','皮卡丘的萌完全让人无力抗拒，太萌太萌太萌真是太萌了！只是除了皮卡丘以及其它宠物小精灵们的超级无敌可爱萌，在剧情上的话……就真是比较平庸了，勉强达到了平庸的层度吧。因为不是基于动画系列的改编，所以跟最希望的那个样子其实差很远。萌这方面着实让人满足，但是人类的故事线因为比较老套，都显得有些多余了，单独看小精灵们卖萌都比看人类戏的感觉要好。所以，这勉强达到的三星，基本都是给小精灵们的了。',3),(273,14,184,'2019-04-25 23:35:11','我读一个陌生女人的来信','皮卡皮卡皮卡皮卡皮卡！（好吧，真的很可爱，但是剧情实在也很没劲',5),(274,233,167,'2019-05-10 04:13:11','我读笑傲江湖（全四册）','全片都靠卖萌耍贱撑着，一个个好好的IP，在技术和人设都没毛病的前提下，真的有必要拉另一个IP来做噱头吗。我不是说贱贱不好，只是服务对象还是太白皮向。导致全片最燃居然是竹内凉真饰演的【】，短短几秒钟，已经燃起了做最强宝可梦训练家之魂。或许看日语吹替版感官会更好吧——呃，不，还是这个文本选取有问题——我不玩游戏，但我清晰记得97版的动画第一集，小智因为迟到被迫选择皮卡丘，两人从一开始的相互不接受到最终在雷鸟的攻击下救对方。童年因为这短短的20分钟泪目了无数次。我要求不高，我只要求带给我一些原初的感动，而不是这样的走马观花。so这不是我所期待的改编。and别再有续集了。',4),(275,254,31,'2019-05-03 14:12:11','我读福尔摩斯探案全集（上中下）','珍爱生命 少闻rush',3),(276,285,119,'2019-04-29 18:38:11','我读兄弟（上）','头疼的可达鸭、畅游的杰尼龟、唱歌的胖丁、小时候搞不清是好是坏只知道很厉害的超梦...一切都没变，都还在那里（想念强行被盖章设计歧视的迷唇姐）。但是如串场流水式登场，负责招揽情怀的精灵出场以外，故事和主角都不够出彩，且设定有些中二。抱紧Chris Geere小哥Awww',4),(277,150,149,'2019-04-25 10:38:11','我读沉默的大多数:王小波杂文随笔全编','有生之年能看到有毛的皮卡丘已是无憾了～故事有些幼稚，但是一堆一堆的宠物小精灵展现在大荧幕的时候～内心真的充满感动！！！',5),(278,69,63,'2019-05-15 06:25:11','我读少有人走的路:心智成熟的旅程','后期和包装再好也没法掩盖圈钱片的本质',3),(279,270,189,'2019-05-07 03:55:11','我读解忧杂货店','剧情好无聊，皮卡丘真可爱，反差萌和娘口三三绝对有得一拼了。（dbq睡眠不足+影厅没开空调特别热，中途又昏睡过去了）',4),(280,241,197,'2019-04-26 08:40:11','我读小王子','可爱可爱！皮卡丘不会说话之后可爱多了！',4),(281,160,225,'2019-04-30 12:47:11','我读白夜行','如果是别的片子，这个完成度我可能也就给三星，但没办法，是宠物小精灵。这IP对我们这一代的影响比漫威可大多了，并且这次让忠粉看得一脸满足。就连超梦回血这种70级以后一定会忘掉的鸡肋技能都用上了，还有啥不满足的呢？从小的两个愿望：在宠物小精灵的世界里走一走，用超梦的身体打一架，都实现了。最大的遗憾：除了超梦没第二只神兽',4),(282,98,236,'2019-04-28 06:24:11','我读围城','世界觀設計的並不好，說是「人和寶可夢和諧共住」，實際呈現卻是寶可夢只能在完全照人類尺寸坐息打造的生活空間內苟存，活似流浪狗滿地跑，寄宿在霓虹招牌和骯髒吃攤，連坐個車都只能借用嬰兒椅，甚是彆扭扭曲。是說渡邊謙現在是華納專門戶？',4),(283,284,214,'2019-05-23 08:39:11','我读三体:“地球往事”三部曲之一','分全加给一脸萌态的CG皮卡丘，即使借各个宝可梦角色形象配了个俗套与硬扯的无趣故事。',3),(284,251,141,'2019-05-16 19:20:11','我读嫌疑人X的献身','萌就是正义！',5),(285,103,54,'2019-05-19 17:11:11','我读活着','三星半。你们眼中的宠萌，在我这反而是亲子萌，那种“老爸其实就陪在你身边”的“祝福”，对我这种“已当爹”还是受用了。另外还有一场视效戏蛮嚣张的，相当于《盗梦空间》城市翻转+《霍比特人1》山巨人摩擦，做这么猛是干什么？',5),(286,257,54,'2019-05-16 05:09:11','我读挪威的森林','套着宝可梦系列的世界观，写的是好莱坞最廉价的剧本。',3),(287,245,149,'2019-05-08 16:02:11','我读百年孤独','完全粉丝向的电影。我知道你传奇电影cg动画做得好 但欧美对日漫改编一直都有一种迷之审美 比卡丘不说话的时候还好 一听到他老男人（性感的）就萌不起来了 其他大部分小精灵也是 特别是喷火龙的疙瘩……而且编剧对小精灵的战斗力是不是有什么误解？耿斯可以打赢水战龟？皮卡丘可以打赢喷火龙？还有皮卡丘可以伤到超梦梦？有点难以理解。超梦梦能力bug就算了 还居然还能预知未来 有点扯吧？还有 欧美这个小精灵名字不用各自叫声来翻译有点别扭。但故事讲圆了 画面也精美 起码是值3星的 吸盘魔偶那段精彩得拍案叫绝。最后想说 男主有点像公鹿队的字母哥。',5),(288,32,221,'2019-04-22 11:25:11','我读红楼梦','萌翻 剧情什么的都无所谓了（来自一个根本抵挡不住萌物诱惑的无脑影迷/希望有续集',3),(289,132,139,'2019-04-26 10:32:11','我读看见','感觉就连卖萌都没卖好，我宁愿听皮卡丘“皮卡皮卡”一百分钟。',5),(290,126,11,'2019-04-25 14:38:11','我读平凡的世界（全三部）','故事普普通通，缺乏看点，简单来说就是寻找父亲，途中加上一点冒险，最后再和反派来一场战斗。',3),(291,95,131,'2019-05-22 14:12:11','我读三体Ⅱ:黑暗森林','前期缺少小高潮，最后高潮也一般般，硬伤也不少。整体上勉强中规中矩，简单欢快，全片下来也没什么特别出彩的地方。一部合格的合家欢电影，仅此而已。',3),(292,245,205,'2019-05-06 23:40:11','我读三体Ⅲ:死神永生','关于片中什么男女主的感情戏，最后父子之间的和解，其实都显得挺无聊乏味的。总之就是一句话，有趣可爱的宝可梦大于影片中任何看点。',5),(293,2,27,'2019-04-29 11:42:11','我读不能承受的生命之轻','PIKA PIKA，毛茸茸的皮卡丘真的令人十分想摸想捏，可爱，卖萌耍贱，再加上“死侍”瑞恩·雷诺兹的配音又为影片添加了一些乐趣。抱头的可达鸭也贡献了不少欢乐。真的就是卖萌可爱就完事了，年度最萌影片。',3),(294,24,69,'2019-05-25 21:15:11','我读达·芬奇密码','比尔·奈伊叔叔饰演的大反派算是史上最弱的反派了，想要秒杀打败他，只需要走过去从这个死瘫子的脑袋上取下那个弱智的道具，有残疾人又把自己当阿凡达了。本质上还是北美青少年电影这个类型，把精灵宝可梦的世界搬过来，也跟这类青少年题材的奇幻片无缝对接了，再把死侍这个小贱贱的人设强行移植到皮卡丘身上，加上美国主流商业片里的万年父子梗，通通都是流水线热门元素的调配，套路满满，但怎么看都是一场稚气的把戏。现在只要一看一部电影把自己包装成青少年电影，就知道不用浪费时间了，这种类型的奇幻片再怎么拍，也翻不过暮光之城这座商业大山了。也没觉得这些小精灵好看，最好看的难道不是最后的老爹瑞恩·雷诺兹吗？',4),(295,22,71,'2019-05-21 16:09:11','我读我们仨','宠物小精灵吸的是什么？Rush吗？有那么多种可以改编Pokemon的方法，为什么一定要选最色情的那种？',3),(296,293,202,'2019-05-17 10:18:11','我读天才在左疯子在右:国内第一本精神病人访谈手记','我发现人们常常见到卖萌之物，就会过分忽视剧情和其他角色。整个世界观架构就很飘渺，我对任何角色都感觉不到真实。它试图用“美国黑色侦探片”的基调去构筑悬念，然而这些都只是皮毛而已，请学习一下《谁陷害了兔子罗杰》。',5),(297,90,178,'2019-05-24 10:13:11','我读简爱（英文全本）','像成龙的蒲松龄一样，侦探戏可以忽略不计，资本家的2B阴谋➕患难后的父子谅解，这种设定老到不好意思叫它新片。',5),(298,202,199,'2019-05-07 12:12:11','我读哈利·波特与魔法石','这才不是pokemon电影，毫无原作精神，片中的pokemon可以被任何东西取代，核心依然是浅陋粗暴的美式爆米花，这么改编简直是种侮辱，好莱坞到底能不能放过日本IP了？？？很多属于二次元的东西，还是让它们留在二次元吧。',5),(299,287,244,'2019-05-12 00:22:11','我读明朝那些事儿（壹）:洪武大帝','根本不需要拍出来的鸡勒片，整个过程都很尬，剧本没有啥嚼头，好莱坞惯常故事汇罢了，话唠皮卡丘，弱智黑人兄弟，八线没用女记者，用老套资本家的那点陈旧阴谋论，囊括了整部电影所需要的侦探悬疑，其实过程都极其无聊，自以为是的幽默感，没带脑子的探案冒险，不到关键时不发力的皮卡丘，毫无意外的强行反转，反正一路走一路编，为了其故事的合理性和价值观一直在扭转再扭转，最后经过缤纷大战，大家都找到了自我价值，收获了光芒，顺带维系了亲情，抓住了爱情，要不是瑞恩·雷诺兹玩了把配音和角色互换的梗，我是对这个电影没啥好感的',3),(300,94,192,'2019-05-01 22:01:11','我读傲慢与偏见','一开始还不太敢接受有毛的皮卡丘，现在看到光溜的反而别扭了，平面转3D成功，喜欢男主抱着皮卡丘进入“森林”那段。几乎皮卡丘每次出场观众席都有小声惊呼“啊啊啊好可爱”。人类部分基本还是标准好莱坞冒险模式，不过结尾有个小反转，拍续集的话可能就会是另一种风格的皮卡丘了。（看完好想撸猫，啊啊啊手痒',5),(301,255,71,'2019-04-30 01:45:11','我读目送','哈哈哈哈哈哈评价这部电影，我要套用洪世贤献给艾莉的情话：你好骚啊！当然，让皮卡丘给可达鸭捏脚才是最骚的',5),(302,92,49,'2019-05-24 17:38:11','我读恶意','大型皮卡皮卡卖萌现场',3),(303,239,63,'2019-05-15 20:07:11','我读撒哈拉的故事','超出预期，在好莱坞动刀的日本ACG改编作品里，可以越过《像素大战》对飙周润发那版《龙珠》了。抛开无聊透顶的剧本和废话连篇的台词，最大的败笔是把皮卡丘设置成嘴炮话唠，贱贱的配音只会加大这种不适感（可以想象雷佳音东北大茬子更跳脱），其他人气角色基本都是没啥功能性的串场。原作被辱得面目全非，宝可梦的粉丝估计要砸电视了！全片唯一的笑点是结尾瑞恩·雷诺兹的出场，看着样貌和肤色一点都不像他的儿子，还在那儿一本正经地释放父爱。',5),(304,168,68,'2019-05-17 22:05:11','我读霍乱时期的爱情','硬伤不少，可达鸭最萌，不接受反驳！你肯定不想知道，其实皮神是……',3),(305,292,109,'2019-05-19 14:43:11','我读飘','作为游戏粉丝不太好评价，其实大多数情节都挺忠实原作的。一方面宝可梦数量、种类的确可观，也能看出制作组对游戏有一定研究，细节做得不差，（长尾怪手的“捡拾”，暴鲤龙的“威吓”，说创作团队没玩过的肯定是自己没认真玩…）；但另一方面，宝可梦数量虽多，却基本没有发挥空间，沦为走马观花的背景板。镜头设计乏善可陈，继承原作缺点的剧本也浪费了这个有发展为科幻轻喜Neo Noir潜力的设定，依然是个人物鸡肋，情节能一眼望到头的儿童侦探剧。',5),(306,178,56,'2019-05-19 05:22:11','我读许三观卖血记','主要的问题还是在原作选择上，虽然《大侦探皮卡丘》本身确实是适合电影改编的AVG，但剧本和设定都过于羸弱。如果非要弄一部旁支作来当改编第一炮，还不如拿《宝可梦x信长的野望》拍魔改时代剧，或者用《不可思议迷宫》做3D动画呢。（为什么至今还没有剧作家出手漫画special系列？）',4),(307,251,69,'2019-05-14 07:10:11','我读边城','和预期的一样平庸。既然要走剧情俗套的商业电影路线，为什么不干脆多讨好讨好观众，为什么不索性多放些招式特效，比如水箭龟和耿鬼的打斗场景完全可以做得更好，结果到最后也就皮卡丘放了几个招式而已……拜托了！能看懂伏特攻击、电球、踢鲤鱼王会进化、百变怪的眼睛这些内容的观众，有几个是携家带口来看温馨亲情的，大家都是来看宝可梦的，谁特么要看人啊！',4),(308,184,231,'2019-04-28 06:50:11','我读倾城之恋','光看皮卡丘那张小圆脸，就觉得很有趣。每个毛孔都萌的不要不要的，看得我想在电影院和皮卡丘跳舞。',4),(309,54,112,'2019-05-22 09:46:11','我读送你一颗子弹','皮卡丘被好莱坞拍成死侍还真是皮啊',4),(310,139,61,'2019-04-29 19:13:11','我读狼图腾','萌就行了！这个世界观感觉梦想成真了！',4),(311,35,148,'2019-05-11 23:39:11','我读哈利·波特与阿兹卡班的囚徒','从皮卡丘出现的那一刻开始，老夫的少女心就彻底爆炸啦！这么萌的皮卡丘，让我怎么好意思打差评呢？！皮卡皮卡～～～',5),(312,44,23,'2019-04-30 12:30:11','我读哈利·波特与火焰杯','两星全给皮萌，忙着萌来萌去的，都没有认真放过几次电。整个故事特别是结尾还是引起了不适，拜托，皮卡丘不是一只宠物狗！！',4),(313,106,15,'2019-04-29 15:03:11','我读盗墓笔记:七星鲁王宫','可爱是真的可以为所欲为的',4),(314,90,7,'2019-05-09 03:22:11','我读情人','真实被萌哭，可能觉得故事很简单，但片中各式各样的宝可梦真的令人看花眼，常常会觉得被角色弄走神而忘记了剧情，每个都比以前2D平面版的更为生动可爱，为了被再被萌一次也要二刷。',3),(315,255,132,'2019-04-22 02:17:11','我读哈利·波特与密室','不知是谁想出找瑞恩·雷诺兹配音皮卡丘，真的是太好的主意，调皮又碎嘴，看完真的很想养一只。就像他演的死侍，几乎是量身定做，赋予了角色独特又恰当的魅力，没办法想象其他人来配音。反派稍微有点弱鸡，但男主角Justice Smith很可爱，既有懵懂害羞的一面，也展示出了一个青少年的毛躁，看过《侏罗纪世界2》的人都感受过这位小哥的喜感。另外，他与Will Smith没有半点血缘关系。女主角感觉全程亢奋，有点惹人烦。',3),(316,76,66,'2019-05-19 01:43:11','我读穆斯林的葬礼','人与宝可梦和谐相处的城市简直就是梦境一般令人神往，常常一个镜头里有大批萌物看都看不过来。',3),(317,34,2,'2019-04-25 23:54:11','我读万历十五年','各种套路拼装的大电影，毫无宝可梦系列见识世界、收集萌宠的少年情怀。装了五分钟黑色电影，然后久进入“死侍：我爱我家”模式。以为是一部“谁陷害了疯狂动物城的黄兔子罗杰”，但实际是则是另一部“老男孩”？只是没想到连皮卡丘都可以变得油腻。',4),(318,122,149,'2019-05-20 06:39:11','我读人间失格','就…情懷分了。對於喜歡神奇寶貝的人來說我覺得沒什麼好挑剔的，尤其是我這種又喜歡RR又喜歡pokemon的，觀影愉快。劇情有點弱的，算是勉強合格的開篇，會期待再出真人版。不過看這個劇情應該RR版皮卡丘應該是沒了。然後就是超夢有些時候讓我覺得是不是沒渲染好2333',3),(319,112,36,'2019-05-15 19:52:11','我读窗边的小豆豆','不喜欢这作的设定。',3),(320,241,85,'2019-05-07 16:34:11','我读老人与海','太难看了，纯圈钱电影，以为电影能构造一个口袋妖怪的世界，结果拍的什么玩意儿，进城时基本就是动物城的翻版，去看这部电影就是想看更多的小精灵好么，对所谓的家长里短少年成长并不感兴趣好么，给我看一场训练师对决挑战场馆赢得徽章我会比这兴奋一百倍，剧情还完全没有逻辑，反派的智商低到我感觉自己被耍了，大叔皮卡丘就是文明版泰迪熊，小贱贱也不能挽救。',4),(321,77,54,'2019-04-28 12:37:11','我读1Q84BOOK1:4月～7月','毫无辨识度的好莱坞流水线作业，除了轮番登场的宝可梦小精灵能拉回些许好感和情怀外，整部电影根本挤不出来多少看点。剧本也写的过分直白俗套，不管是情节和氛围上的悬念，还是喜剧元素的运用，电影都没有掌握到位，甚至连好莱坞一向擅长的家庭情感戏码也处理的很是敷衍，缺少那种偶尔但必要的惊喜和高光时刻。★★',4),(322,31,82,'2019-04-28 22:01:11','我读1985','#少儿版死侍# 童年的纸飞机，现在终于飞回我手里。微微笑，小时候的梦我知道。',3),(323,32,99,'2019-05-25 20:01:11','我读黄金时代:时代三部曲','雷诺兹：“好莱坞如果只拍美国原创，早完蛋了”，已经完蛋了。',3),(324,162,44,'2019-05-25 17:10:11','我读哈利·波特与混血王子','男主实在太尴尬了吧喂',5),(325,23,3,'2019-05-15 11:06:11','我读人类简史:从动物到上帝','扣分点1: 这部电影本质上根本不是在「还原宝可梦世界」, 而是给出了一个「在现实世界中如果添加了宝可梦要素会是怎样」的方案',3),(326,117,27,'2019-05-11 18:02:11','我读三国演义（全二册）','扣分点2: 明明能够做到展现体育馆中训练师们用宝可梦互相战斗的情景, 甚至让女主角打扮成非常自然的训练师的外观, 但全片以主要的篇幅、正面的态度来展现的「更好的、更正确的」精神内核, 却完全的否定了精灵球和宝可梦的战斗要素, 自以为是的搞了个和游戏世界观完全冲突的莱姆市作为故事舞台',4),(327,46,79,'2019-05-07 10:40:11','我读向左走·向右走','扣分点3: 结果全片唯一一场正经的对战竟然是耿鬼vs水箭龟, 剩下来的「动作戏」几乎全是各种逃跑, 绝了',5),(328,292,221,'2019-05-16 13:27:11','我读哈利·波特与凤凰社','扣分点4: 工具人超梦 最后超梦大回复就当一切无事发生的时候我真的喷了',5),(329,228,219,'2019-05-04 01:15:11','我读悟空传:修订版','加分点1: 然而无论如何, 本片展现了大量的可爱度还不错的3D宝可梦',3),(330,234,103,'2019-05-17 15:02:11','我读牧羊少年奇幻之旅','除了看皮卡丘卖萌可达鸭犯蠢，“真·一无是处”的少儿冒险片。电影过后你很难再想得起故事讲了个啥，而且明明用那么牛掰的CG做出了无数宝可梦，导演却压根没想过深挖一下宝可梦社会的背景设定——也不是说这么简简单单拍个卖萌电影不行，问题你别往“A级动漫宇宙”方向宣传啊……另外，男主那么纯正一点混血特征没有的黑人面相，居然有贱贱这么个白人亲爹？美帝现在为了ZZZQ连基础的人类种族特性都不要了？',4),(331,50,116,'2019-05-09 00:59:11','我读苏菲的世界','在电影院里已血空，根本没在看这狗血剧情，因为我的眼里没！有！人！类！真的希望皮卡丘多叫两声不是贫嘴kkkkkkkk',3),(332,103,119,'2019-05-21 22:11:11','我读房思琪的初恋乐园','好失望啊！套了个最常规的爆米花商业片的壳，中间也没有什么创意的部分，结尾更被累得外焦里嫩。呜呜呜，还我童年！（幸好我不是真粉，看完后被超梦圈粉，最想养可达鸭，嘿嘿）',4),(333,261,52,'2019-05-16 21:09:11','我读鲁滨逊漂流记','爸爸去哪儿了',3),(334,258,106,'2019-05-24 14:26:11','我读天龙八部','皮卡丘也是过于萌了导致无论情节演什么悲伤也好愤怒也好全场包括我都只会对着他的毛脸蛋被萌到怪叫（当然这种小学文艺汇演式的情节看不进去也并没有什么影响就是',5),(335,102,93,'2019-05-09 15:50:11','我读莲花','哪怕比想象好，剧情还是弱，而且小年轻太没看头，渡边谦大叔和吉尔小天使戏份又少，更不用提那本尊。但真是架不住地全程酥，莱姆市就是梦幻的栖息地，小精灵的踪迹可以找到天荒地老，而且最爱的护主犬出现了十几次。小时候最迷的估计就是《宠物小精灵》，那时它们叫比卡超、傻鸭、奇异种子、车厘龟、皮皮、鲤鱼王、超梦梦……现在一堆英文名只听得懂Pikachu和萌到爆炸的Psyduck。求出一个中年真人版，或者干脆就是无人真人版。三星半。',5),(336,255,153,'2019-04-26 20:22:11','我读无声告白','怀旧向，华纳与东宝联姻之作。剧情乏味，萌力惊人，ps 才知道原来皮卡丘是一只毛茸茸胖乎乎的肉丸子。。。',4),(337,130,189,'2019-05-20 03:41:11','我读呼啸山庄','娱乐性还成，但整体真的不太行，除了结尾处某人的惊喜登场出乎预料外真的平庸，有还算亮眼的部分，但这些几乎都来自神奇宝贝本身，而演员基本全被浪费，沦为工具，人物行事与剧情发展也莫名其妙，可惜了这个还蛮不错的卡司阵容。 ',3),(338,175,63,'2019-05-20 22:47:11','我读亲爱的安德烈','当然该说不说，凯瑟琳纽顿很美好（动态比静态美好）',5),(339,164,232,'2019-05-05 01:44:11','我读基督山伯爵','萌即正义！又想骗我养宠物！哼！',5),(340,75,241,'2019-04-30 12:27:11','我读白鹿原','粉丝向。剧情薄弱经不起推敲和主角演技差是真的，看的时候挖彩蛋和看到宝可梦们的快乐也是真的。耿鬼和胖丁长毛是真的不能忍受。',4),(341,183,28,'2019-05-21 07:01:11','我读骆驼祥子','片尾动画风格的人和宝可梦才是正典。制作团队是不是对“毛茸茸”有什么误解，好多本可以非常可爱的宝可梦，都因为毛发效果显得又脏又乱。可达鸭你就用小黄鸭那种绒毛效果不好？现在这弄得像掉进过泥坑里。耿鬼也是毛乎乎的，就弄成幽灵半透明不好？喷火龙能用类似蛇鳞那种光滑细腻的表皮吗？感觉符合预期的也就妙蛙种子、吸盘魔偶、暴鲤龙、卡拉卡拉和土台龟吧，伊布和超梦也算合格吧（皮卡丘很萌，不过总觉得尾巴得是个光滑的骨板，而且就没放过几次电）。更要命的是，其实看的预期就和看侏罗纪世界一样，想要更多更炫更神奇的恐龙/宝可梦，是人围着宝可梦，而不是让宝可梦变成背景！老老实实拍个励志的宝可梦对战晋级不好么，谁要看一个寻父遇怪记啊（且无论侦探还是搞笑部分都一般）。倒是之前看了隔壁蓝刺猬PV，所以觉得这部还好了……',3),(342,36,128,'2019-04-24 18:38:11','我读灿烂千阳','抱着只要看到萌物就好的低预期去看也被无聊到睡过去了一阵，还错过了唯一期待的胖丁的戏份，气！怎么可以拍得这么无聊？我看皮卡丘跳舞都能看得津津有味啊。',4),(343,116,240,'2019-05-08 06:08:11','我读局外人','除了贱萌真是没找出喜欢的点，几乎都能猜到，看开头入城有《疯狂动物城》的错觉，看了一会以后，这个科幻世界设定，这个父子矛盾和和解，我寻思这是流浪地球啊这是。还有，男女主角是带资进组的么，演技差到我特意看了看选角导演。',3),(344,22,78,'2019-05-05 01:06:11','我读茶花女','皮神：我是你爹',5),(345,285,245,'2019-05-06 13:38:11','我读海边的卡夫卡','这两天的我，不相信可爱即正义',3),(346,287,53,'2019-05-22 15:27:11','我读一个陌生女人的来信','完全没法接受皮卡丘变成一只话痨，看的时候只想让贱贱闭嘴。虽说是游改，但这种程度的剧作也实在是太把观众当弱智了，想看的收服和对战戏几乎都没看到，看得我内心毫无波澜……',3),(347,215,16,'2019-05-04 07:24:11','我读笑傲江湖（全四册）','可爱，不管',5),(348,74,53,'2019-05-01 11:42:11','我读福尔摩斯探案全集（上中下）','就这配音，那这皮卡丘嘴得碎成啥样。。一般般吧',3),(349,41,93,'2019-05-04 07:07:11','我读兄弟（上）','是比想象中好太多了，不尬不烂，pokemon 们超萌而且多少露脸有梗，童年游戏/动画世界照进现实梦想实现的感觉，毛绒皮卡丘根本没有预告片里的 creepy 感。但是故事本身太弱了，进城和阴谋揭晓那一刻有 zootopia 既视感，但剧情发展、人物塑造和关卡设置都牵强太多了。最大亮点大概是最后皮神本尊的亮相，难怪前面全程没正面镜头。排队求强势点的剧情打磨发展成宝可梦宇宙，比《神奇动物在哪里》那种暴殄天物的烂片还不强太多了？三星半。',5),(350,247,231,'2019-05-23 13:47:11','我读沉默的大多数:王小波杂文随笔全编','太太太太太可爱了！每一只都想要拥有！每一只都想撸！剧情也非常不错！',3),(351,296,27,'2019-05-17 17:26:11','我读少有人走的路:心智成熟的旅程','在日本影院看的，看的晚场，本来以为会越看越困的，没想到竟然挺好看的，一路看着皮卡丘插科打诨的破案，跟着男主一起冒险，主题有点老套还是亲情那一挂的，但整体结构很标准，故事基本没啥大毛病比较中规中矩，看下来还是很推荐去看的，结局在意料之中也在意料之外，有点贱萌的皮卡丘也是可爱死了！',4),(352,109,210,'2019-05-16 07:18:11','我读了不起的盖茨比','这是个屎。剧情弱智、建模粗糙、演技生硬，唯一的优点是宝可梦go游戏里的联动福利了',5),(353,145,91,'2019-04-24 02:43:11','我读东方快车谋杀案','1. 特效在海王和疯狂动物城之间，水平飘移不定。2. 剧本用AI写的，且以所有人都看过宠物小精灵或玩过游戏为前提。换句话说，硬套了这个IP写个故事，皮卡丘或者POKEMON的核心根本没有触及。3. 当然这些缺陷怎么比得上贱贱的皮卡丘卖萌，但看多了还是会腻。',4),(354,24,118,'2019-05-17 19:17:11','我读情书','杠精就别看了：）不过看台版长大的同学要习惯一下，因为可达鸭叫的是psyduck psyduck, 杰尼龟喊的是squirt squirt squirtle...我没在开车。',4),(355,119,120,'2019-05-25 12:01:11','我读无人生还','就西岛秀俊和竹内凉真的声音也能值回票价啊！！我还哭了两次，看到最后一幕嗷嗷哭，看完我跟国际友人说我看哭了我是不是一个人，他说不我也哭了，是只有我们两个哭了别人都没哭。ˊ_>ˋ西岛秀俊那一声皮卡皮卡我心都融化了！！！',3),(356,219,201,'2019-05-13 00:43:11','我读神雕侠侣','可能是粉丝向及儿童向的吧，如果不是结局有点意思的话，剧本也太烂了。分分钟想离场，迫于有同伴，没能起身。仔细想想，不光剧本烂，除了CG好，什么都烂。Bill Nighy和渡边谦都是惊喜，但都很尴尬。女主角长得很美。最好的地方是，片长还可以，不至于给人带来生理伤害，电影结束时我一下就开心起来了。',4),(357,26,28,'2019-05-17 02:50:11','我读巴黎圣母院','我为什么会觉得黑人的父亲一定不是白人……',5),(358,222,3,'2019-04-24 09:41:11','我读民主的细节:美国当代政治观察随笔','可达鸭过于萌了，还有警局门口的彩石怪',5),(359,195,32,'2019-04-26 16:18:11','我读肖申克的救赎','冲着小时候看过《神奇宝贝》，顶多算个情怀牌。',3),(360,145,33,'2019-05-16 05:37:11','我读月亮与六便士','好多毛茸茸，无法思考，好想养殖，星星眼……星星眼……',3),(361,204,43,'2019-05-19 06:39:11','我读羊脂球','那個比較「忠於原著」的小鎮已形同死域。捕獵、馴獸、奴役，精靈對戰如鬥雞賽狗一般過時，所以電影沒多久便把我們帶到一個人獸交集共存的「大都會」去。可惜，城市的規劃仍是以人為本，不見任何為了不同屬性和尺寸的精靈而設的設施。而人獸表面上以拍擋相互尊稱，但主僕關係仍然相當明顯。最終人獸溝通仍是奢談，所謂「牠說」也不過是人類喋喋不休的配音。',3),(362,214,227,'2019-05-09 12:33:11','我读呐喊','萌是挺萌的，但是设定太胡闹了，原著完全被推翻，植入了一个俗套得美式青少年超英片内核，太没意思了',4),(363,19,242,'2019-05-11 20:11:11','我读遇见未知的自己','可爱是都蛮可爱的',3),(364,164,63,'2019-04-25 19:40:11','我读乌合之众:大众心理研究','毁童年系列，真是够无聊的。剧情“混吃等死”凑时间，几乎没啥实际内容，本质上就是《小黄人》那一类的卖萌耍宝片，况且你还不如前者有特色。',5),(365,187,234,'2019-04-28 18:45:11','我读动物农场','因为剧情需要，皮神得用rr的声音，不然一直皮卡皮卡会更萌！剧情太烂了，看的算情怀吧，每一只出现或者海报雕塑里出现的宝可梦都能叫出名字，也算是找彩蛋。',4),(366,92,95,'2019-05-24 03:05:11','我读爱你就像爱生命','6.5 世界观塑造的倒是挺好，皮卡丘很可爱，应该是所有宝可梦都挺可爱的，反派弱智，剧情偏幼，不带脑子看看娱乐性还是很不错的',3),(367,63,118,'2019-05-23 21:55:11','我读当我谈跑步时我谈些什么','可爱就完事儿了还要啥自行车？可达鸭喊你给他捏脚难道你会拒绝吗？？',4),(368,14,92,'2019-05-12 05:46:11','我读安徒生童话故事集','为什么要拿超梦做rush？',3),(369,219,191,'2019-05-20 19:43:11','我读红玫瑰与白玫瑰','安排下训练对战不好吗。',4),(370,196,227,'2019-05-17 13:54:11','我读巨人的陨落:世纪三部曲','无聊透顶，打着灯笼也找不到亮点。不卖萌，并不是它特立独行之处。基本的视效一星打底，而模式化的烂剧本简直是特大灾难，败光路人所有好感，每个情节反转和行为逻辑都令人脱线。如果粉丝因为角色被三维呈现就得到满足，那也太对不起这么多年的情怀了。论idea还不如泄露的跳舞视频呢……',4),(371,100,46,'2019-05-03 17:01:11','我读鬼吹灯之精绝古城','当你弄清楚了谁是爸爸，发现这还是一个谍战元素的反转剧。皮卡丘的萌圆和中年配音形成反差，两个形象的切换。人类与萌宠能否和谐共处的终极命题。日漫而来，初带情怀，二维动画变欧美真人，轻松阖家欢。',3),(372,136,161,'2019-05-07 15:26:11','我读城南旧事:纪念普及版','知道你无论如何都会来看所以也就随便拍拍了。男人养孩子真简单。',5),(373,241,240,'2019-04-25 20:02:11','我读这些都是你给我的爱','童年啊，只能看看会动的一只只小精灵怀旧下，剧情编得真是太烂了。还不如动画的剧场版好看，死侍也救不了场…',5),(374,90,134,'2019-05-01 13:54:11','我读我不喜欢这世界，我只喜欢你','金酸梅提名的“黑”人男主小哥cast得不是一般精髓，否则就可以省掉所有CG变成《和死侍找爹》buddy大电影。上帝是闪耀基佬紫的人兽杂交。我童年只买了干脆面没看动画片',3),(375,237,196,'2019-04-27 23:28:11','我读华胥引（全二册）','超梦好厉害！最后贱贱一本正经的样子，老觉得他是在憋笑……',5),(376,157,63,'2019-05-02 21:46:11','我读半生缘','再萌也不能拯救这故事的垃圾！',4),(377,151,130,'2019-05-08 14:39:11','我读阿Q正传','赛博朋克Pokémon城，记者线人可达鸭，嗑药暴走斗兽场，山崩地裂土台龟，千面刺客百变怪……标准黑色电影套路下各种宠物小精灵基本呈现到位，父子情刻画也还成，作为儿童片还算符合预期',3),(378,50,93,'2019-05-13 17:41:11','我读这些人，那些事','可爱是真可爱，剧情是真低龄。',3),(379,186,165,'2019-05-10 23:53:11','我读陪安东尼度过漫长岁月','皮卡皮卡皮卡皮卡皮，皮卡皮卡皮，皮卡皮卡皮，皮卡皮卡皮卡皮卡皮卡皮卡，皮卡皮卡皮卡皮卡皮卡～丘！',4),(380,13,37,'20