6:11','我读人性的弱点全集','燃哭了！！！什么粉丝滤镜！！真的是很棒的啊小排球！！！！',5),(460,103,7,'2019-05-25 12:35:11','我读往事并不如烟','完全体会到什么叫长篇动画才能有的魅力！！要给月岛回打10000分！！！',4),(461,204,186,'2019-05-18 03:19:11','我读国境以南太阳以西','月岛的部分处理得太妙。对“努力未必有回报，那为什么还要努力”这个话题的讨论，我很喜欢，不同的人给出了不同的答案。日向和影山在回答仁花时说的是不想输，和吃饭一个级别，即“本能驱使”；小山口的答案是“为了尊严”；木兔的解释是你太菜了！还没体会到“那个瞬间”，即“成就感”。细想很有意思。',4),(462,149,140,'2019-05-26 04:15:11','我读未来简史','月岛这个乖僻小腹黑其实心底很喜欢排球，但又怕努力成为徒劳，避免失望干脆就抱着消极态度，刨根究底找一个功利的理由说服自己。这种类型在运动系里极其罕见，但是，实在是太真实了。活在这个利益至上的时代，很多人都在做选择题，快速筛掉这种“没用”的选项，不谈结果未知的恋爱，不尝试喜欢但不知道会不会顺利的工作……现实点没错，但总有些时候希望能勇敢试一次，像月岛一样努力去争取这样“令人兴奋的一瞬”。',5),(463,166,130,'2019-05-14 20:21:11','我读蔷薇岛屿','这个夏天，在小排球的鼓舞下，我居然做到了连续七十天每天坚持锻炼两小时，赞美小排球！',5),(464,271,29,'2019-05-21 02:22:11','我读一句顶一万句','啊啊啊啊啊！！！！恭喜混凝土出身的小天使们！！！！！！！快出下一季啊啊啊啊！！！！！！等不及看全国了啊啊啊啊啊！！！！！！结尾的全日本青年合宿只有影山一个人为什么感觉好虐啊啊啊啊啊 ！！！！！！！',4),(465,202,74,'2019-05-01 03:44:11','我读京华烟云','这季倒是很干脆不讲故事从头打到尾，零日常零练习纯看比赛，倒也爽快。白鸟感觉上比黑鸟儿压力还大，气场不足，作为全国出线权的看门BOSS表现很一般。',4),(466,200,199,'2019-05-06 07:29:11','我读没有色彩的多崎作和他的巡礼之年','月岛大活跃❤',5),(467,239,37,'2019-04-29 16:57:11','我读文学回忆录（全2册）:1989—1995','没想到这季最燃的竟然是月岛莹。',5),(468,206,46,'2019-05-17 22:31:11','我读最初的爱情最后的仪式','其实监督都很钟爱月岛吧……',5),(469,206,230,'2019-05-05 11:14:11','我读尼罗河上的惨案','第四集月岛的拦网是自从我十八岁的夏天以来最热血沸腾的一次',4),(470,259,245,'2019-05-19 17:52:11','我读生活在别处','这一季依旧很燃 但没什么好说的 你们就使劲吹月岛吧 我给你们点赞。',5),(471,233,59,'2019-05-22 13:41:11','我读激荡三十年（上）:中国企业1978-2009','十集讲一场比赛，一集一个燃点，面对强大的牛若，这群少年用行动诠释了乌野的不甘与坚持，月从冷漠到爆发成为本季MVP，没有绝对的主角光环也没有绝对的路人，果然还是集认真、脱线、现实、理想主义 可爱、帅气、和燃于一身的小排球啊！',4),(472,151,86,'2019-04-28 01:18:11','我读设计中的设计','感动到哭的稀里哗啦！一整季讲了一场比赛却丝毫不觉得拖沓，没有强行插入的回忆杀，没有刻意做作的麦麸，没有超出常人的超能力。就是老老实实的热血运动番，却好看的要死！月岛萤我嫁啊啊啊啊啊！',5),(473,178,132,'2019-04-29 00:01:11','我读心是孤独的猎手','最后…赢了…居然也流泪了…就是觉得太他妈不容易了…',3),(474,133,220,'2019-05-07 03:33:11','我读佛祖在一号线','不准低头！！排球是永远向上看的运动啊啊啊啊啊啊！！被b站up剧透真是心态爆炸，但是看到他们赢了还是热泪盈眶(ಥ_ಥ)！队员受伤这种情节也没掉节奏真是太舒服了，还有大王大人眼镜装太好看了嘤嘤嘤✧⁺⸜(●˙▾˙●)⸝⁺✧ 表白全员，等第四季！',4),(475,14,123,'2019-05-15 07:09:11','我读我执','活下去的动力！/ 看完了...活不下去了.........',5),(476,236,109,'2019-04-27 20:55:11','我读我