燃燃燃节奏好棒',5),(636,293,175,'2019-05-10 07:26:11','我读肖申克的救赎','我知道他们会赢，我知道他们会赢的很艰辛，可是我也真的在最后决胜球的时候哭的乱七八糟啊。「不要低头！排球是永远向上看的运动啊！！」不要回头，日向、影山、大地、西古、月岛、山口、菅原…向着全国大赛努力进发吧！！',3),(637,121,155,'2019-05-05 02:16:11','我读月亮与六便士','乌鸦对战白鸟，很燃',3),(638,43,19,'2019-05-16 01:39:11','我读羊脂球','啊啊啊真的好久没有这么好看的真实系运动番了找回了一点当年看灌高的感动！补完第二季正好无缝衔接_(:з」∠)_打了一季的白鸟泽_(:з」∠)_及川大王眼镜姿prpr_(:з」∠)_月月帅哭_(:з」∠)_一成叔RIP QAQ',3),(639,284,128,'2019-05-13 22:00:11','我读呐喊','排球少年一生推！！！真 体育动画！！！',3),(640,233,44,'2019-04-28 10:27:11','我读遇见未知的自己','这一季好燃',3),(641,293,192,'2019-04-28 12:42:11','我读乌合之众:大众心理研究','真的很棒。画风好，情节性、连贯性强，吸收许多前辈的经验。感情真挚。搞笑恰到好处。',3),(642,215,213,'2019-05-10 05:24:11','我读动物农场','怎麼只有十集！！！你們不是打了五局嘛！！！請你們負責任地浪起來好不好！！',5),(643,50,84,'2019-04-23 14:39:11','我读爱你就像爱生命','全程就是干。剧场水准的华丽制作力和直击心灵的演出表现力，赛事的紧凑和激烈都达到了一个新高度。主角负责热血傻萌，配角负责诘问思考，聪明的群像安排啊，月岛本季MVP。',3),(644,95,14,'2019-04-24 23:28:11','我读当我谈跑步时我谈些什么','热血啊热血',3),(645,186,209,'2019-05-23 23:21:11','我读安徒生童话故事集','没有及川君的发球加持怪可惜的(>﹏<)',5),(646,146,27,'2019-05-10 18:59:11','我读红玫瑰与白玫瑰','听说最后一集360旋转的镜头，监督撸袖子亲自下场画的。一如既往的高水准，连原创部分都是那么的熨帖。飞吧！鸟野！',3),(647,41,201,'2019-05-19 09:32:11','我读巨人的陨落:世纪三部曲','两个本来就很强的人变得更强的故事。但是其中缺乏核心矛盾，缺乏本质进步。就连主观能动性上的改变也没有，两个本来就热爱排球的人最后还是热爱排球。个人性格上的小矛盾倒是有，但刻画得过为轻描淡写。不过作为排球类运动推广的作品来看倒也中规中矩。作为青春类作品来看，缺乏对青春期的描写，例如烦恼的描写。作为“龙傲天”类作品来看，却又没有能突出描写其“傲”。虽然本质上两位主角都很“傲”，但还是有试图描写进步过程。作为血类作品来看，却又缺乏热血性和逆转的喜悦和为逆转付出的痛苦。虽然有落后局面，但观众总能毫无疑问想到最后角色的胜利。而没有痛苦和后悔就不知道什么是喜悦和激动。剧情更多的可以看作为团建的过程和结果。音乐和配音以及画面色彩上面较为出色，动作场面的作画能算得上是仔细。综上所述，给出4星（即推荐）评价。',3),(648,226,46,'2019-05-22 04:30:11','我读鬼吹灯之精绝古城','小排球真的是近几年最棒的运动番了！',5),(649,90,203,'2019-05-04 21:19:11','我读城南旧事:纪念普及版','每一分钟都是惊喜！爸爸我爱你、零鸭蛋、卖蜘蛛服的收银员斯坦·李、“让他良心不安！”、穿斗篷的蜘蛛侠、有肚腩的中年发福版蜘蛛侠、蜘猪侠…哈哈，先笑一会儿…“知道自己不是一个人的感觉真是太棒了” 整个观影心情就是：新奇-大笑-感动，此起彼伏接连不断。“最让我们难受的是，你不能每次都救得了人” 机甲蜘蛛侠装备损坏时的那个“爱你”，是堪比《月球》Gerty机器人出现落泪表情的感动瞬间。爸爸的那句 “有时候人和人的关系会变得疏远，但我不希望这发生在我和你身上” 简直让人暴毙。这部电影就连剪辑、配乐等技术都是动画里的一流，2018年度动画最佳！',4),(650,82,136,'2019-05-06 22:53:11','我读这些都是你给我的爱','自山姆·雷米「蜘蛛侠2」以来最佳蜘蛛侠电影！无论是漫画式的画风，还是迷幻的色彩，动画的形式彻底释放了多元宇宙的潜力，第三幕的异次元大战更是好莱坞动画近年来最具想象力的一幕。文本方面，既有蜘蛛侠一贯的成长的烦恼，还通过平行宇宙引入了超级英雄的中年危机，更不用说对蜘蛛侠系列各种老梗的致敬与恶搞，以及可能是最好的斯坦李客串。最讽刺的是，这片里出现的每一个蜘蛛侠都比现在MCU里荷兰弟的版本有趣',3),(651,61,155,'2019-05-21 11:25:11','我读我不喜欢这世界，我只喜欢你','谁能想到索尼居然在2018年的最后一个月用一部超级英雄动画挑战了迪士尼在动画奖项上的霸权？',4),(652,192,65,'2019-05-06 04:48:11','我读华胥引（全二册）','虽然主题上还是老调重弹，但动画在内容和形式上的选择远比真人影片自由。漫画式的视觉呈现，极具个性的色彩搭配，诞生了最贴近漫画原作的蜘蛛侠作品。六个蜘蛛侠各具特色（其实不止六个），但颓废版的Peter Parker无疑是我的最爱：一个步入中年，陷入人生低谷，却依然有着自我牺牲精神的英雄。哪怕嘴里说着不要让我听到“能力越大，责任越大”，却还是身体力行地实践着这句话，蜘蛛侠精神的最完美体现。',3),(653,269,227,'2019-05-19 08:12:11','我读半生缘','最佳蜘蛛侠电影！最佳斯坦李彩蛋！最佳片尾彩蛋！',3),(654,274,217,'2019-05-02 01:18:11','我读阿Q正传','今年最好看的动画长片了。视觉实在太突出，冲这个就可以二刷了。还有很强的漫画感，各种字幕、对话框、随心所欲的画风与丰富的视觉元素。同时，剧情也不落后，精彩又有趣，何况还有六个蜘蛛侠大聚会。能把一个老套的超级英雄成长话题，讲得这么吸引人，甚至还有泪点。片尾字幕致敬了斯坦李，以及，千万不要错过最后的彩蛋哦，非常好笑哦。',5),(655,113,97,'2019-05-18 18:36:11','我读这些人，那些事','1.电影讲述男孩迈尔斯被受到辐射的杨永信咬了，变成磁爆步兵、雷电法王，获得“电击疗法”的技能，从而打败敌人的故事。',4),(656,156,211,'2019-05-11 20:25:11','我读陪安东尼度过漫长岁月','2.白人、黑人、男人、女人、大人、小孩，甚至猪都当了蜘蛛侠，唯独没有中国人，建议封杀。',5),(657,94,223,'2019-05-21 06:02:11','我读喜宝','3.从《独立日2》到《毒液》再到《蜘蛛侠：平行宇宙》，QQ的业务已经拓展到了外国、月球，以及其它宇宙，腾讯已经称霸银河系，成为宇宙第一企业。',5),(658,165,39,'2019-04-30 13:48:11','我读射雕英雄传（全四册）','4.电影很戳泪点。',3),(659,38,3,'2019-04-30 23:10:11','我读梦里花落知多少','号称“最屌丝”的超级英雄都穿上了OW联名AJ1，我看着自己的阿迪王默默哭出了声。',3),(660,27,44,'2019-04-28 08:55:11','我读一个人的朝圣','5.一年死两次彼得·帕克，每次都有新感觉。',3),(661,204,29,'2019-04-22 18:35:11','我读一只特立独行的猪','【内地版片尾无彩蛋】',5),(662,259,50,'2019-04-30 20:48:11','我读如何阅读一本书','看了场IMAX，非常爽，比真人版的超级英雄电影更爽，特效场面非常酷炫，而且还干净，画风就像漫画分镜直接动起来，有很多想象力和表现力爆棚的镜头，是真人电影无法达到的，这就是动画的优点，就算它画一些真人做不到的东西，你也会相信，还会觉得酷，因为它是动画有别于真人电影的魅力所在。虽然有7个蜘蛛侠，但还是噱头式的彩蛋人设，7个蜘蛛侠更是共用一个演过无数遍的老掉牙的故事，虽然无聊了点，好在视觉效果真的非常酷炫，看到这部的完成度，以后都不想看那些所谓的国产良心动画了，想追上人家这水平这业务能力，真不知道是什么猴年马月了。',3),(663,221,56,'2019-04-28 07:56:11','我读朝花夕拾','中途一度想睡去，就是偶然被毒蜘蛛要了一口成了蜘蛛侠打败了恶人包括自己的亲叔叔，这个老掉牙的英雄模式有啥好热捧呢？画面是不错，但这还是一个平庸的故事啊，为什么豆瓣开分9.0？这个世界真疯狂',4),(664,2,75,'2019-05-07 03:28:11','我读格林童话全集','【A-】不好意思，这才是今年最强漫改电影，甚至可能是史上最好的蜘蛛侠电影，海王复联3什么的，都可以歇歇了。你所能想象到的，类型片在好莱坞工业流水形式下达到最高水准。五星的剧本，五星的视觉调度，五星的艺术设计，连配乐都好到无可指摘。这是一部能让所有对特效大片感到厌倦的人，在影院重燃激情的经典之作。',5),(665,124,49,'2019-05-02 18:31:11','我读地下铁','我这是什么命！一年看两部带Peter Parker的电影，一年为他哭两次！这是海澜蜘蛛吗？！！！！',5),(666,193,178,'2019-05-14 08:53:11','我读孩子你慢慢来','斯坦李说：蜘蛛服会合身的，总有一天它会合身的。听完这话有些惆怅。影片用斯坦李这句话贯穿影片，新塑造的颓废蜘蛛侠，面具下是我们平凡人的日常烦恼，超级英雄也是人。为何要做动画片了，因为那惊奇的镜头运镜，丰富的想象力，炫彩的颜色，是真实拍摄无法比拟的。',3),(667,77,215,'2019-05-19 04:04:11','我读杀死一只知更鸟','最后字幕有彩蛋，别走开，正式开启多宇宙蜘蛛侠。',3),(668,51,28,'2019-05-18 09:16:11','我读麦琪的礼物:欧·亨利短篇小说经典','今年最好看的商业动画片，美漫改编电影的最完美形态。',5),(669,209,147,'2019-04-28 20:17:11','我读刀锋','我TM吹爆！这是一部看完想让人出去荡秋千的片！华纳应该来看看多个不为人所知的超级英雄的电影怎么拍！有成长有救赎有令人想哭的死亡也有令人捧腹大笑的场景（还不是妇联那种强行联动）还解决了一直以来的cp站队问题！高中组配Gwen成人组配MJ！画面太美了（这是我见过的最会玩的片头logo）（回头等bd到了截图自己打印海报去） 配乐又长又棒还经典以及各种应景（所以ost也是躲不掉的了） 最后 给那些看不起动画片的人一句Do you have a problem with comic?',5),(670,50,250,'2019-05-21 23:37:11','我读海底两万里','看过的蜘蛛侠系列最佳，漫威这是要冲击奥斯卡最佳动画的节奏啊！六个宇宙的蜘蛛侠（女）集合大作战，有成长有恶搞有热血，时不时还打破次元壁一下。Stan Lee老爷子特出的彩蛋好感人~~~~~~~~~“每个超级英雄都不孤单！”',4),(671,263,180,'2019-05-04 13:56:11','我读孤独六讲','4.5 从头到尾全程炸裂，简直都要从银幕上炸出来了。塞彩蛋、组情怀、家庭情感，每张牌都打炸，一举超越MCU的所有真人超级英雄电影。',5),(672,241,126,'2019-04-22 09:55:11','我读步步惊心','平行宇宙的拼贴概念不仅打破了次元壁，还打通了动画电影和漫威漫画的界限，同时也贯通在了美术作画和主题核心之中。实在是太棒了。',5),(673,228,146,'2019-05-06 04:04:11','我读月亮忘記了','我一直喜欢动画多过电影，是因为动画角色能干电影里不合逻辑的事，能拍电影里做不到的镜头。这部漫画风的动画把动画的这一特性发挥充分，也是很可爱了。老彼得帕克又丧又帅的。',3),(674,205,20,'2019-04-30 17:53:11','我读此间的少年','技术上已经无可挑剔，丰富酷炫的视觉持续轰炸，还原美漫风格好评！但作为“平行宇宙”想象力还是匮乏了些，蜘蛛侠除了形态不同基本都是青少年勇于迈出自我的老路子，建议和《瑞克和莫蒂》学学脑洞。',5),(675,179,245,'2019-05-11 22:12:11','我读菊与刀:日本文化的类型','“做你自己”的老生长谈，以及又一套颜色正确的、绝对安全低龄、纯娱乐向的宇宙拓宽类型，尤其是穿插而来的其他“被咬”宇宙，真的是画风乱飞，最后全幕乱扭。',5),(676,148,102,'2019-05-23 13:59:11','我读你今天真好看','太特么好看了，年度最佳动画，最佳超级英雄电影，最佳镜头设计，最佳视觉效果，最佳配乐，最佳场面设计，没想到索尼哥伦比亚居然掀起了一场全新的动画革命！',4),(677,91,84,'2019-04-22 18:13:11','我读尘埃落定','千万不要当蜘蛛侠的Uncle，会没命的。',5),(678,261,46,'2019-05-26 00:12:11','我读查令十字街86号','不熟悉的超能力总归会熟悉，不合身的蜘蛛服以后会合身，每个人不都是这样跌跌撞撞长成了大人。练习着弹跳节奏，把控着吐丝能力，仿佛被毒蛛咬过的身体某天开始发育，这个世界宣告你要承担更大的责任了。所以长了肚腩的彼得·帕克，最不想听这句话，只想在穿梭来的平行时空里，对心爱的女孩说一声抱歉。',3),(679,116,124,'2019-04-28 09:32:11','我读流浪地球:刘慈欣获奖作品','这才叫漫改！这个美术，这个情节，这个剧本，简直无可指摘啊！',3),(680,190,220,'2019-05-12 22:28:11','我读球状闪电','年度最佳动画电影。甚至可以去掉动画两个字：近年来最优秀的超级英雄电影之一。迪士尼的套路统治太久了，把蜘蛛侠这种老IP如此玩出花儿来，真的太难得了。',5),(681,135,144,'2019-04-30 14:26:11','我读那些回不去的年少时光','已经对这种超级英雄寻找个人存在价值和成长蜕变的剧情产生免疫了，看着好累。',5),(682,108,211,'2019-05-23 18:58:11','我读荆棘鸟','汤浅政明：我才是最大的IP。',4),(683,137,137,'2019-05-24 14:06:11','我读金锁记','再次验证了一个简单道理，最好好莱坞电影永远也就是每个时代最好的先锋电影。',5),(684,43,198,'2019-05-05 18:08:11','我读哭泣的骆驼','从视觉和概念而言，这就是属于大银幕的波普艺术',3),(685,242,60,'2019-04-24 23:42:11','我读一個人住第7年','給分的理由在Spider-Man: Homecoming當年就講完了。然而，即使如此，這片還是遠遠超乎了我的預期，硬生生讓「DC動畫遠勝漫威動畫」這套公論從此空出一道缺口。老帕克和小麥爾攀牆夜談的一幕可列入年度最佳電影調度top20。',5),(686,137,166,'2019-05-19 09:10:11','我读悲惨世界（上中下）','Zzzz',3),(687,22,2,'2019-05-14 08:31:11','我读寻路中国:从乡村到工厂的自驾之旅','年度最佳！一定要看IMAX！一定要看IMAX！一定要看IMAX！一定要看IMAX！一定要看IMAX！一定要看IMAX！一定要看IMAX！一定要看IMAX！一定要看IMAX！一定要看IMAX！一定要看IMAX！一定要看IMAX！一定要看IMAX！一定要看IMAX！一定要看IMAX！一定要看IMAX！一定要看IMAX！一定要看IMAX！一定要看IMAX！一定要看IMAX！一定要看IMAX！一定要看IMAX！',5),(688,26,150,'2019-04-24 00:39:11','我读常识','这个片子玩高级了，就像掉进一个绚丽的万花筒，沉溺在色彩缤纷里无法挣脱，就像戴着耳机打电玩，每一步踩着拍子前进，目不暇接，耳不暇闻，白人、非裔、亚裔，甚至宠物界、机甲界都讨好了，要想象力有想象力，要人物有人物，要三观有三观，好看，好听，好玩，可能是明年奥斯卡最佳动画长片了。',4),(689,162,1,'2019-05-21 02:24:11','我读富爸爸，穷爸爸','看过的视觉冲击力最强的动画电影没有之一，色彩斑斓运镜华丽，画面中填满了元素却从来不显得杂乱，更可贵的是它奇迹般地有着一个配得上这个画面的上佳故事：所有关键设定，剧情转折和人物抉择都服务于主角的成长这一主题，扣得严丝合缝。片中有6个蜘蛛侠，尤其是在男二彼得帕克更具人格魅力的情况下，叙事焦点也从未被喧宾夺主，三幕下来将这一常见的主题讲得少见的丰满透彻。高潮部分有几个无伤大雅的小毛病，但不影响此片堪为所有相似题材动画与商业片的模范。',3),(690,182,100,'2019-05-12 04:25:11','我读史蒂夫·乔布斯传','本身就是一部完成度很高的超级英雄电影，保持类型特色的同时又有颠覆和创新，而出色的动画形式又值得加1星。',3),(691,79,70,'2019-04-24 13:32:11','我读飞鸟集','B / 蜘蛛网的视觉形象简直完全契合这部里打破时空结界的概念啊。在最cliche的剧情里利用动画形式插入了好几次有趣的时间皱缩，从而完成了套路中的自我解构。叙事的节奏变得跌宕生姿，略有残缺的剧作也发散了出来。彻底被丧Parker圈粉，去平行时空偶遇一个相识又不相识的人然后突然和ta说对不起可真是浪漫到吐血......',4),(692,216,218,'2019-05-21 21:04:11','我读雷雨','太惊喜了！远超过预告片给我的印象。基本锁定年度最佳动画片！画面效果，2D结合3D，立体感极强，视角丰富多样，特别是结尾几场戏简直令人眼花缭乱！场面丝毫不输真人商业大片，镜头方面更是达到了真人电影不敢想象的绚丽程度。堪称最还原漫画风格的电影/动画片：对话气泡、分格画面还有拟声词的运用都很到位。蜘蛛侠的故事其实已经在大银幕上被讲过三轮了，但本片依然能把这个元初故事讲出新意。索尼动画这次真是为漫威开了条新路。要说不足，主要是结尾故事仍然略弱，对反派的塑造依然很单薄。总结一下：年度最佳动画片！近年来的动画片突破之作，开风气之先！近年来最佳的超级英雄电影之一。0.9亿成本能做到这样，相当了不起！本片太能反映好莱坞动画片整体水准了——人家是工业推动创意，我们这里还是创意拉着工业奋力前行！',3),(693,199,26,'2019-04-22 12:04:11','我读水浒传（全二册）','总觉得豆瓣评价过高啊…六个平行空间的蜘蛛侠联合确实很有噱头可是毕竟是电影，延展空间有限，这么有看点的一个题材也拍得挺中庸的，而且剧情也有很多没逻辑说不过去的地方',3),(694,150,143,'2019-05-21 15:22:11','我读海贼王:ONEPIECE','燃哭了，年度最佳之一。',3),(695,238,3,'2019-05-07 01:51:11','我读鹿鼎记（全五册）','9分。商业片敢于搞这么复杂的设定已经让人刮目相看，何况本片要义完全是在形式实验上面，形式比设定还要复杂十倍……能把这些私货夹带在一个爆款超英动画里面，这才是高端操作啊！',5),(696,76,96,'2019-05-03 20:48:11','我读你好，旧时光（上下）','视效真的是大型嗑药片，蜘蛛侠对于平行世界的自己的幻想果然也是（像钢铁侠一样拥有无数战服的）有钱人！',5),(697,36,145,'2019-04-25 11:30:11','我读时间旅行者的妻子','感觉又一个电影技术新纪元开始了，而蜘蛛侠还是画风最酷炫屌的那个英雄',5),(698,248,119,'2019-04-30 04:55:11','我读倚天屠龙记(共四册)','有意思，戏外的人都说“大杂烩，江郎才尽”；戏里的人总说“别让我孤军奋战。”',4),(699,247,161,'2019-05-25 20:48:11','我读西游记（全二册）','画风、剪辑、配乐，吹爆。',4),(700,165,23,'2019-05-02 19:44:11','我读长恨歌','毫无疑问这是今年最好的漫改电影，还原了漫画的视觉效果酷炫先锋，人物弧度与节奏的完美把控使得116分钟无一幀废戏。向马奎尔的初代蜘蛛侠和加菲尔德的超凡蜘蛛侠的一一致敬，完成了一次超越蜘蛛侠的自我传承，重新续写了邻家英雄史诗，最后归结到「人人皆为蜘蛛侠」的信念，不正是每个爱上《蜘蛛侠》的漫画迷的初心吗？鉴于今年冲奥片子的质量，我真的想把奥斯卡最佳影片、动画、改编剧本、视觉效果、艺术指导、原声配乐都给这部电影。',5),(701,246,82,'2019-05-26 09:42:11','我读狂人日记','核心依然是关乎「家庭」和「成长」——好莱坞主流商业类型片永恒的母题，前者描摹偏弱，但后者在众人皆知的原IP基础上开发出不俗新意，的确有惊喜之处。小径分岔的平行宇宙模式已然常见，在完美还原漫画分镜的加持下，呈现出生机样貌，群像分屏应用得当，字幕显形内心戏，剪辑配乐都相当出彩，呈现出一流的工业水准；流畅运镜与天马行空的调度，彰显动画制作的独到优势，且表现形式可谓与时俱进。让人感触的是，脱离超级英雄装备等身即开挂的窠臼，以较大篇幅刻画一个怯懦犹疑的孩子如何成长，如何在自卑惶惑中作出坚持自我的选择，以及中年蜘蛛侠与常人无异的各种人生困顿，两两相照，各自寻回接渡自己的方式。较有遗憾的是，蜘蛛侠大会，另外几个角色有凑数酱油之嫌。',5),(702,287,63,'2019-05-13 15:47:11','我读东霓','剧情玩得很脱线，七只平行宇宙蜘蛛侠，包括勇敢正义的黑人版，一失败一玩完的白人版，还有面目模糊的黑面版、动物版、白女和黄女版，基本上把现在的种族身份政治光谱覆盖到了。动作场面是美式的硬核和绚烂，故意调低了帧数以突出力度感。有真人版玩不出来的奇趣。',5),(703,251,205,'2019-05-15 01:49:11','我读失恋35天:小说，或是指南','贝吉塔老师早有明言：不要和搞笑漫画人物打架',4),(704,262,30,'2019-05-10 02:46:11','我读你一定爱读的极简欧洲史:为什么欧洲对现代文明的影响这么深','视效可以，编剧略烂。',3),(705,241,221,'2019-05-25 19:50:11','我读最好的我们','这是AJ做过的最好的广告了。',3),(706,236,40,'2019-05-08 19:17:11','我读伊豆的舞女','年度最佳动画比以往来的要晚一些，而且也是今年最佳超级英雄电影，接受反驳，但别找我。在大银幕上首次看到漫画感如此强烈的动画电影，2d与3d的无缝衔接相当漂亮，无论是生活场景还是动作桥段都无可挑剔，能截图拿来当壁纸的画面数不胜数，美术设计加一百个鸡腿。登场角色繁多但处理得当，笑点频出好不痛快。而故事的内核在绚烂的表象之下并没有羸弱不堪，关于主角自身蜕变的内在动力清晰明确，比如今用外在动力驱使着主角去完成一个又一个任务而敷衍塑造的一系列扁平化的真人超级英雄电影要强不少。这也能够使人们回过头来思考那个最初的问题，为什么我们会乐此不疲的痴迷超级英雄电影，因为“人人都可以戴上那个面具。”不多说了，现在我得打开ps4去扮演彼得帕克了。',3),(707,272,165,'2019-05-13 04:44:11','我读时间简史:插图本','黑人侠，女权侠，亚裔侠，致敬侠，甚至还有猪猪侠，只有噱头，没有个性，抢了主角的戏，没有推动主线剧情。看到一半就已经完全出戏。接着就看到左前一女开始聊微信，偶尔拍几张照片，最后发完朋友圈也心满意足地走了。。。嗯，这比电影精彩',4),(708,53,177,'2019-05-23 11:45:11','我读瓦尔登湖','literally看哭啊。虽然是ＣＧＩ，但比较有意思，ＣＧＩ贴上了漫画网点，还有许多像对话框啊之类的漫画原生态元素，而且做成了定格动画的节奏——之前有人说可惜有点帧数不足，说是可能国内硬转3D电影的关系，如果真是那样，那就无心插柳了——但说回来，如果真做成定格动画，那此片真的可以传世啊。',5),(709,42,57,'2019-04-30 23:26:11','我读我与地坛:史铁生代表作','既然都逃学看龙猫了，不如就把它一起看了...故事并不特别，特别的是视效，如果不是这个视效，同样的故事，可以想象一下会减多少分。所以在影片中故事没有那么重要，至少没有好莱坞说的那么重要，重要的是所有因素的综合效果。一部不好的电影不是故事不好，而是综合效果不好，牛逼的导演照样可以把烂故事拍得抓人，特吕弗甚至说一个好故事因为太好了，整个电影会受制与它，所以一定拍不出好电影。这视效算是另类风格（游戏，MV，广告）的一次逆袭，主流总是把它当成不入流，说这种花里胡哨的视效无法支持电影时长，且难以被大众接受，现在我们知道主流错了，它不但能够支撑，能够被接受，而且还做得很棒，甚至有可能反客为主，这可比一根筋地用3D技术做拟真的动画好太多了，希望它能为CG动画产业带来一些改变。',3),(710,214,154,'2019-04-24 15:56:11','我读呼兰河传:1949年版本・原版珍藏','3.5。虽然每个好莱坞片都是以亲情团圆家人拥抱作为恶俗的结尾，但这一版动画片过程眼花缭乱和漫画形式结合得恰到好处，算是美式视觉创造中一个不那样无聊俗套的有趣小型爆发。遗憾的是我认为的最亮点潘妮帕克和她的蜘蛛侠机械人没啥特别出彩的表现机会。',4),(711,284,209,'2019-05-20 03:22:11','我读历史深处的忧虑:近距离看美国之一','年度最佳漫威超级英雄电影，必须是这部动画片。一下子集齐了“6大蜘蛛侠”，以非常规、反套路的方式，打破了各种“次元壁”，少年蜘蛛侠与彼得·帕克在树林里荡蛛丝以及最后的高潮段落，画面之瑰丽炫目，我已经无法用言语来形容。最具魅力的彼得·帕克，最好的“蜘蛛侠成长故事”。',5),(712,267,80,'2019-04-28 08:23:11','我读红与黑','Leap of faith究竟是怎样的一个顿悟？故事情节真的是吐槽无能…可能我本身对蜘蛛侠和突破次元壁这种事情都不感冒…还一下子来了6个…anyway 画面很适合动漫爱好者去看的会很爽 蜘蛛侠迷可以自寻彩蛋 整部影片脑洞新奇有趣 梗也不少 值得三星 但真的没有9分…',4),(713,278,128,'2019-05-23 19:42:11','我读中国历代政治得失','3.7星。It\'s cool but not that fucking cool。1.漫画风十足，眼花缭乱。2.官方吐槽满满。3.各版本蜘蛛侠集合后，画风突变，有看王祖贤赵雅芝贾玲大战法海之感。4.蜘蛛侠集合的设定其实与迪士尼公主集合异曲同工，不过后者给路人带来的震撼度肯定比前者更高，这部的大集合其实更多是满足漫画迷的心愿。5.一直对漫画界“平行宇宙”的设定无感，商业化操作意味很浓，感觉和肥皂剧编不下去了另起一页重写差不多。',3),(714,179,33,'2019-04-27 20:43:11','我读夏洛的网','小资的精神鸦片',3),(715,108,194,'2019-04-26 22:13:11','我读陆犯焉识','目瞪口呆，这电影得建多少模？！？！',4),(716,132,26,'2019-05-02 18:43:11','我读一九八四·动物农场','PP&MJ的cp老粉激动哭了 我永远爱这位好邻居 ',5),(717,19,144,'2019-05-18 13:11:11','我读大地之灯','很好 这就是我想要的美术风格 大法就是大法',5),(718,135,238,'2019-05-19 15:05:11','我读我的天才女友:那不勒斯四部曲-03','蜘蛛侠的飞索和跳跃的合理性背后是城市即丛林的合理性深入人心。从这个角度说，美式超级英雄已经进入了现实世界。。而中国的武侠还是只能藏身于历史的罅隙间，在反复火烧红莲寺和霍元甲陈真叶问三代拳打洋鬼子之后，侠影远去，和我们的世界再无关涉。这时候不由得羡慕起在每个分支宇宙都有蜘蛛侠出没的纽约了',4),(719,135,73,'2019-05-17 21:49:11','我读匆匆那年（上下）','【A+】没得说了，年度最佳动画电影&最佳超英电影。视觉效果简直无敌，现在动画基本都是2D的平面风格、3D的精美画面或是三渲二那种不伦不类的画风。而这部电影简直是场艺术盛宴：2D画风的延展和柔和+3D电脑制作的空间感与细节精密度；夸张的运动镜头和色彩设计；极其带感的掉帧画面感；配上网格底面、拟声词和台词框所特地营造的漫画感，那种浓厚的画面表现力简直要冲出屏幕一般令人难忘。完美的践行了那句名言“动画并不是单纯的炫技，而是服务于实拍无法呈现的剧情”。这已经不是单纯的商业动画了，这是艺术。就动画的艺术性而言，我想在近五年的所有动画片里只有《春宵苦短，少女前进吧》能够与之相抗衡。',4),(720,24,52,'2019-05-19 01:48:11','我读影响力','阿萨亚斯的言论再次被验证:好莱坞用最顶尖的技术生产最大众的实验艺术。剧作的常规、口水和瘦小被迈出通俗半步的视听调度所托起，漫威&迪士尼惯用的审美定式终于被辩证的丢弃，已消失十余年的汉纳·巴贝特卡通风格于此东山再起。',5),(721,32,102,'2019-05-14 05:46:11','我读橙:陪安东尼度过漫长岁月Ⅱ','画面很牛，故事很弱智',4),(722,48,205,'2019-05-26 13:52:11','我读香水:一个谋杀犯的故事','好看到电影结束你想和大街上的陌生人手拉手在寒风中转圈圈，无敌的视觉效果彻底激活了你身上每一个被生活，被寒冬摧残的细胞。6个蜘蛛侠每一个都比真人版的有趣，美漫风格的分镜画面与节奏音乐的配合堪称完美，简直是灵魂画师和灵魂配乐者一边热吻，一边听着最High的摇滚乐制作出来的杰作！',4),(723,82,241,'2019-05-02 10:58:11','我读世界尽头与冷酷仙境','三星半。看完有一股赶紧把已经吃灰整两个月的漫威蜘蛛侠重新耍起来的冲动。',3),(724,263,88,'2019-05-05 23:48:11','我读自控力:斯坦福大学最受欢迎心理学课程','4.5 《蜘蛛侠：平行宇宙》是一部漫威电影。这是一句废话，但要从两方面说：一方面，在视觉创意和空间呈现上，影片在今年所有动画片里罕有敌手，几项视效专利绝对不是盖的，而根本上说，这又得归功于影片从各个角度重新归拢了“次元”这个概念——2D和3D，漫画和动画，日漫和美漫，代表“过去”的黑白和“现在”的彩色，以及物理上的次元：水平的和垂直的，此宇宙和彼宇宙。它源于漫威，但也高于漫威，两个小时看下来，绝对让人眼花缭乱。',4),(725,183,200,'2019-05-03 12:17:11','我读人生','另一方面，影片的文本水平却始终滞留在漫威次元里，实在有点尴尬，哪怕一股脑地把男性与女性、白人与黑人、人与动物、儿子与父亲等等揉进故事当中，未免还是有些单薄。',5),(726,289,230,'2019-05-21 11:57:11','我读看不见的城市','特效场面和城市的夜景画面，如果是真人版的话一定是一场视觉盛宴。然而是个动画片，动画片有什么好看的。假如《速度与激情7》拍成动画片你会看吗？肯定不看。这个同理。',4),(727,215,145,'2019-05-25 05:31:11','我读冰与火之歌（卷一）:权力的游戏','大失所望，这部电影的配音，在我看来是制作事故了，所有配音几乎都没有情绪，让观众的共情感为零，浪费了精美的画面 #最强贺岁档#之#蜘蛛侠：平行宇宙# 补充:我很喜欢这影片的预告片，所以尽快去看了，看的英文原版，但是发现所有声优都是一个平淡的语调，可能是故意这样配的，但是我觉得效果很不好，让观众没有代入感 。再补充: 从预告片我就觉得本片负责画面的导演或者美术，是天才级的人才，只是万万没想到，天才严重偏科了，智力点都加在了视觉上，这部片的听觉方面上灾难级的',5),(728,102,149,'2019-05-07 13:34:11','我读那些年，我们一起追的女孩','年底的大惊喜，用动画形式呈现了真人电影所无法制造的视觉奇观和场面调度，尤其是与漫画的结合及多画风的兼容都足以让观众沉浸在这种快节奏中，即便是近乎乏味的英雄成长故事也在这种大解构当中焕发新生，至少不落俗套。ps：开场就对蜘蛛侠3里那段愚蠢舞蹈的调侃先让我大笑三声！',3),(729,245,155,'2019-05-09 13:16:11','我读江城','3.5 还是有点失望，视效绝对叹为观止，但内核主旨简直保守敷衍到令人无语，和黑豹同样，不是说主角换成黑人就能解决什么问题，可惜了相当不错的点子。超级英雄电影最终还是只能停留在家庭伦理的层面，也许真的无法要求更多了。',4),(730,132,91,'2019-05-17 03:04:11','我读变形记:卡夫卡小说','咋感觉没有以前动画片好看了。配音尴尬……剧情还是那样，也就特效比较好，两颗星……',3),(731,152,233,'2019-05-07 15:04:11','我读把时间当作朋友:运用心智获得解放','隔壁迪士尼再来二十个公主也不是这Fantastic 6/Big Hero 6/666个人的对手。如果你喜欢蜘蛛侠，如果你喜欢看漫画，如果你喜欢看电影，你一定会爱上这一部。片尾字幕泪目。',3),(732,148,231,'2019-04-26 08:21:11','我读阿狸·梦之城堡','章鱼博士简直是韩吉嘛哈哈哈哈哈哈',3),(733,64,62,'2019-05-03 00:56:11','我读天使与魔鬼','今年最喜欢的超级英雄电影，可能也会是喜欢过的唯一一部超级英雄电影。以为最大看点会是超酷的视觉风格，没有想到还是被青春片的内核抓住。我真的不能看青春片，怎么可以这么温柔……哭到最后落荒而逃。',4),(734,264,210,'2019-05-20 03:17:11','我读七夜雪','惊呆了, SONY这次竟然做了个真的好看的一流 (动画) 电影 ˊ_>ˋ',4),(735,110,8,'2019-05-03 23:58:11','我读ZOO','1. 日系ACGer和美系ACGer都应该看。不吹不黑, 这部电影的画面技术和表现风格可以说是「漫画改编动画」最理想的标杆形态 (之一) 了, 无疑给业界指明了一个新的可能性。',5),(736,202,170,'2019-05-09 01:39:11','我读人性的弱点全集','2. 画面技术首先带来了不可思议的视觉刺激, 而且可贵的是「技术」同时也是为「叙事」服务的。这种叙事的调调还就真只有漫画风格才能Hold的住。抽帧本身竟然也是个观影情感引爆的伏笔, 当观众适应了抽帧的动画感后, 迈尔斯觉醒的一段突然炸裂的全帧数摆荡和跑酷简直High到窒息。',5),(737,95,196,'2019-05-22 21:41:11','我读往事并不如烟','3. 蜘蛛侠独有的利用了高机动性特性设计出的立体空间的动作戏相当精彩。敌人和我方多人在四处碰撞的巨大石块间不停穿梭和战斗的感觉像是视角控制完善版的《重力少女2》的BOSS战w',4),(738,281,108,'2019-05-16 03:19:11','我读国境以南太阳以西','我心目中的年度最佳动画电影！以前的蜘蛛侠电影看的时候总觉得有点遗憾在于，把从获得能力到变身超级英雄的过程简化了，仿佛拥有能力就能所向披靡，但这部电影充分展现了从摩天高楼一跃而下之前需要集聚多少勇气和决心。',3),(739,248,101,'2019-04-28 09:26:11','我读未来简史','酷炫的美漫风快要溢出银幕，平行宇宙碰撞的视效十分华丽，原声配乐真的好听到哭！笑点、泪点还有属于每一个蜘蛛侠的闪光时刻，应有尽有。开头Peter的牺牲和Miles父亲隔着门的自白最戳中我。剧情其实并非真的不落窠臼，但是各方面的高水准足以弥补。对于一部漫画改编的电影来说，好像也没有什么别的可以要求了。奶一口明年的奥斯卡最佳动画长片！',3),(740,215,223,'2019-04-26 00:55:11','我读蔷薇岛屿','2018.12.07 @ODEON Limitness Preview',3),(741,136,190,'2019-04-26 18:30:11','我读一句顶一万句','跟我讨厌看美国那些实证研究一样，精致的平庸，掩盖一切差异，追求虚妄的pluralism.',3),(742,52,208,'2019-05-04 19:49:11','我读京华烟云','当蜘蛛侠真人电影在不断翻拍中落入窠臼，这部动画版带来十足新意，无敌破坏王2令我失望后，这部可以登顶年度最佳动画了。特效总会有天花板，而动画片天马行空的想象力、灵活酷炫的运镜和动作设计打破了这层天花板。这一次我要抛弃迪士尼，大喊一声索尼大法好。本片不仅重新盘活了蜘蛛侠IP，更以平行宇宙的巧妙方式将散乱的美漫原著进行了一次整合和推进。一个小蜘蛛已经够逗了，六位蜘蛛侠一起耍宝斗嘴简直不能更热闹，不禁要佩服主创们的脑洞。在全世界动画都越来越皮克斯的时候，还能看到这样的复古美漫风，看到2D/3D画面、来自不同次元的角色如此自然而富有创意的拼贴，看到酣畅淋漓的热血打斗，弥足珍贵。在无与伦比的视觉体验之外，超英片传统的成长故事线亦没有敷衍，是一部没有短板的爆米花大片。斯坦李去世后的第二个彩蛋，台词泪目。',5),(743,48,14,'2019-05-05 22:23:11','我读没有色彩的多崎作和他的巡礼之年','复古美漫风格绝赞，网点质感清晰可见，完全是一本动起来的漫画书！小黑蛛的懵懂诞生和隔壁宇宙彼得·B·帕克的中年危机并行，六个蜘蛛侠各异画风的碰撞每秒都有惊喜。年度最佳超英电影，还附赠一颗史上最棒的斯坦·李彩蛋。',4),(744,151,120,'2019-04-27 03:19:11','我读文学回忆录（全2册）:1989—1996','当迪士尼以为自己用《复联3》和《无敌破坏王2》坐利渔翁横扫颁奖季的时候，索尼求生欲极强的先后甩出《毒液》和《蜘蛛侠：平行宇宙》赶上末班车以示友好。',4),(745,17,23,'2019-05-09 21:13:11','我读最初的爱情最后的仪式','满分！年度前三！炸裂！',4),(746,190,136,'2019-05-07 22:32:11','我读尼罗河上的惨案','真是棒，感觉被人家远远的甩开了',3),(747,123,62,'2019-04-25 00:36:11','我读生活在别处','太好看了！太炫了！二维和三维的切换，对话框和分镜的植入，漫画用大小写文字的声效！看得出来就算科技再发展，也要把经典二维手绘留住的那种力量！',4),(748,122,229,'2019-05-16 07:21:11','我读激荡三十年（上）:中国企业1978-2010','作为一个深恶超级英雄电影的人，遇到它们要么是打着瞌睡度过，要么是甩站通过，却在这部片子里被炸出了极限的快感。2D与3D打通了结界，商业与艺术打通了结界，突破了体裁和题材的框架，开拓了动画乃至电影的边界。分镜构图之美、节奏之行云流水、视角之新奇，让人的空间感知更加丰富，开场3分钟就把我收服了。前阵子翻译一本是枝裕和的新书，里面提到近年来日本大学的电影系，选择学动画专业的孩子越来越多了，因为只有在动画里才能追求极致的把控力，把完美主义强迫症任性的发挥到足尽。而这个故事的精神内核，“蜘蛛服会合身的，到最后一定会合身的”，则让我想起最近的热门话题，获诺贝尔奖的上班族大叔田中耕一的故事。它们都告诉我们：正确的命运有时会以错误的面目前来。上帝爱一个人时，会先把他推下悬崖，然后他才能瑟瑟发抖的扇动着翅膀起飞。',5),(749,148,8,'2019-05-13 08:07:11','我读设计中的设计','故事一般但是视觉效果只能用脏话夸赞。太特么炫了，我的动画梦想又破碎了一点。',3),(750,49,199,'2019-04-24 06:30:11','我读心是孤独的猎手','在美国动画里这是形式创新，但在世界动画就不算啊；看的时候想到了京骚戏画和双斩少女，这部对我的形式震撼远远达不到那两个TV动画作品，然后我自问，如果那两个作品连续给我放120分钟呢？想了一会还是觉得会比这个好看多了…不怎么新鲜好看的形式还套了一个superhero大俗套故事，纽约也没有被新形式表现出什么新感觉，まだまだだね',4),(751,105,127,'2019-05-04 04:21:11','我读佛祖在一号线','分镜确实酷炫到爆，尤其最后男主角从高楼跃下那一刻，确实找回了当初看山姆·雷米《蜘蛛侠》三部曲的激动。剧作上，我觉得与其搞出那么多蜘蛛侠却又不好好花时间进行角色塑造，还不如花更多笔墨在中年蜘蛛侠和男主角如何互相帮助对方找回自信上。最后那几个蜘蛛侠各自回到自己世界我也没觉得多感动，给他们的情感联系描写太少了。如果我来决定这个题材的话，我会建议重点写中年蜘蛛侠、小蜘蛛侠和女蜘蛛侠之间的情感关系如何建立、发展、分歧、升华，最多再加一个蜘猪侠搞笑调剂一下，四个蜘蛛侠就够了，六个太多，真没必要。最后决战对于多重宇宙坍塌成一个的视觉表现还是缺乏想象力，按理说作为动画应该玩得再酷炫一点，最后也只是各种建筑物和交通工具乱飞，某种程度上甚至不如真人的《奇异博士》有视觉震撼力。',5),(752,62,68,'2019-04-25 22:10:11','我读我执','今年最喜欢的超英，毫不费力地引入漫画平行宇宙的概念，并优秀地再造了蜘蛛侠的故事，提醒了我们为什么他一直会是最具人气的角色。',5),(753,296,85,'2019-05-20 11:41:11','我读我的精神家园:王小波杂文自选集','剧情还是俗烂的super hero套路，但是就视觉上而言，说是开创了动画的新疆界都不为过啊。',5),(754,121,86,'2019-04-26 19:09:11','我读九州·缥缈录','视效和声效爆炸，基本没尿点，把“世界（宇宙）上另一个我”的概念玩的太好了，简直泪目，相反黑蜘蛛成长这条线就中规中矩。决战场面那么长真是有钱了不起噢。各种玩梗，最喜欢萝莉蜘蛛侠和废柴蜘蛛侠。今年北美动画炸了。',5),(755,133,36,'2019-04-25 07:15:11','我读偷书贼','无法欣赏',5),(756,193,104,'2019-05-21 10:31:11','我读野火集:二十年纪念版','突如其来的超前点映，成片大大的映照着那句“Everyone is the Spiderman.”。 无论是早期三辑的“凡人英雄梦”还是荷兰弟领衔的靠嘴炮和幽默在出场众多的英雄中被人记住，这部电影都借由“每一个”出现或曾经出现甚至是不同影视作品中的蜘蛛侠让观众再一次记起这个角色值得为人喜爱的特质：平凡、真实和质朴，我想这就是这部野心并不大的动画片最大的意义所在。说回配音，A Special Shout Out to 木兰尼！“Spider-Ham”配得也太太太可爱了。 PS 无论是老爷子的cameo还是片尾彩蛋，均蕴含着用心的设计和惊喜。绝对是年底前最让人难忘的感动和爆笑的观影环节。（国内上映后要二刷！）',5),(757,242,54,'2019-05-04 13:20:11','我读占星术杀人魔法','索尼今年大力开发蜘蛛侠宇宙的又一大动作，包括之前的《毒液》之内的连扳两城？直接抛出平行宇宙概念，变出数位蜘蛛侠，成功扩大了蜘蛛侠IP的宇宙空间，在抵抗漫威的路上越来越有叫板的实力。抛开其他，其实这次的延伸毫无新意：一个还在校园、用QQ、穿AJ的黑皮肤新蜘蛛侠主角。本来他的警察爸爸、反派叔叔是很有趣的设定，但叔叔这集就领便当，爸爸虽然这集还没相认但估计以后也是个搞笑的主。不过，平行宇宙这概念就保证多少年粉丝和票房了，未来与过去的穿梭也能让彼得帕克做更多事。这是要一直拍动画片的节奏。这不，下集就是1967年的蜘蛛人了，会不会和现实世界的斯坦利老爷子有交集？一颗赛艇！',4),(758,212,174,'2019-05-06 07:31:11','我读舞！舞！舞！','视觉很出彩，但毫无节制，疲劳',5),(759,79,15,'2019-05-04 12:11:11','我读浪潮之巅','让我们大声喊出男主的名字：迈……迈什么来着？',4),(760,267,162,'2019-04-24 22:15:11','我读解忧杂货店','垃圾3d效果',3),(761,240,142,'2019-04-27 11:50:11','我读小王子','好high哦～感觉剧情达到了高潮，感觉观感已经到达了巅峰！好震撼，好夺目好炫彩，啊～那么多蜘蛛侠在看我！',5),(762,68,218,'2019-05-04 02:31:11','我读白夜行','新颖的英雄叙事角度 动画中的刺激和冲突程度远超电影；可惜3D很减分 今年唯一一部看到头晕 可以说体验很不友好了.....IMAX34',3),(763,236,17,'2019-05-22 21:13:11','我读围城','这也叫好？满屏的讨好各种主义。',4),(764,89,27,'2019-05-14 02:28:11','我读三体:“地球往事”三部曲之一','中年危机蜘蛛侠、色盲蜘蛛侠、动物蜘蛛侠、女性主义蜘蛛侠、秋叶原蜘蛛侠、种族平权蜘蛛侠。',4),(765,152,83,'2019-05-20 18:44:11','我读嫌疑人X的献身','叹为观止 视觉上精彩得让人舍不得眨眼 因为是动画 所以所有的绚烂都可以更加放肆地天马行空 特别是最后boss之战 五彩缤纷的气泡在眼前爆炸真是说不出来的爽！值得一提的是 电影的分镜加上字幕蹦出来的漫画感 让这英雄式电影新颖又复古。剧情发展也high 平行时空的六个蜘蛛侠共同作战能不high吗 不过如果6个人（有一只是猪？）可以多一点戏份就更好了。最后想对第二个纽约的Peter Parker说 你回去之后一定要好好减肚腩哦！',5),(766,155,155,'2019-05-06 01:57:11','我读活着','高潮大战这个酷炫感，真的是逆天了，之前《奇异博士》中也有过类似天旋地转的酷炫，但由于这部是动画，视觉效果上得以更加自由奔放、登峰造极，看着太爽了。平行宇宙来的几位也都挺赞的，尤其喜欢暗影蜘蛛侠，还有女蜘蛛侠也太帅了。故事拆分开来其实还是老套路，但是借着平行宇宙还是玩出了新感觉。画面做了大量漫画式的效果，尤其是打斗时，非常有趣，漫改影视用这种手法处理实在太合适了。',3),(767,153,58,'2019-05-14 05:14:11','我读挪威的森林','有黑有白有黄种，有男有女有动物，政治正确要记清，漏掉一个都不行。既然在另一个平行宇宙里，动物可以像人一样说话，那干吗不直接弄个蜘蛛过来，弄只猪来算什么，瞧得起猪，瞧不起蜘蛛吗。',4),(768,175,49,'2019-04-30 04:57:11','我读百年孤独','原来动漫还可以这样拍，原来蜘蛛侠还可以这样拍，了不得！',5),(769,184,172,'2019-05-08 11:47:11','我读红楼梦','动次打次的音乐忍不住跟着节奏摇起来了，对这样抓节奏的剪辑毫无抵抗力。',5),(770,31,90,'2019-05-22 08:21:11','我读看见','戴上面具每个人都可以是蜘蛛侠，这是多么难忘的情怀啊！',5),(771,251,179,'2019-05-24 03:28:11','我读平凡的世界（全三部）','一开始有一点点无聊，结果越看越好看！风格独特节奏明快，配乐赞。六款各具特色的蜘蛛侠: 黑人少年蜘蛛侠，中年颓废蜘蛛侠，少女蜘蛛侠，日漫机器蜘蛛侠，老旧黑白蜘蛛侠，动物世界蜘猪侠，行走在平行世界里，人人都可以戴上面具拯救世界~结尾似乎有悬念，斯坦李也算彩蛋了。',4),(772,137,139,'2019-05-22 01:28:11','我读三体Ⅱ:黑暗森林','创意和立意俱佳，再加上最接近漫画的质感，很难不令人耳目一新。有两点很令人感动，一是传达出的人人皆是英雄的概念，在某种程度上确实能够振奋人心。二是平行宇宙间不同人做同一件事情的信念与使命感，让我想到豆瓣上这群影迷们每天在不同的地方看电影，可能在生活中不被人理解，但在这里却能被彼此影响，从而坚定爱电影的初心，这又何尝不是一种平行宇宙呢？',3),(773,177,93,'2019-05-06 18:12:11','我读三体Ⅲ:死神永生','我今年下半年到底看的都是啥',5),(774,123,104,'2019-04-30 16:07:11','我读不能承受的生命之轻','在主流真人漫改电影的分镜与画面质感（基于绿幕拍摄）越来越趋向动画，而动画电影则反之的当下，它做的只不过是很认真地拍了一部正常的动画片，仅此而已。唯一有点意思的应该是两种视觉形象的交汇（平面的与立体的），每当需要传达一种错乱的感受时画面就需要在这两者之间不断地切换，侧面印证物理层面意义上观众被发行方因敛财而强行固定在“3D”的观看方式是多么无知且滑稽。',3),(775,182,131,'2019-05-16 17:40:11','我读达·芬奇密码','破例看漫威，因为很不漫威。画风内容都是大爱，这部也没有那么好，只是跟一般漫威比，有想象力，是电影，如此而已。',5),(776,161,61,'2019-05-22 05:17:11','我读我们仨','说唱+涂鸦的黑人文化彻底领衔，亚裔依旧是那个没有台词的室友，或者......卡通片里的卡通人物......',5),(777,171,246,'2019-05-19 07:01:11','我读天才在左疯子在右:国内第一本精神病人访谈手记','一个特别老套的成长主题配上穿越题材、平行时空的概念和美漫画风，这部片的优点和缺点都很明显。此外，片中流畅的打斗场面，特别是人物顺畅地在不同时空和平面的穿梭，相信会给未来超级英雄电影中的动作场面带来启发。相比起人生导师和伙伴的情感戏，主角的家庭戏就显得弱了很多@百老汇电影中心',5),(778,71,137,'2019-05-07 03:15:11','我读简爱（英文全本）','谁也料想不到，18年一部政治极不正确的电影竟是一部政治极其正确的电影。这部来自美国本土主讲世界民族大团结的动画作品直指大搞隔离主义和单边主义的特朗普政府：一个超级大国是对抗不了全球性恐怖主义的。所以将众多《平行宇宙》里的超级英雄聚集在一起的作者一定是民主党的拥趸，他用视听语言描绘的 “愿景”完全迎合了大多数反政府者的心声。然而影片里这只刚刚发育的小蜘蛛真正面对的却是自身成长的难题，而非权力的游戏。',3),(779,283,44,'2019-05-06 19:01:11','我读哈利·波特与魔法石','炫彩乖张，从第一帧开始就被震到不能自已，在进影院之前根本无法想象自己可能将见证一部里程碑式的作品。',4),(780,184,80,'2019-04-30 14:18:11','我读明朝那些事儿（壹）:洪武大帝','请允许我说，不，不好看。知道导演想找漫画感，可是这个帧数太难受，眼睛与后脑都很疼。故事emm，硬讲大道理。画风多且杂，并不认为是“多种画风自由切换”，不，不自然，看完之后像喝了假酒，没享受到好酒就算了，还有头疼的后遗症。',3),(781,209,183,'2019-05-13 10:06:11','我读傲慢与偏见','在电影里面忠实还原漫画风格，以泼彩方式制造视觉奇观的做法，十年前龌龊司机的真人电影《极速赛车手》已经玩到了极致，但口碑很惨。那部电影喜欢的人都非常喜欢，必须在大银幕上观赏，越大越好。我是看的IMAX，爽了一整天。而不喜欢的人觉得它风格怪异、假得不像是真人电影。本片作为一部动画电影，能有效消除观众的这种认知上的不适感（动画片不存在“假”的问题），所以获得了好评，大抵如此。【永旺中影】',3),(782,250,10,'2019-05-26 06:04:11','我读目送','屌炸天的分镜，燃到爆的视角，一层又一层的梗，简直找到了第一次看超级英雄电影的初心。以及，黑人审美真的是目前最高级、最野性、最自由的。',5),(783,62,21,'2019-05-12 16:49:11','我读恶意','想起之前采访迪士尼动画《花木兰》的导演时，问到关于真人电影和动画电影的差别。对方说，动画电影最好的地方就在于能够把你所能想到的一切都做出来，你能够百分百地控制每秒的24帧。。索尼这次大概是真的做到这一点了。',4),(784,272,140,'2019-05-17 21:19:11','我读撒哈拉的故事','4.5。',4),(785,236,61,'2019-05-10 21:55:11','我读霍乱时期的爱情','当时错过大银幕，确实是一部可看性很高的动画片，美漫风最赞，一些梗和致敬的趣味性很足，但要说强到哪里去也不至于，少年英雄成长的老路子，脑洞其实可以开着再大一些，整体还是不错的，但要说拳打迪士尼是夸张了',4),(786,82,114,'2019-04-30 13:18:11','我读飘','3.5。“最好的形式主义就是让形式成为最重要的内容”，从这点来看，无论绝佳的市场反馈是基于“被新瓶蒙蔽”还是“如此新瓶，旧酒何妨”，代表的都是这种创作理念的胜利。故事上，比打破次元壁本身更有趣的，是让救了无数次世界的蜘蛛侠们聚在一起救自己。',5),(787,261,31,'2019-04-29 08:10:11','我读许三观卖血记','就凭最直接的感官体验看五遍不过分吧？谢谢有创造力的导演团队带我物理飞 我的获奖感言发表完毕了（ps 起码出现了三次42 （pps塔奇科马友情出演，塔奇科马果然是蜘蛛啊！',5),(788,70,54,'2019-05-05 08:57:11','我读边城','比较神奇的是：渐渐就感觉不到这是动画片。与此同时，主角是个黑人小孩，在动画片中也感觉不太到了。神奇了。',4),(789,257,177,'2019-05-09 23:19:11','我读倾城之恋','遁 入 虚 无',3),(790,184,199,'2019-05-01 15:24:11','我读送你一颗子弹','“每一个面具下的人都可以是蜘蛛侠” Stan不是说了嘛，衣服总会合身的！',5),(791,283,65,'2019-05-21 19:32:11','我读狼图腾','年度最佳动画&超英电影，除了第三幕有些太赶时间了外基本无任何明显缺点，一次在IMAX大银幕看漫画的绝佳体验。',4),(792,135,195,'2019-05-25 18:11:11','我读哈利·波特与阿兹卡班的囚徒','PS.凯奇大叔和派派的声音不要再有辨识度',3),(793,230,60,'2019-05-26 01:20:11','我读哈利·波特与火焰杯','PPS.我爱海狸妹子！！！',3),(794,247,176,'2019-05-09 09:43:11','我读盗墓笔记:七星鲁王宫','只想说，WOW! 电影在很大程度上满足了同人粉内心深处的渴望，好比一千位读者的眼里有一千种对超级英雄的想象与内心的自我投射，跨越种族、性别、年龄和时间，所有的形象叠加起来，汇成面具后的TA。英雄并非个人主义，是心中的符号和信仰。看完后内心被很好地慰藉了。若无平行世界，超级英雄永远疲惫，无数次地对抗世界且形单影只。在此片里，他们短暂相遇，获得了永恒的盟友。父子情和官方吐槽，满分。动态3D的银幕漫画效果，满分。次元壁被打破，宇宙开始坍塌时的特效，满分。最后想说，真人演绎实在没法赶上二次元的瑰丽和中二感。唯一遗憾的是，我所在的世界里还没出现超级英雄，至少现在还没有。',3),(795,59,223,'2019-04-24 03:55:11','我读情人','说它是漫威最佳动画也不为过，一个蜘蛛宇宙够索尼吃一辈子了。',3),(796,98,14,'2019-04-27 07:12:11','我读哈利·波特与密室','果然每个平行宇宙的蜘蛛侠都还是得死亲戚。',4),(797,293,216,'2019-05-26 05:53:11','我读穆斯林的葬礼','父子关系看来是动画长片永恒的主题，动画视觉效果炸裂，开篇的节奏快到我想按慢放来仔细看美术，高潮城市倒挂的那一幕看的我浑身起鸡皮疙瘩，各种不可思议角度的精彩运镜也只能在动画长片里才能看到了',3),(798,289,1,'2019-04-23 19:17:11','我读万历十五年','多重宇宙外挂，老瓶怒装新酒。想象下，把真人电影，动画，漫画，和抖音加在一起，然后膨胀100倍，就是这部电影。光是为了这个trippy片头就值得二刷。坐等吊打破坏王拿下奥斯卡最佳动画。',3),(799,173,9,'2019-05-17 04:24:11','我读人间失格','画面做到这个程度，情节就不重要了。那种坐在巨幅的书前翻动漫画的酸爽感不是影院无法体会。电影相比小屏的优势，动画相较真人的特色，表现得淋漓尽致。那种色彩质感分镜头，我只想在厅里举起手叫“嗷嗷嗷”~~~小细节也处理得很到位，我喜欢内心OS的对话框和跟小蜘蛛一起掉下来的AHHHH。然后想要蜘蛛猪的周边嘤嘤嘤',5),(800,47,112,'2019-05-08 03:42:11','我读窗边的小豆豆','还不错~冷幽默不断，各种画风的蜘蛛侠大杂烩。很多镜头很棒，漫画画风很合口味。唯一弱的是剧情。',4),(801,132,190,'2019-05-05 04:51:11','我读老人与海','制作的牛逼不说了，信息量之大看完有点懵逼，至少三刷才能完全看明白；漫画和动画之间的审美尺度把握非常完美；剧本对美国各阶段文化和不同族群的文化特色把握之精准简直妙到毫巅；那些个懂几个编剧名词就说剧本转变生硬的，我只能说你们真的只是黑人电影看得太少以及对美国文化完全没认识',3),(802,222,224,'2019-04-26 16:34:11','我读1Q84BOOK1:4月～9月','蜘蛛侠也算是从小看到大的英雄了 漫改的不错 ',3),(803,82,88,'2019-05-17 18:06:11','我读1987','漫画感好强，喜欢黑发Peter Parker的松紧裤！',5),(804,235,1,'2019-05-24 23:51:11','我读黄金时代:时代三部曲','仅从色彩来说，突然明白了Speed Racer做得好应该是怎样的了。视觉很赞，而且动画实现了很多真人电影无法实现的视听语言，形式上探索到了一个新高度。除主角外的五个蜘蛛侠，至少中年/少女/猪猪都还挺不错。',4),(805,150,127,'2019-04-24 15:10:11','我读哈利·波特与混血王子','6.0   可能因为漫改电影在自我重复的流水线内待太久，稍微做点出格之举大家就嗨成这样，不过这难道不是动画相比于真人电影本该有的优越性么～但还是四星，有些段落会让人忍不住地幻想，在大银幕看MM4和汤浅政明会是什么感觉…算是部一定程度上挣开工业惰性的作品',5),(806,120,123,'2019-05-12 22:58:11','我读人类简史:从动物到上帝','故事很平常，但是视觉效果太特别了，就像是嗑药之后做出来的幻觉',5),(807,155,184,'2019-05-06 23:38:11','我读三国演义（全二册）','「神話/元文本」一次反向式創作，蜘蛛俠的孤身對應軍團式合作，白人變成黑人，叔叔成為敵人，當成李維史陀《神話學》教材，正如神話心理無論變奏出多個版本都會走向同一個方向和相似性。電影只不過拉長了少年成長和蜘蛛感應的控制來確立「力量越大 責任越大」母題。況且是Spider-verse，不是平行宇宙，和時間、空間無關，美漫的跨刊型式合作往往故事很糟，重點都在人物參與，而80-90年代電視動畫時期更將這種方式玩爛，是美式宅文化生產模式針對漫畫迷購買慾的產物。動畫表現方式是貧瘠的，欠缺表現力，每秒都令我膽戰心驚，何必要去做Abel Gance的孩子？靠近電玩遊戲和漫畫的視覺表現是一大死罪，至少電玩遊戲會讓人有參與控製和體驗的感覺，被迫坐在銀幕前慘如受刑，爆米花式花招真的可看成3D動畫未來嗎？讚好的影評人們快去聽Harun Farock說什麼...',4),(808,55,105,'2019-05-12 22:51:11','我读向左走·向右走','索尼好好拍还是暂时不会倒闭的',5),(809,98,2,'2019-05-04 14:09:11','我读哈利·波特与凤凰社','挺好看。最好看的还是嘴炮台词。很开心听到Lily Tomlin配音。之前听一些业内人士吹到跪下，痛哭流涕说我们真的不行，我们从概念上落后人家n条街之类的，我还以为美国人拍出《攻壳蜘蛛侠》了。他们自己作品出街了，说自己行的也是他们。也不知道到底行不行，反正票房最行，600亿了。',4),(810,255,145,'2019-05-06 18:47:11','我读悟空传:修订版','就是，酷！！！！这个概念和视觉效果，再一次走在潮流之前，门槛恰好又在大众能接受的范围内，不至于太先锋，比市场多半步的典范。剧本非常合格，而且同时完成少年成长和中间危机，全篇紧扣蜘蛛侠这个英雄的核心。尽管侦探、机器人、猪头有点酱油。但是的确今年的奥斯卡最佳动画长片有的打了！',3),(811,211,193,'2019-05-04 01:37:11','我读牧羊少年奇幻之旅','在连续看了《天气预爆》和《武林怪兽》后，谢谢这一部把我打救。巧的是这三部想做的都是解构，但相隔的大概是胚胎和研究生的距离。最后的时空大战甚至有汤浅政明《四叠半神话大系》的神韵。',4),(812,51,102,'2019-04-28 06:05:11','我读苏菲的世界','应该是今年的最佳超英和最佳动画电影。真正把漫画元素从文本到视觉上都与电影结合，平行宇宙的出现被标题剧透所以惊喜不大，但整个电影漫画式的画风十分惊喜，从片头各个公司厂标亮相就让人感到极强的漫画感，而整个电影以减少帧数的方式使画面卡顿带来的视觉效果让人再次眼前一亮，部分台词弹幕化也是对漫画的动态呈现，除了美漫元素还加入了日漫元素，而斯坦李在本片的客串更是有史以来最符合漫画家、最私人、最动人的一次，像是一次对蜘蛛侠的表白。惜于整个故事到最后很多人物都缺个结尾，叔叔的真实身份到最后也没交代，决战处浓郁的色彩乱炖略有视觉疲劳。',3),(813,227,10,'2019-05-21 06:40:11','我读房思琪的初恋乐园','颜色和3D效果的运用创动画新高。至于剧情什么的，文戏部分尤其是黑人/拉丁裔男主什么的感觉是政治正确无误了，但还是有点煽。机甲少女/卡通版/黑白版倒是很有意思。',4),(814,280,168,'2019-05-05 05:13:11','我读鲁滨逊漂流记','果真是最好的蜘蛛侠电影，不枉我假期只睡6小时就赶最早的IMAX场。杂糅了各种次元的风格与气派，人多势众却不失条理，再衬上极具冲击力的画面与配乐，加一点迷眩的颠覆、温情与绝地反击，太绝了。斯坦·李的客串已在倒数，但谈及每个人都不孤独的观点，他的出现比蜘蛛侠更有说服力与号召力。38岁的前夫也太迷人了吧，哎哎，我果然还是更喜欢30+的超英。话说，印象中第一部自觉掏钱去看的电影是《蜘蛛侠3》 (200705)，第一部IMAX电影则是《超凡蜘蛛侠2》(20120902)，也是巧了。四星半。',3),(815,280,174,'2019-05-18 18:41:11','我读天龙八部','娱乐性高、动作爽快、风格突出、节奏明快、故事及格、不流水线、自然玩梗，所有真人超英电影想要做到的都被这部动画电影给达成了 7.7分★★★★',4),(816,295,59,'2019-04-26 19:30:11','我读莲花','漫威最近的作品“溢价”太严重了，除了格温和颓废版彼得帕克，连同迈尔斯在内的其他“蜘蛛侠”塑造实在平庸。漫威之所以在电影领域吊打DC，是因为电影的联动做得太好。动画的设定，剧情低幼，所谓的视效不能拯救平庸的剧情。如果拍成真人电影，可以给8分，但是动画削弱了代入感，7.5分不能再多。真搞不懂北美观众是给出烂番茄过90分的高口碑的。我个人反而更期待格温蜘蛛侠的单人真人电影。',5),(817,46,240,'2019-04-28 22:44:11','我读无声告白','天惹 这渲染我可以蹦一年 （P5要素充实（Telltale Games要素充实',5),(818,5,218,'2019-04-23 07:46:11','我读呼啸山庄','1，太好看了吧！想二刷！2，正在我怀疑为什么没有女蜘蛛侠的时候 Gwen 就出现了，而且发型还贼酷，雌雄同体。3，家人、朋友的最高展现形式都是「爱」。',5),(819,20,250,'2019-05-22 21:34:11','我读亲爱的安德烈','平行宇宙确实概念用的好，这样观众也能在大银幕上看到六个蜘蛛侠同台。但最让我惊喜的其实不是故事，而是视觉效果，除了酷炫之外，还有漫画式的呈现，虽然看起来有点偷工减料一般的讨巧，但你不能不服这种形式带给人们的新鲜感。3.8',4),(820,245,154,'2019-05-12 17:49:11','我读基督山伯爵','有想打五星的冲动。用最近流行的话讲就是好嗨好嗨哟，好炫好夺目。',5),(821,184,84,'2019-05-20 20:44:11','我读白鹿原','我的天呐，这个画风，太炸了，今晚影评安排！太喜欢了',5),(822,3,67,'2019-04-22 21:05:11','我读骆驼祥子','去告诉世界，你已横空出世',3),(823,290,15,'2019-04-29 16:21:11','我读灿烂千阳','蜘猪侠太违和扣一猩',4),(824,43,168,'2019-05-08 10:58:11','我读局外人','无法相信新年前夕索尼王炸了！9000万美金的成本不仅落到实处而且把形式主义玩上了天。电影充斥着漫画书风格，但立体建模的人物再把平面放映转成3D，漫画书式的平面背景（暗影蜘蛛侠最明显）与立体交织层次感十足。6位蜘蛛侠化学反应太强了，而且自己的专属画风穿插地毫不违和，人物塑造也基本达到了迪士尼水准。唯独量子对撞机告别太赶，刚来的泪点就收住，略遗憾但无伤大雅。',3),(825,199,189,'2019-05-23 19:44:11','我读茶花女','（海莉的配音太棒了！格温的脸模也做的很漂亮，但我pick暗影蜘蛛侠，其余你们随便）5星！！！',5),(826,209,41,'2019-04-26 05:38:11','我读海边的卡夫卡','居然想喊一句索尼大法好',4),(827,124,1,'2019-05-09 21:24:11','我读一个陌生女人的来信','我要给一起观影的小伙伴负荆请罪，买成了国语不说，全场熊孩子+熊大人的嘈杂声简直堪称影院观感最差的一次。',3),(828,41,217,'2019-04-29 10:06:11','我读笑傲江湖（全四册）','全程抖腿。王老师说得对，这就是电影院蹦迪。',4),(829,134,155,'2019-04-26 14:09:11','我读福尔摩斯探案全集（上中下）','它可能不是今年最好的电影，但绝对是视听语言最炸裂的一部动画电影。《蜘蛛侠：平行宇宙》最大限度地调动了观众的耳与眼，动感的摇滚乐和缤纷的色彩带来了震撼的视觉体验，塑造了一个科技感十足的现代都市。传统纸质漫画与前沿CGI技术的完美结合燃起了观众的热情与激情，不同蜘蛛侠（女）的同框让次元壁消弭于无形。剧情模式化、套路化又怎么样？前有《海王》，现有《蜘蛛侠》，视听体验依然是观众衡量一部商业电影时最重要的标准。',5),(830,180,127,'2019-04-24 02:51:11','我读兄弟（上）','I need to see Peter Parker and Peter B. Parker go at it right now! Right now!',4),(831,146,47,'2019-05-03 16:13:11','我读沉默的大多数:王小波杂文随笔全编','的确硬核，也更为好莱坞体制下真人版超英片没法这么硬核悲哀。这里流畅的大片式动作戏带给我的快感应该胜过了绝大多数真人CG戏。二维加三维的漫画式动画画风有创意，虚焦位置的特殊处理我猜是模仿印刷效果？',4),(832,82,42,'2019-04-24 06:37:11','我读少有人走的路:心智成熟的旅程','应该把电影院座位撤了跪着看',3),(833,164,52,'2019-04-26 06:09:11','我读解忧杂货店','How in fuck\'s name can I take another live-action spider-man seriously after seeing something as dope as this?',3),(834,254,199,'2019-05-16 20:19:11','我读小王子','溢美之词毋需赘言了，但可以说，这是明年奥斯卡最佳长篇动画的有力竞争者，而且胜算很大！致敬斯坦•李老爷子，致敬2000年初的《蜘蛛侠》三部曲，除了震撼的视效，还打破了二维动画与三维动画的壁垒，少见地在CG动画中出现了二维卡通角色，更出色的是，创造了一个新的蜘蛛侠英雄世界，在很科幻的“平行宇宙”里，N个来自不同时空的蜘蛛侠齐聚一堂，光这个天才设定就值得满堂彩！而且让黑人小男孩反客为主成为绝对主角，体现了好莱坞对推动种族平等事业的肯定态度，也是继《黑豹》之后又一以黑人为主角的超级英雄片，厉害吧？还等什么，赶紧戴上3D眼镜去宽屏影院high翻天吧！',5),(835,64,61,'2019-05-20 16:14:11','我读白夜行','最后决战就是雷神3角斗场打浩克那个设定啊，打肉坦还是得靠法穿，物攻不带掉血的，反派不死下一部必出魔女斗篷。',5),(836,36,89,'2019-04-26 22:18:11','我读围城','驚豔! 這是我覺得今年最好的超級英雄片。也是繼山姆雷米的Spider-Man2後最好的Spider-Man電影。強烈推薦看3D版本才是本體。3D加2D的穿梭。混合漫畫式的分鏡與狀聲詞。玩到飛起正是用來形容他的!!! 目不暇給的視覺狂歡。充分使用了動畫才能達成的技法。而且不只形式絢麗，劇本也沒落下。堪稱做到多而不亂，主線堅挺。真是不簡單。片中還引入平行宇宙的概念。全場出現7個蜘蛛人! 但趣味橫生的同時，卻不會掩蓋到主人公小黑蛛Miles的故事，其實好劇本不在於曲折離奇。而是能否紮實的建立人物。小黑蛛是常見的起源架構。但劇情與人物有著緊密的推進，描繪這男孩的個性、 與親人的羈絆、煩惱困境，如何受挫再成長。還有Spider-Man的精神所在。片中史丹李的客串，也精妙暗喻了這個合身的過程',3),(837,150,132,'2019-05-14 23:37:11','我读三体:“地球往事”三部曲之一','一直觉得蜘蛛侠是青少年恋爱电影，这一部倒是改变了我的看法。很感动，哭了几次。原来蜘蛛侠也会离婚，也会哭，也会活得那么丧，中年大肚子蜘蛛侠就算再难过也要拯救世界。',4),(838,20,199,'2019-05-04 18:54:11','我读嫌疑人X的献身','乱七八糟',4),(839,218,201,'2019-05-15 01:27:11','我读活着','让漫画动起来的画风很赞，创意也相当不错，但第三幕就这样，是不是太无趣了点....',4),(840,125,192,'2019-05-19 17:17:11','我读挪威的森林','Marvel近几年来最炫酷色彩鲜艳的动画作品！这部动画最大的遗憾就是没拍成真人，索尼手握蜘蛛侠IP，完全可以托比演终极蜘蛛侠，前三十分钟杀青，被凯文斯宾西饰演金并干掉，然后第二任加菲版登场，填了Amazing Spider-Man系列坑，自然石头姐继续演格温，罗夏直接演上世纪蜘蛛侠齐活。平行宇宙的题材已经不算新鲜了，不仅漫画经常用来大事件素材，隔壁DC真人电视剧已经开始四次联动。Marvel作为动画方面短板，长期被隔壁数量质量吊打后终于憋出一部可圈可点的作品。3D动画可你会发现它处处彰显着漫画的特征：对话框、独白气泡、网点效果、具象化的拟声词、用圆圈图案表现宇宙能量物质的“柯比爆裂”等等，这些漫画手法的运用，让人在看电影时产生了一种新奇的“阅读感”。缺点出现的二次元纸片人机器和猪猪侠太违和了',3),(841,259,133,'2019-04-30 14:53:11','我读百年孤独','天呐索尼爸爸这是什么神仙画风，将静态印刷与动态影像结合成功打破了被迪士尼CG一统天下的格局，强调画面的风格化直接运用了漫画的分格线条，融合真人动作捕捉同时摒弃动态模糊，达到了前所未有的动画观影快感。',4),(842,28,96,'2019-05-26 02:15:11','我读红楼梦','他们终于拍出了最好的漫威漫画，可惜斯坦李已经不在了',4),(843,99,137,'2019-05-02 19:06:11','我读看见','看了首映，却一直不知道写什么好，是那个上升式的自由落体壁纸拉我入坑，但看完说实话没那么喜欢，题材OK吧，主旨已免疫，情节也挺有趣，但你说要达到八九分，个人感觉有待商榷',4),(844,103,8,'2019-04-23 12:33:11','我读平凡的世界（全三部）','画面一流，剧情三流，看到一半已经精神疲劳，看似绚烂实际不断重复毫无新意的打戏不断重复，尤其是吊着蛛丝在车流中撞车的戏码，我简直想一点五倍速。',4),(845,268,145,'2019-05-14 16:04:11','我读三体Ⅱ:黑暗森林','另外，里面的人物性格可以再无聊一点吗，感觉无比重复。',5),(846,156,136,'2019-04-24 10:34:11','我读三体Ⅲ:死神永生','最重要的是，毫无余韵。',4),(847,54,150,'2019-05-10 02:40:11','我读不能承受的生命之轻','动画就应该这样，而不是像其它动画片那样做成动画版真人电影。',3),(848,195,247,'2019-05-14 11:12:11','我读达·芬奇密码','这几年看过的美国产的最动画的动画了，事实就是动画作为一种表现形式，就应当在视觉传达上区别于真人电影。不论是带网点的上色、2D3D混合的建模、对话框的表现方式、漫画翻书式的镜头转换，都在证明这部电影真正就是动画该有的样子。剧本也相当扎实，剧情线完整。Chris Pine的声音真有辨识度，虽然会跳戏Jack Frost和Kirk声音自带blond但还是好喜欢啊啊。Stan Lee泪目。最后，开个玩笑，被蜘蛛咬了以后，身边亲密的男性……保平安……哈哈哈',3),(849,289,51,'2019-05-03 05:47:11','我读我们仨','下半年唯一吹爆，你需要更多蜘蛛侠',4),(850,246,79,'2019-05-02 17:19:11','我读天才在左疯子在右:国内第一本精神病人访谈手记','从平行宇宙过来，在此间遇到曾经错过的人，百感交集。可逆的（道歉，宽容，重逢），不可逆的（叔之死，原装成年蜘蛛侠之死），宿命的（每个蜘蛛侠都必须因为亲属的死成长为真正的英雄），三者构成一个值得为其流血流泪的人生，这个多宇宙动画版应该是最好的蜘蛛侠电影了（之前最好是萨姆·雷米版第二集）。虽然感情戏的情节冲突大多靠误会不算高明，“小队就是family”也有点老套，金并的毁灭装置也和《守望者》无甚区别，胖彼得和小蜘蛛的友谊也有点《金刚狼3》，但是不影响这个主角站在和观众一样的角度审视本片所述icon的文化意义+重写蜘蛛侠起源故事的新颖程度，情感和美术都属于精描细画、一气呵成。机器开动时纽约标志性的地铁、的士全成了梦的彩虹，想象力飞奔，看时都忘了之前本来想说的“很多画面的写实感能让人一度忘记这是一部动画电影”。',4),(851,1,196,'2019-05-07 01:28:11','我读简爱（英文全本）','九分，至于吗...排除情怀剧情其实很弱智吧...属于有情怀四星没情怀及格的水平，恰好对小虫没啥情怀...',3),(852,200,27,'2019-05-24 08:24:11','我读哈利·波特与魔法石','再次感谢观影团~！剧本什么的比海王好看多了好伐！完全不输真人版的蜘蛛侠，甚至比之前那几部都要好看，很期待续集还能搞出什么花样。梗其实还是很老梗，能力越大责任越大这个蜘蛛侠内核依旧贯穿全片，但在跨次元的画风上做了非常酷炫的处理，尤其喜欢漫画式的配字和特效，笑点非常密集，实在太爱看漫威自嘲了~你以为他们不知道槽点吗，他们其实比你们还清楚哈哈哈。全片最大的彩蛋还是斯坦·李，一出来真的让人泪目。',3),(853,49,247,'2019-05-16 16:46:11','我读明朝那些事儿（壹）:洪武大帝','在皮克斯技术流都在把动画形象做到更接近真实，在抠每一根头发和毛线纹理的时候，索尼能反其道而行之，创作出一种全新的视觉风格。画面的质感介于漫画和CG动画之间，放肆又大胆，粗粝但不粗糙。就像这部电影的故事一样，这种画风仿佛是来自另一个平行世界，极其出挑。在我看来，它打开了好莱坞动画的新维度。',4),(854,236,222,'2019-05-19 07:22:11','我读傲慢与偏见','设定很有趣，画面很爆炸，BGM很好听。也有好多有趣的彩蛋很惊喜，但是主角的成长线真的是我最讨厌的最无趣的模式没有之一了。',3),(855,68,240,'2019-04-23 12:01:11','我读目送','很有风格，不妨碍我觉得难看。',5),(856,48,60,'2019-04-29 02:03:11','我读恶意','最酷的超英电影！！！',5),(857,232,243,'2019-05-20 13:57:11','我读撒哈拉的故事','把美漫风格和动画所能超越真人部分的视效发挥到了极致。成长部分老生常谈，颓废的帕克对以往的超级英雄形象特别颠覆，蜘蛛侠聚众强调了几次“知道自己不是孤独的感觉很好”。后面几只蜘蛛足够有趣但略有些过犹不及，整体依然是漫威十分炸裂且具有突破的作品。若是有续集，平行世界的小蜘蛛联手怕是要酷到爆炸。',4),(858,102,241,'2019-04-26 19:51:11','我读霍乱时期的爱情','感谢豆瓣提前点映。视效确实无与伦比非常值得IMAX的效果也确实破了次元壁。主角太政治正确了爸爸黑人妈妈拉美裔，不知道是日漫形象画的不走心还是本来日漫画法就不适合3D，除此以外都值得观看。美漫方式的动画如果都画成这样，真的还有人需要真人版吗哈哈',5),(859,198,154,'2019-05-12 19:11:11','我读飘','北美青少年蜘蛛侠观影指南。',3),(860,110,51,'2019-04-23 05:40:11','我读许三观卖血记','看见没看见没，我最爱的蜘蛛侠有这么酷的电影啊！看见没！',3),(861,49,156,'2019-05-14 00:48:11','我读边城','《黑豹》之后继续发“黑”优势，充分发挥动画的长处，做到了真人电影无法企及的动作场面和镜头表现，利用美漫的风格做优化。前半部分很不错，后面次元壁（日本女和猪猪侠出现后）打破的平行宇宙出现后，有点出戏了。116分钟篇幅无法交代六只蜘蛛，何况过了一半时间才有第三只现身。',5),(862,285,167,'2019-05-11 08:50:11','我读倾城之恋','比想象中惊喜，有点老套的剧情，却拍成如此浪漫。小黑蛛的孩子气，彼得的中年丧比，格温的英姿飒爽，猪头的可爱，暗影的阴沉，潘妮的日系机甲风。6个蜘蛛侠性格迥异，却完美符合英雄主旨。只要带上面具，每个人都可以是蜘蛛侠。',3),(863,256,20,'2019-05-10 10:39:11','我读送你一颗子弹','视觉实现比真人超英片好多了，色彩的运用到极致，斑斓却不扎眼。配乐欢快，与明亮的画面相得益彰。最喜欢佩妮的日漫机甲，与其他几个蜘蛛侠的画风完全不一样，却丝毫不违和。',5),(864,14,233,'2019-05-07 06:50:11','我读狼图腾','喜剧元素恰到好处，中年彼得的秋裤，小黑蛛的涂鸦，都能让人会心一笑。本片是小黑蛛的成长史，亦是两代蜘蛛侠的传承。凭心而论，蜘蛛侠系列最好一部，全片才是2018最强超英片，高于海王和复联3。',3),(865,150,117,'2019-05-17 15:14:11','我读哈利·波特与阿兹卡班的囚徒','在下坂本有何贵干',3),(866,121,236,'2019-05-07 20:34:11','我读哈利·波特与火焰杯','吊打其他动画电影不成问题。基本从开头LOGO变网点纸就让人开始high，3D中偶尔露出定格、扁平风、对话框甚至故意掉帧来昭示漫改血统，视觉上又大胆又完美。萝莉巨机和猪猪侠太有梗了。剧情稍弱，但确实货真价实平行宇宙，不论哪个次元超级英雄都要靠死亲友开光真是太真实了。五星。',4),(867,128,11,'2019-05-15 03:38:11','我读盗墓笔记:七星鲁王宫','摸着我的良心（如果我有的话）说，比真人好看。',5),(868,205,97,'2019-05-21 09:18:11','我读情人','that was soooooo coooooool！以及，无论在哪个时空，贫穷还是富有，年轻或年老，紧身衣还是秋裤，Peter Parker才是最好的蜘蛛侠！',4),(869,287,192,'2019-05-24 10:14:11','我读哈利·波特与密室','超英片应有的想象力终于在动画里回归了。',4),(870,124,3,'2019-05-12 17:03:11','我读穆斯林的葬礼','看完想骂人，除了视觉效果，哪里配得上8.9分了？？？！！！异常难熬的2个小时！！',3),(871,259,29,'2019-04-24 01:13:11','我读万历十五年','最好的蜘蛛侠&真正的漫画电影！片头片尾炸裂',4),(872,76,50,'2019-05-12 17:06:11','我读人间失格','hhhh看预告真的挺期待。大叔化的Peter Parker，看气质竟然最接近荷兰弟。/060718/010119。2019年的第一部电影。OST好评。',5),(873,248,145,'2019-04-26 10:27:11','我读窗边的小豆豆','可可爱爱吧！美式动漫里突然冲进来一个日本萌系画风的小女孩也是有次元壁碎裂之感。。Stan Lee的彩蛋看的人有点伤感，致敬早期漫威的黑白蜘蛛侠这个设定也好好！',4),(874,273,229,'2019-04-27 12:54:11','我读老人与海','豬豬俠我本人',5),(875,182,225,'2019-05-18 16:23:11','我读1Q84BOOK1:4月～9月','哇哇哇好看 那龙的原型绝对是一猫',5),(876,287,75,'2019-05-03 04:45:11','我读1987','和谐的生活离不开摸头与被摸头',4),(877,244,107,'2019-04-23 16:04:11','我读黄金时代:时代三部曲','我觉得今年其他的动画片可以不要演了',4),(878,159,232,'2019-05-17 03:06:11','我读哈利·波特与混血王子','妙蛙种子龙。。呜哇',4),(879,215,3,'2019-05-06 07:35:11','我读人类简史:从动物到上帝','太喜欢无牙了，外表凶狠，内心像个孩子，摸头杀太萌了，想养',3),(880,132,15,'2019-04-30 20:09:11','我读三国演义（全二册）','90分钟绝不冷场愉悦刺激的观影体验！3D技术的进步更是锦上添花~恰到好处的笑料，让人爱不释手的角色，精准传达的主题，精彩的动作场面，都是此片绝对值得推荐的理由。遗憾的是仍有缺陷，使影片仍算不上完美。',4),(881,196,135,'2019-05-05 02:37:11','我读向左走·向右走','“和谐的生活离不开摸头与被摸头。”《驯龙高手》的优秀足以证明皮克斯动画并不是不可超越。',5),(882,219,186,'2019-05-07 12:29:11','我读哈利·波特与凤凰社','自《阿凡达》之后最愉快的3D电影观影体验。',4),(883,103,19,'2019-05-13 12:32:11','我读悟空传:修订版','“没牙”真可爱呀真可爱~',4),(884,27,94,'2019-05-02 11:56:11','我读牧羊少年奇幻之旅','梦工厂会讲故事了...',5),(885,237,240,'2019-05-17 04:36:11','我读苏菲的世界','强过阿烦达太多太多了',5),(886,211,235,'2019-05-02 03:16:11','我读房思琪的初恋乐园','酷酷的小龙外表下，是一只大型宠物犬的个性。',5),(887,2,48,'2019-05-05 06:58:11','我读鲁滨逊漂流记','剧情有点颠覆，台词狠搞笑，3d可要可不要',4),(888,193,110,'2019-05-15 07:58:11','我读天龙八部','动画还是要看梦工场~',3),(889,133,151,'2019-04-21 23:50:11','我读莲花','这根本不是驯龙，这分明就是谈恋爱！',3),(890,185,138,'2019-04-27 18:40:11','我读无声告白','没牙的本质是只狗',4),(891,35,183,'2019-05-12 02:25:11','我读呼啸山庄','好吧，伟大的IMAX 3D技术自阿凡达之后又一次令我汗毛直立，再加上如此流畅又有爱的故事，5星收下吧！',5),(892,65,104,'2019-05-17 01:27:11','我读亲爱的安德烈','尽管对人与龙关系的描写未免逼格过低，但小嗝嗝和没牙间的互动着实非常挑逗，有着浓厚的情色意味，堪称是对反抗与驯服的银幕经典描述，美中不足的是小嗝嗝没能战胜直男的劣根性，把女朋友也带去骑龙，上演了一出小三上位的戏码，大大降低了后半段的观赏性，令人扼腕。',3),(893,109,184,'2019-05-02 01:28:11','我读基督山伯爵','我要那个龙！！那个龙！！！',3),(894,166,142,'2019-05-06 07:23:11','我读白鹿原','04.04 UA iSquare IMAX, HK/Stay close to me....Open your eyes and seeeeeee. 加油思噎仔，加油无牙仔！',4),(895,183,228,'2019-05-08 06:33:11','我读骆驼祥子','灵感来自“谁胯下的鸟大听谁的”',5),(896,220,209,'2019-05-16 07:15:11','我读灿烂千阳','超喜欢闪电。故事很新颖，养条龙真是太酷了，老爸和儿子也很有爱。',5),(897,68,160,'2019-05-10 21:06:11','我读局外人','男主小嗝嗝和没牙龙龙都超级可爱！*^o^*很温情成长的故事，画面也很精彩。',3),(898,159,36,'2019-04-26 13:25:11','我读茶花女','这片儿告诉我们的道理仍然是：技术宅拯救世界。',3),(899,222,162,'2019-04-28 22:43:11','我读海边的卡夫卡','没有机会在大屏幕上看到这部作品，深为遗憾。还好就算没有震撼的3D与IMAX，还有感动人心的剧情。结尾失去左脚的小男孩与失去尾翼的小飞龙站在一起，有种奇妙的和谐感。也许我们在历经一生寻找朋友、爱人、知心人的过程中，也是在寻找一种奇妙的和谐感吧！',4),(900,96,244,'2019-04-26 00:53:11','我读一个陌生女人的来信','真的很佩服梦工厂的造片功力，一如是初的纯粹剧情，却犹然能够大快人心。PS：“无牙”的可爱造型果然像极了龙猫，这是讨巧，也是缅怀。',3),(901,89,200,'2019-05-02 21:39:11','我读笑傲江湖（全四册）','x  和孙秀娟一起看的',3),(902,123,239,'2019-04-28 02:12:11','我读福尔摩斯探案全集（上中下）','10年目前为止国内上映唯一值得我打五星的，有笑点有哭点，有梦想有未来。',5),(903,85,116,'2019-05-13 18:30:11','我读兄弟（上）','好看好看！那个无牙龙崽萌啊~~~',4),(904,47,186,'2019-05-01 11:34:11','我读沉默的大多数:王小波杂文随笔全编','毫无理由的喜欢',4),(905,111,87,'2019-05-07 04:01:11','我读少有人走的路:心智成熟的旅程','我怎么觉得一点都不好看呢。对于那么喜欢看动画片的我来说。情节实在有点弱。',5),(906,226,19,'2019-04-22 07:38:11','我读了不起的盖茨比','我的宠物是条龙，好羡慕啊！',3),(907,61,126,'2019-05-13 10:36:11','我读东方快车谋杀案','孩子的眼中没有恐惧，只有好奇和爱心，所以无牙有了主人，小主人也有了人生目标！动画片就是有温暖人心的魔力！',4),(908,136,240,'2019-05-02 09:44:11','我读情书','3D处女看，硬件的问题，夜景太暗了~ 这就是动画版的《魔幻屠龙》，很弱的主角在和魔龙的接触过程中迸发了感情，并且得到了成长。就是龙做的太简单了，喜欢此片的朋友建议再找出《魔幻屠龙》看看，那绝对是典范之作。',3),(909,205,87,'2019-05-10 14:25:11','我读无人生还','又进imdb Top 250: #178了。继续展现Avatar的铁血定律：有了香车，美女也就不远了。火星、尘埃的3D效果最佳，什么时候有人拍3DB级片，口吐血沫的效果将让人大为期待。',3),(910,30,187,'2019-05-16 23:43:11','我读神雕侠侣','超暖心',4),(911,135,165,'2019-05-21 00:10:11','我读巴黎圣母院','无牙太萌了，哈哈哈哈！',4),(912,202,159,'2019-05-13 23:36:11','我读民主的细节:美国当代政治观察随笔','没牙龙宝宝萌萌哒，还是温馨的一起成长的故事，整体还好',3),(913,43,142,'2019-04-29 12:32:11','我读肖申克的救赎','百看不厌之佳作：《驯龙高手》！—— IMDb上评价最好的梦工厂动画长片，豆瓣上与《疯狂原始人》并列最佳，可惜同年出了口碑更胜一筹的《玩具总动员3》，让其与奥斯卡最佳动画长片失之交臂。—— 在天上飞的时候看的电影也要一起“飞”：《在云端》→《飞屋环游记》→《红猪》→《驯龙高手》。-2018.1.3',4),(914,210,113,'2019-04-29 21:11:11','我读月亮与六便士','每个孩子在长大的过程中都该拥有这么一个最值得依靠的小伙伴。',3),(915,141,175,'2019-04-23 20:13:11','我读羊脂球','小嗝嗝和无牙仔的友情，和阿斯特丽德的爱情，和父亲的亲情，三重情感同时迸发，充满感动和柔情，兼具温暖和治愈，太完美了。',3),(916,172,122,'2019-05-13 01:59:11','我读呐喊','脑洞大开',5),(917,292,146,'2019-04-28 01:38:11','我读遇见未知的自己','可爱充满童趣 除此之外无亮点',5),(918,149,134,'2019-05-01 06:23:11','我读乌合之众:大众心理研究','Full of the usual cliche\'s and predictable in every scene, this movie is still far from Wall-E. I don\'t get the hype about it.',5),(919,2,67,'2019-04-27 08:35:11','我读动物农场','night beauty 这名字哈哈哈',3),(920,246,115,'2019-05-13 23:23:11','我读爱你就像爱生命','无论是爱情还是友情，总有一抹投入你心底。',4),(921,193,228,'2019-05-04 08:42:11','我读当我谈跑步时我谈些什么','无牙超级萌啊！这部影片我觉得挺好的，反正我没失望，无牙和小嗝嗝之间的有些情节是真的很让我感动啊。',3);
